ಿಸಿ, ಆದರೆ ಹೊಣೆಯರಿತು ಬರೆಯಿರಿ!','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'ನೀವು ಮೊದಲು <a href="%s">ಲಾಗ್ ಇನ್</a> ಆಗಬೇಕು, ನಂತರ ನೀವು ಹೊಸ ಜಾಲತಾಣವನ್ನು ರಚಿಸಬಹುದು.','You are logged in already. No need to register again!'=>'ನೀವು ಈಗಾಗಲೇ ಲಾಗ್ ಇನ್ ಆಗಿದ್ದೀರಿ. ಮತ್ತೊಮ್ಮೆ ನೋಂದಣಿಯಾಗುವ ಅವಶ್ಯಕತೆ ಇಲ್ಲ!','A term with the name provided already exists with this parent.'=>'ನಮೂದಿಸಿರುವ ಪದವು ಈಗಾಗಲೇ ಇದರ ಮಾತೃವಿನ ಜೊತೆ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','Theme without %s'=>'%s ರಹಿತ ಥೀಮ್','Please include a %s template in your theme.'=>'ನಿಮ್ಮ ಥೀಮ್ ನಲ್ಲಿ %s ಟೆಂಪ್ಲೇಟನ್ನು ದಯವಿಟ್ಟು ಸೇರಿಸಿರಿ.','<strong>Error:</strong> This username is invalid because it uses illegal characters. Please enter a valid username.'=>'<strong>ದೋಷ:</strong> ಈ ಬಳಕೆದಾರರ ಹೆಸರು ಸಮ್ಮತವಾಗಿಲ್ಲ, ಏಕೆಂದರೆ ಇದರಲ್ಲಿ ಆಕ್ಷೇಪಾರ್ಹ ಅಕ್ಷರಗಳಿವೆ. ದಯವಿಟ್ಟು ಸರಿಯಾದ ಬಳಕೆದಾರರ ಹೆಸರು ನಮೂದಿಸಿ.','Your registration email is sent to this address. (Double-check your email address before continuing.)'=>'ನಿಮ್ಮ ನೋಂದಣಿ ಇಮೇಲ್ ಅನ್ನು ಈ ವಿಳಾಸಕ್ಕೆ ಕಳುಹಿಸಲಾಗಿದೆ. (ಮುಂದುವರಿಯುವ ಮೊದಲು ನಿಮ್ಮ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಖಾತ್ರಿಮಾಡಿಕೊಳ್ಳಿ.)','Wait a little longer. Sometimes delivery of email can be delayed by processes outside of our control.'=>'ಇನ್ನೂ ಸ್ವಲ್ಪ ಸಮಯ ಕಾಯಿರಿ. ಕೆಲವೊಮ್ಮೆ ಮಿಂಚೆಯ ವಿಲೇವಾರಿ ನಮ್ಮ ಕಾರ್ಯವ್ಯಾಪ್ತಿಯ ಹೊರಗೆ ತಡವಾಗಬಹುದು.','Check the junk or spam folder of your email client. Sometime emails wind up there by mistake.'=>'ನಿಮ್ಮ ಮಿಂಚೆ ಕ್ಲಯಂಟ್ ನ ಜಂಕ್ ಅಥವಾ ಸ್ಪಾಮ್ ಫೋಲ್ಡರ್ ನಲ್ಲಿ ಪರೀಕ್ಷಿಸಿ. ಕೆಲವೊಮ್ಮೆ ಮಿಂಚೆಗಳು ಕಣ್ತಪ್ಪಿನಿಂದ ಅಲ್ಲಿಗೆ ಹೋಗಿರಬಹುದು.','Sorry, new registrations are not allowed at this time.'=>'ಕ್ಷಮಿಸಿ, ಹೊಸ ನೋಂದಣಿಗಳನ್ನು ಸಧ್ಯಕ್ಕೆ ತಡೆಹಿಡಿಯಲಾಗಿದೆ.','This post is password protected. Enter the password to view comments.'=>'ಈ ಲೇಖನ ಪ್ರವೇಶಪದದಿಂದ ರಕ್ಷಿತವಾಗಿದೆ. ಟಿಪ್ಪಣಿಗಳನ್ನು ನೋಡಲು ಪ್ರವೇಶಪದವನ್ನು ನಮೂದಿಸಿ.','%1$s is proudly powered by %2$s'=>'%1$s ಹೆಮ್ಮೆಯಿಂದ %2$s ನಿಂದ ಸಾಮರ್ಥ್ಯ ಪಡೆದಿದೆ','You are currently browsing the archives for the %s category.'=>'ನೀವು ಈಗ %s ವಿಭಾಗದ ಸಂಗ್ರಹಗಳನ್ನು ಬ್ರೌಸ್ ಮಾಡುತ್ತಿದ್ದೀರಿ.','l, F jS, Y'=>'l, F jS, Y','F, Y'=>'F, Y','You have searched the %1$s blog archives for <strong>&#8216;%2$s&#8217;</strong>. If you are unable to find anything in these search results, you can try one of these links.'=>'ನೀವು %1$s ಬ್ಲಾಗ್ ಸಂಗ್ರಹದಲ್ಲಿ <strong>&#8216;%2$s&#8217;</strong> ಗಳಿಗಾಗಿ ಹುಡುಕಿದ್ದೀರಿ. ಈ ಹುಡುಕಾಟದ ಫಲಿತಾಂಶಗಳಲ್ಲಿ ನಿಮಗೆ ಬೇಕಾಗಿರುವುದು ಸಿಕ್ಕದಿದ್ದಲ್ಲಿ, ಈ ಕೆಳಕಂಡ ಲಿಂಕ್ ಗಳಲ್ಲಿ ಒಮ್ಮೆ ಪ್ರಯತ್ನಿಸಿ .','User'=>'ಬಳಕೆದಾರರು','Link Category'=>'ಲಿಂಕ್ ವಿಭಾಗ','Search Link Categories'=>'ಲಿಂಕ್ ವಿಭಾಗಗಳಲ್ಲಿ ಹುಡುಕಿ','All Link Categories'=>'ಎಲ್ಲಾ ಲಿಂಕ್ ವಿಭಾಗಗಳು','Update Link Category'=>'ಲಿಂಕ್ ವಿಭಾಗನ್ನು ಉನ್ನತೀಕರಿಸಿ','Add New Link Category'=>'ಹೊಸ ಲಿಂಕ್ ವಿಭಾಗನ್ನು ಸೇರಿಸಿ','New Link Category Name'=>'ಹೊಸ ಲಿಂಕ್ ವಿಭಾಗದ ಹೆಸರು','Someone has requested a password reset for the following account:'=>'ಯಾರೋ ಒಬ್ಬರು, ಈ ಕೆಳಗಿನ ಖಾತೆಯ ಪ್ರವೇಶಪದವನ್ನು ಮರುಹೊಂದಿಸಲು ವಿನಂತಿಸಿದ್ದಾರೆ:','If this was a mistake, ignore this email and nothing will happen.'=>'ಇದು ತಪ್ಪಾಗಿದ್ದಲ್ಲಿ, ಈ ಮಿಂಚೆಯನ್ನು ಕಡೆಗಣಿಸಿ ಮತ್ತು ಇದರಿಂದ ಯಾವುದೇ ತೊಂದರೆಯಾಗುವುದಿಲ್ಲ.','To reset your password, visit the following address:'=>'ಪ್ರವೇಶಪದವನ್ನು ಮರುಹೊಂದಿಸಲು, ಈ ವಿಳಾಸಕ್ಕೆ ಭೇಟಿಕೊಡಿ:','Password Reset'=>'ಪ್ರವೇಶಪದವನ್ನು ಮರುಹೊಂದಿಸಿ','Your password has been reset.'=>'ನಿಮ್ಮ ಪ್ರವೇಶಪದವನ್ನು ಮರುಹೊಂದಿಸಲಾಗಿದೆ.','Reset Password'=>'ಪ್ರವೇಶಪದವನ್ನು ಮರುಹೊಂದಿಸಿ','New password'=>'ಹೊಸ ಪ್ರವೇಶಪದ','Confirm new password'=>'ಹೊಸ ಪ್ರವೇಶಪದವನ್ನು ಖಾತ್ರಿ ಮಾಡಿ','Display as dropdown'=>'ಡ್ರಾಪ್ ಡೌನ್ ಅಂತೆ ಪ್ರದರ್ಶಿಸಿ','domain'=>'ಡೊಮೈನ್','Your address will be %s.'=>'ನಿಮ್ಮ ವಿಳಾಸ ಇಲ್ಲಿದೆ: %s.','post formatFormat'=>'ನಮೂನೆ','links widgetAll Links'=>'ಎಲ್ಲಾ ಲಿಂಕ್ ಗಳು','%1$s is your new site. <a href="%2$s">Log in</a> as &#8220;%3$s&#8221; using your existing password.'=>'%1$s ನಿಮ್ಮ ಹೊಸ ಸೈಟ್ <a href="%2$s">ಲಾಗ್ಇನ್ </a> ಆಗಿ  &#8220;%3$s&#8221; ನಿಮ್ಮಲ್ಲಿರುವ ಗುಪ್ರಪದವನ್ನು ಬಳಸಿ.','You can create a %s file through a web interface, but this doesn\'t work for all server setups. The safest way is to manually create the file.'=>'ನೀವು %s ಕಡತವನ್ನು ಜಾಲದ ಮೂಲಕ ರಚಿಸಬಹುದು, ಆದರೆ ಇದು ಎಲ್ಲಾ ಸರ್ವರ್ ಸ್ಥಾಪನೆಗಳಲ್ಲಿ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ. ನಿಮ್ಮ ಕೈಯ್ಯಾರೆ ಈ ಕಡತವನ್ನು ರಚಿಸುವುದು ಹೆಚ್ಚು ಸುರಕ್ಷಿತವಾದ 