 information, such as an address and phone number. You might also try a plugin to add a contact form.'=>'ಇದು ವಿಳಾಸ ಮತ್ತು ಫೋನ್ ಸಂಖ್ಯೆಯಂತಹ ಕೆಲವು ಮೂಲ ಸಂಪರ್ಕ ಮಾಹಿತಿಯಿರುವ ಪುಟವಾಗಿದೆ. ಸಂಪರ್ಕ ಫಾರ್ಮ್ ಅನ್ನು ಸೇರಿಸಲು ನೀವು ಪ್ಲಗಿನ್ ಅನ್ನು ಸಹ ಪ್ರಯತ್ನಿಸಬಹುದು.','Theme starter contentNews'=>'ಸುದ್ದಿ','Theme starter contentThis is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.'=>'ಇದು ಮುಖಪುಟ ವಿಭಾಗಕ್ಕೆ ಉದಾಹರಣೆಯಾಗಿದೆ. ಮುಖಪುಟ ವಿಭಾಗಗಳು ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಬ್ಲಾಗ್ ಪೋಸ್ಟ್‌ಗಳನ್ನು ತೋರಿಸುವ ಪುಟವನ್ನು ಒಳಗೊಂಡಂತೆ ಮುಖಪುಟವನ್ನು ಹೊರತುಪಡಿಸಿ ಯಾವುದೇ ಪುಟವಾಗಿರಬಹುದು.','Theme starter contentArchives'=>'ಸಂಗ್ರಹಗಳು','Video is paused.'=>'ವೀಡಿಯೊವನ್ನು ವಿರಾಮಗೊಳಿಸಲಾಗಿದೆ.','Video is playing.'=>'ವೀಡಿಯೊ ಪ್ಲೇ ಆಗುತ್ತಿದೆ.','Displays an audio player.'=>'ಆಡಿಯೊ ಪ್ಲೇಯರ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'ಶ್ರಾವ್ಯವನ್ನು ಬದಲಿಸಿ','label for button in the audio widget; should preferably not be longer than ~13 characters longEdit Audio'=>'ಆಡಿಯೋ ಸಂಪಾದಿಸಿ','Audio Widget (%d)'=>'ಆಡಿಯೊ ವಿಜೆಟ್ (%d)' . "\0" . 'ಆಡಿಯೊ ವಿಜೆಟ್ (%d)','Audio Widget'=>'ಆಡಿಯೋ ವಿಜೆಟ್','URL to the %s audio source file'=>'%s ಆಡಿಯೊ ಮೂಲ ಕಡತಕ್ಕೆ URL','Unable to preview media due to an unknown error.'=>'ಅಜ್ಞಾತ ದೋಷದಿಂದಾಗಿ ಮಾಧ್ಯಮವನ್ನು ಪೂರ್ವವೀಕ್ಷಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Displays an image.'=>'ಚಿತ್ರವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'ಗ್ಯಾಲರಿ ಸಂಪಾದಿಸಿ','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'ಚಿತ್ರವನ್ನು ಬದಲಿಸಿ','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಿ','Image Widget (%d)'=>'ಇಮೇಜ್ ವಿಜೆಟ್ ( %d )' . "\0" . 'ಇಮೇಜ್ ವಿಜೆಟ್ ( %d )','Image Widget'=>'ಚಿತ್ರ ವಿಜೆಟ್','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಯಿಂದ ಅಥವಾ ಯೂಟ್ಯೂಬ್, ವಿಮಿಯೋ ಅಥವಾ ಇನ್ನೊಂದು ಪೂರೈಕೆದಾರರಿಂದ ವೀಡಿಯೊವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'ಚಿತ್ರಗಳನ್ನು ಸೇರಿಸಿ','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'ದೃಶ್ಯಾವಳಿಯನ್ನು ಬದಲಿಸಿ','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'ವೀಡಿಯೊ ಸಂಪಾದಿಸಿ','Video Widget (%d)'=>'ವೀಡಿಯೊ ವಿಜೆಟ್ (%d)' . "\0" . 'ವೀಡಿಯೊ ವಿಜೆಟ್‍ಗಳು (%d)','Video Widget'=>'ವೀಡಿಯೊ ವಿಜೆಟ್','URL to the %s video source file'=>'%s ವೀಡಿಯೊ ಮೂಲ ಫೈಲ್ಗೆ URL','A media item.'=>'ಒಂದು ಮಾಧ್ಯಮ ವಸ್ತು.','No media selected'=>'ಯಾವುದೇ ಮಾಧ್ಯಮ ಆಯ್ಕೆ ಮಾಡಿಲ್ಲ','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'ಮಾಧ್ಯಮವನ್ನು ಬದಲಾಯಿಸಿ','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'ಮಾಧ್ಯಮವನ್ನು ಸಂಪಾದಿಸಿ','Add to Widget'=>'ವಿಜೆಟ್‍ಗೆ ಸೇರಿಸಿ','Media Widget (%d)'=>'ಮಾಧ್ಯಮ ವಿಜೆಟ್(%d)' . "\0" . 'ಮಾಧ್ಯಮ ವಿಜೆಟ್‍ಗಳು (%d)','Media Widget'=>'ಮಾಧ್ಯಮ ವಿಜೆಟ್','Attachment post ID'=>'ಲಗತ್ತು ಲೇಖನದ ID','URL to the media file'=>'ಮಾಧ್ಯಮ ಕಡತಕ್ಕೆ URL','Title for the widget'=>'ವಿಜೆಟ್ಗಾಗಿ ಶೀರ್ಷಿಕೆ','Greetings Network Administrator!'=>'ಶುಭಾಶಯಗಳು ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕ!','The network currently disallows registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ನೋಂದಣಿಗಳನ್ನು ಅನುಮತಿಸುವುದಿಲ್ಲ.','The network currently allows site registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ತಾಣ ನೋಂದಣಿಗಳನ್ನು ಅನುಮತಿಸುತ್ತದೆ.','The network currently allows user registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರ ದಾಖಲಾತಿಗಳನ್ನು ಅನುಮತಿಸುತ್ತದೆ.','The network currently allows both site and user registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ತಾಣ ಮತ್ತು ಬಳಕೆದಾರರ ದಾಖಲಾತಿಗಳನ್ನು ಅನುಮತಿಸುತ್ತದೆ.','To change or disable registration go to your <a href="%s">Options page</a>.'=>'ನೋಂದಣಿ ಬದಲಾಯಿಸಲು ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ನಿಮ್ಮ <a href="%s">ಆಯ್ಕೆಗಳು ಪುಟ</a> ಕ್ಕೆ ಹೋಗಿ.','label for button in the audio widgetAdd Audio'=>'ಆಡಿಯೋ ಸೇರಿಸಿ','label for button in the image widgetAdd Image'=>'ಚಿತ್ರವನ್ನು ಸೇರಿಸಿ','label for button in the video widgetAdd Video'=>'ವೀಡಿಯೊ ಸೇರಿಸಿ','label for button in the media widgetAdd Media'=>'ಮಾಧ್ಯಮವನ್ನು ಸೇರಿಸಿ','Show tag counts'=>'ಟ್ಯಾಗ್ ಎಣಿಕೆಗಳನ್ನು ತೋರಿಸಿ','Arbitrary HTML code.'=>'ನಿರಂಕುಶ HTML ಕೋಡ್.','Custom HTML'=>'ಕಸ್ಟಮ್ HTML','Some HTML tags are not permitted, including:'=>'ಕೆಲವು HTML ಟ್ಯಾಗ್‌ಗಳನ್ನು ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ, ಅವುಗಳೆಂದರೆ:','Arbitrary text.'=>'ಅನಿಯಂತ್ರಿತ ಪಠ್ಯ.','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'ಈ ವಿಜೆಟ್ &#8220;Custom HTML&#8221; ವಿಜೆಟ್ನಲ್ಲಿ ಉತ್ತಮವಾಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸಬಹುದಾದ ಕೋಡ್ ಅನ್ನು ಹೊಂದಿರಬಹುದು. ಬದಲಾಗಿ ಆ ವಿಜೆಟ್ ಅನ್ನು ಪ್ರಯತ್ನಿಸಿದರೆ ಹೇಗೆ?','New Custom HTML Widget'=>'ಹೊಸ ಅಗತ್ಯಾನುಗೊಳಿಸಿದ HTML ವಿಜೆಟ್','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'ಈಗ "ಕಸ್ಟಮ್ ಎಚ್ ಟಿಎಮ್ ಎಲ್" ವಿಜೆಟ್ ಇದೆ ಎಂದು ನಿಮಗೆ ತಿಳಿದಿದೆಯೇ? <a class="add-widget" href="#">"ವಿಜೆಟ್ ಸೇರಿಸಿ"</a>ಬಟನ್ ಒತ್ತಿ ಮತ್ತು "ಎಚ್ ಟಿಎಂಎಲ್" ಗಾಗಿ ಹುಡುಕುವ ಮೂಲಕ ನೀವು ಅದನ್ನು ಕಂಡುಕೊಳ್ಳಬಹುದು. ನಿಮ್ಮ ಸೈಟ್ ಗೆ ಕೆಲವು ಕಸ್ಟಮ್ ಕೋಡ್ ಸೇರಿಸಲು ಅದನ್ನು ಪರಿಶೀಲಿಸಿ!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'ಈಗ "ಕಸ್ಟಮ್ ಎಚ್ ಟಿಎಮ್ ಎಲ್" ವಿಜೆಟ್ ಇದೆ ಎಂದು ನಿಮಗೆ ತಿಳಿದಿದೆಯೇ? ಈ ಪರದೆಯಲ್ಲಿ ಲಭ್ಯವಿರುವ ವಿಜೆಟ್ ಗಳ ಪಟ್ಟಿಯನ್ನು ಸ್ಕ್ಯಾನ್ ಮಾಡುವ ಮೂಲಕ ನೀವು ಅದನ್ನು ಕಂಡುಕೊಳ್ಳಬಹುದು. ನಿಮ್ಮ ಸೈಟ್ ಗೆ ಕೆಲವು ಕಸ್ಟಮ್ ಕೋಡ್ ಸೇರಿಸಲು ಅದನ್ನು ಪರಿಶೀಲಿಸಿ!','Did you just paste HTML?'=>'ನೀವು HTML ಅನ್ನು ಅಂಟಿಸಿದ್ದೀರಾ?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'ಹೇ ಅಲ್ಲಿ, ನೀವು ಪಠ್ಯ ವಿಜೆಟ್ ನ "ವಿಷುವಲ್" ಟ್ಯಾಬ್ ಗೆ ಎಚ್ ಟಿಎಂಎಲ್ ಅನ್ನು ಅಂಟಿಸಿದಂತೆ ಕಾಣುತ್ತದೆ. ಅದರ ಬದಲು ನೀವು ನಿಮ್ಮ ಕೋಡ್ ಅನ್ನು "ಪಠ್ಯ" ಟ್ಯಾಬ್ ಗೆ ಅಂಟಿಸಲು ಬಯಸಬಹುದು. ಪರ್ಯಾಯವಾಗಿ, ಹೊಸ "ಕಸ್ಟಮ್ ಎಚ್ ಟಿಎಮ್ ಎಲ್" ವಿಜೆಟ್ ಅನ್ನು ಪ್ರಯತ್ನಿಸಿ!','Publish Settings'=>'ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಪ್ರಕಟಿಸಿ','Draft Saved'=>'ಡ್ರಾಫ್ಟ್ ಉಳಿಸಲಾಗಿದೆ','Updating'=>'ಪರಿಷ್ಕರಿಸಲಾಗುತ್ತಿದೆ','Please save your changes in order to share the preview.'=>'ಪೂರ್ವವೀಕ್ಷಣೆಯನ್ನು ಹಂಚಿಕೊಳ್ಳಲು ದಯವಿಟ್ಟು ನಿಮ್ಮ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸಿ.','Discard changes'=>'ಬದಲಾವಣೆಗಳನ್ನು ತ್ಯಜಿಸುತ್ತದೆ','Downloading your new theme&hellip;'=>'ನಿಮ್ಮ ಹೊಸ ಥೀಮ್ ಡೌನ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ & hellip;','Setting up your live preview. This may take a bit.'=>'ನಿಮ್ಮ ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆ ಹೊಂದಿಸಲಾಗುತ್ತಿದೆ. ಇದು ಸ್ವಲ್ಪ ಸಮಯ ತೆಗೆದುಕೊಳ್ಳಬಹುದು.','Reverting unpublished changes&hellip;'=>'ಅಪ್ರಕಟಿತ ಬದಲಾವಣೆಗಳನ್ನು ಹಿಂತಿರುಗಿಸಲಾಗುತ್ತಿದೆ&hellip;','Are you sure you want to discard your unpublished changes?'=>'ನಿಮ್ಮ ಅಪ್ರಕಟಿತ ಬದಲಾವಣೆಗಳನ್ನು ತ್ಯಜಿಸಲು ನೀವು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ?','There is a more recent autosave of your changes than the one you are previewing. <a href="%s">Restore the autosave</a>'=>'ನೀವು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡುವುದಕ್ಕಿಂತ ನಿಮ್ಮ ಬದಲಾವಣೆಗಳ ಇತ್ತೀಚಿನ ಸ್ವಯಂ ಉಳಿತಾಯವಿದೆ. <a href="%s">ಸ್ವಯಂ ಉಳಿತಾಯವನ್ನು ಮರುಸ್ಥಾಪಿಸಿ</a>','There is %d error which must be fixed before you can save.'=>'%d ದೋಷಗಳಿವೆ, ನೀವು ಉಳಿಸುವ ಮೊದಲು ಅದನ್ನು ಸರಿಪಡಿಸಬೇಕು.' . "\0" . '%d ದೋಷವಿದೆ, ನೀವು ಉಳಿಸುವ ಮೊದಲು ಅದನ್ನು ಸರಿಪಡಿಸಬೇಕು.','Homepage and posts page must be different.'=>'ಮುಖಪುಟ ಮತ್ತು ಪೋಸ್ಟ್‌ಗಳ ಪುಟವು ವಿಭಿನ್ನವಾಗಿರಬೇಕು.','Schedule your customization changes to publish ("go live") at a future date.'=>'ಭವಿಷ್ಯದ ದಿನಾಂಕದಲ್ಲಿ ("ಲೈವ್ ಆಗಿ") ಪ್ರಕಟಿಸಲು ನಿಮ್ಮ ಗ್ರಾಹಕೀಕರಣ ಬದಲಾವಣೆಗಳನ್ನು ನಿಗದಿಪಡಿಸಿ.','&larr; Go to Link Categories'=>'&larr; ಲಿಂಕ್ ವರ್ಗಗಳಿಗೆ ಹೋಗಿ','<strong>Error:</strong> The email address is already used.'=>'<strong>ದೋಷ:</strong> ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಈಗಾಗಲೇ ಬಳಸಲಾಗಿದೆ.','Howdy ###USERNAME###,

