'theme<strong>Error:</strong> Current WordPress version does not meet minimum requirements for %s.'=>'<strong>ದೋಷ:</strong> ಪ್ರಸ್ತುತ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ %s ಗಾಗಿ ಕನಿಷ್ಠ ಅವಶ್ಯಕತೆಗಳನ್ನು ಪೂರೈಸುವುದಿಲ್ಲ.','The feature "type" is not valid JSON Schema type.'=>'"ಟೈಪ್" ವೈಶಿಷ್ಟ್ಯವು ಮಾನ್ಯ JSON ಸ್ಕೀಮಾ ಪ್ರಕಾರವಲ್ಲ.','When registering a "variadic" theme feature, the "type" must be an "array".'=>'"ವೇರಿಯಡಿಕ್" ಥೀಮ್ ವೈಶಿಷ್ಟ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, "ಟೈಪ್" ಒಂದು "ಅರೇ" ಆಗಿರಬೇಕು','When registering an "array" or "object" feature to show in the REST API, the feature\'s schema must also be defined.'=>'REST API ನಲ್ಲಿ ತೋರಿಸಲು "ಅರೇ" ಅಥವಾ "ಆಬ್ಜೆಕ್ಟ್" ವೈಶಿಷ್ಟ್ಯವನ್ನು  ನೋಂದಾಯಿಸುವಾಗ, ವೈಶಿಷ್ಟ್ಯದ ಸ್ಕೀಮಾವನ್ನು ಸಹ ವ್ಯಾಖ್ಯಾನಿಸಬೇಕು.','When registering an "array" feature, the feature\'s schema must include the "items" keyword.'=>'"ಅರೇ" ವೈಶಿಷ್ಟ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ವೈಶಿಷ್ಟ್ಯದ ಸ್ಕೀಮಾವು "ಐಟಂಗಳು" ಕೀವರ್ಡ್ ಅನ್ನು ಒಳಗೊಂಡಿರಬೇಕು.','When registering an "object" feature, the feature\'s schema must include the "properties" keyword.'=>'"ವಸ್ತು" ವೈಶಿಷ್ಟ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ವೈಶಿಷ್ಟ್ಯದ ಸ್ಕೀಮಾವು "ಗುಣಲಕ್ಷಣಗಳು" ಕೀವರ್ಡ್ ಅನ್ನು ಒಳಗೊಂಡಿರಬೇಕು.','The post types that support thumbnails or true if all post types are supported.'=>'ಥಂಬ್‌ನೇಲ್‌ಗಳನ್ನು ಬೆಂಬಲಿಸುವ ಪೋಸ್ಟ್ ಪ್ರಕಾರಗಳು ಅಥವಾ ಎಲ್ಲಾ ಪೋಸ್ಟ್ ಪ್ರಕಾರಗಳನ್ನು ಬೆಂಬಲಿಸಿದರೆ ನಿಜ.','RSS Feed'=>'RSS ಫೀಡ್','Comment'=>'ಪ್ರತಿಕ್ರಿಯೆ','Menu Item'=>'ಮೆನು ವಸ್ತು','The "%s" must be a callable function.'=>'"%s" ಒಂದು ಕರೆಯಬಹುದಾದ ಕಾರ್ಯವಾಗಿರಬೇಕು.','This password reset request originated from the IP address %s.'=>'ಈ ಪಾಸ್‌ವರ್ಡ್ ಮರುಹೊಂದಿಸುವ ವಿನಂತಿಯು IP ವಿಳಾಸ %s ನಿಂದ ಹುಟ್ಟಿಕೊಂಡಿದೆ.','You need to pass an array of post formats.'=>'ನೀವು ಪೋಸ್ಟ್ ಫಾರ್ಮ್ಯಾಟ್‌ಗಳ ಅರೇ ಅನ್ನು ಪಾಸ್ ಮಾಡಬೇಕಾಗುತ್ತದೆ.','The provided password is an invalid application password.'=>'ಒದಗಿಸಲಾದ ಪಾಸ್ ವರ್ಡ್ ಒಂದು ಅಮಾನ್ಯವಾದ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಆಗಿದೆ.','Appearance'=>'ಗೋಚರತೆ','Enter your new password below or generate one.'=>'ನಿಮ್ಮ ಹೊಸ ಗುಪ್ತಪದವನ್ನು ಕೆಳಗೆ ನಮೂದಿಸಿ ಅಥವಾ ಒಂದನ್ನು ರಚಿಸಿ.','Generate Password'=>'ಗುಪ್ತಪದವನ್ನು ರಚಿಸಿ','Save Password'=>'ಗುಪ್ತಪದವನ್ನು ಉಳಿಸಿ'