ation.'=>'ನಿಮ್ಮ ನ್ಯಾವಿಗೇಷನ್‌ಗೆ ಉಪಮೆನುವನ್ನು ಸೇರಿಸಿ.','block titleNavigation'=>'ಸಂಚರಣೆ','block descriptionA collection of blocks that allow visitors to get around your site.'=>'ಸಂದರ್ಶಕರು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಸುತ್ತಲು ಅನುಮತಿಸುವ ಬ್ಲಾಕ್‌ಗಳ ಸಂಗ್ರಹ.','block titlePattern'=>'ಮಾದರಿ','block descriptionShow a block pattern.'=>'ಬ್ಲಾಕ್ ಮಾದರಿಯನ್ನು ತೋರಿಸಿ.','block titlePost Author'=>'ಪೋಸ್ಟ್ ಲೇಖಕ','block titlePost Comments Form'=>'ಕಾಮೆಂಟ್ಸ್ ಫಾರ್ಮನ್ನು ಪೋಸ್ಟ್ ಮಾಡಿ','block descriptionDisplay a post\'s comments form.'=>'ಒಂದು ಪೋಸ್ಟ್‌ನ ಕಾಮೆಂಟ್ಸ್ ಫಾರ್ಮನ್ನು ಪ್ರದರ್ಶಿಸಿ.','block titlePost Navigation Link'=>'ಪೋಸ್ಟ್ ನ್ಯಾವಿಗೇಷನ್ ಲಿಂಕ್','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'ಪ್ರಸ್ತುತ ಪೋಸ್ಟ್‌ಗೆ ಪಕ್ಕದಲ್ಲಿರುವ ಮುಂದಿನ ಅಥವಾ ಹಿಂದಿನ ಪೋಸ್ಟ್ ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titleNext Page'=>'ಮುಂದಿನ ಪುಟ','block titlePage Numbers'=>'ಪುಟ ಸಂಖ್ಯೆಗಳು','block titlePrevious Page'=>'ಹಿಂದಿನ ಪುಟ','block titlePagination'=>'ಪುಟ ವಿನ್ಯಾಸ','block style labelPlain'=>'ಸರಳ','block descriptionCreate structured content in rows and columns to display information.'=>'ಮಾಹಿತಿಯನ್ನು ಪ್ರದರ್ಶಿಸಲು ಸಾಲುಗಳು ಮತ್ತು ಕಾಲಮ್‌ಗಳಲ್ಲಿ ರಚನಾತ್ಮಕ ವಿಷಯವನ್ನು ರಚಿಸಿ.','block titleTemplate Part'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗ','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'ಹೆಡರ್, ಅಡಿಟಿಪ್ಪಣಿ, ಸೈಡ್‌ಬಾರ್‌ನಂತಹ ನಿಮ್ಮ ಸೈಟ್‌ನ ವಿವಿಧ ಜಾಗತಿಕ ಪ್ರದೇಶಗಳನ್ನು ಸಂಪಾದಿಸಿ ಅಥವಾ ನಿಮ್ಮದೇ ಆದದನ್ನು ರಚಿಸಿ.','block descriptionDisplay a graphic to represent this site. Update the block, and the changes apply everywhere it’s used. This is different than the site icon, which is the smaller image visible in your dashboard, browser tabs, etc used to help others recognize this site.'=>'ಈ ಸೈಟ್ ಅನ್ನು ಪ್ರತಿನಿಧಿಸಲು ಗ್ರಾಫಿಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸಿ. ಬ್ಲಾಕ್ ಅನ್ನು ನವೀಕರಿಸಿ ಮತ್ತು ಬದಲಾವಣೆಗಳು ಅದನ್ನು ಬಳಸಿದ ಎಲ್ಲೆಡೆ ಅನ್ವಯಿಸುತ್ತವೆ. ಇದು ಸೈಟ್ ಐಕಾನ್‌ಗಿಂತ ಭಿನ್ನವಾಗಿದೆ, ಇದು ನಿಮ್ಮ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್, ಬ್ರೌಸರ್ ಟ್ಯಾಬ್‌ಗಳು ಇತ್ಯಾದಿಗಳಲ್ಲಿ ಗೋಚರಿಸುವ ಚಿಕ್ಕ ಚಿತ್ರವಾಗಿದ್ದು, ಈ ಸೈಟ್ ಅನ್ನು ಇತರರಿಗೆ ಗುರುತಿಸಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ.','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'ಈ ಸೈಟ್‌ನ ಹೆಸರನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಬ್ಲಾಕ್ ಅನ್ನು ನವೀಕರಿಸಿ ಮತ್ತು ಬದಲಾವಣೆಗಳು ಅದನ್ನು ಬಳಸಿದ ಎಲ್ಲೆಡೆ ಅನ್ವಯಿಸುತ್ತವೆ. ಇದು ಬ್ರೌಸರ್ ಶೀರ್ಷಿಕೆ ಪಟ್ಟಿ ಮತ್ತು ಹುಡುಕಾಟ ಫಲಿತಾಂಶಗಳಲ್ಲಿ ಸಹ ಗೋಚರಿಸುತ್ತದೆ.','block titleTerm Description'=>'ಪದದ ವಿವರಣೆ','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'ಆರ್ಕೈವ್ ಅನ್ನು ವೀಕ್ಷಿಸುವಾಗ ವಿಭಾಗಗಳು, ಟ್ಯಾಗ್‌ಗಳು ಮತ್ತು ಕಸ್ಟಮ್ ಟ್ಯಾಕ್ಸಾನಮಿಗಳ ವಿವರಣೆಯನ್ನು ಪ್ರದರ್ಶಿಸಿ.','https://wordpress.org/support/article/site-editor/'=>'https://wordpress.org/support/article/site-editor/','Use Site Editor'=>'ಸೈಟ್ ಸಂಪಾದಕವನ್ನು ಬಳಸಿ','Each webfont src must be a non-empty string.'=>'ಪ್ರತಿಯೊಂದು ವೆಬ್‌ಫಾಂಟ್ src ಖಾಲಿ ಅಲ್ಲದ ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Webfont font weight must be a properly formatted string or integer.'=>'ವೆಬ್‌ಫಾಂಟ್ ಫಾಂಟ್ ತೂಕವು ಸರಿಯಾಗಿ ಫಾರ್ಮ್ಯಾಟ್ ಮಾಡಲಾದ ಸ್ಟ್ರಿಂಗ್ ಅಥವಾ ಪೂರ್ಣಾಂಕವಾಗಿರಬೇಕು.','Unable to pass %s if not using multisite.'=>'ಮಲ್ಟಿಸೈಟ್ ಬಳಸದಿದ್ದರೆ %s ಅನ್ನು ರವಾನಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','User URL may not be longer than 100 characters.'=>'ಬಳಕೆದಾರರ URL 100 ಅಕ್ಷರಗಳಿಗಿಂತ ಹೆಚ್ಚು ಇರಬಾರದು.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'ಹೆಚ್ಚಿನ ಸಹಾಯ ಬೇಕೇ? <a href="%1$s">%2$s ನಲ್ಲಿ ಬೆಂಬಲ ಲೇಖನವನ್ನು ಓದಿ</a>.','The password cannot be a space or all spaces.'=>'ಪಾಸ್‌ವರ್ಡ್ ಸ್ಪೇಸ್ ಅಥವಾ ಎಲ್ಲಾ ಸ್ಪೇಸ್‌ಗಳಾಗಿರಬಾರದು.','There is already a ping from that URL for this post.'=>'ಈ ಪೋಸ್ಟ್‌ಗಾಗಿ ಆ URL ನಿಂದ ಈಗಾಗಲೇ ಪಿಂಗ್ ಇದೆ.','block titleComments Title'=>'ಕಾಮೆಂಟ್‌ಗಳ ಶೀರ್ಷಿಕೆ','block descriptionDisplays a title with the number of comments'=>'ಕಾಮೆಂಟ್‌ಗಳ ಸಂಖ್ಯೆಯೊಂದಿಗೆ ಶೀರ್ಷಿಕೆಯನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ','block descriptionGather blocks in a layout container.'=>'ಬ್ಲಾಕ್ಗಳನ್ನು ಒಂದು ಲೇಔಟ್ ಕಂಟೇನರ್ನಲ್ಲಿ ಒಟ್ಟುಗೂಡಿಸಿ.','block titleHome Link'=>'ಮುಖಪುಟ ಲಿಂಕ್','block descriptionCreate a link that always points to the homepage 