t "%s"'=>'ಲೇಖನ : "%s" ಕ್ಕೆ ಹೊಸ ಮರುಚಾರಣ (trackback)','New pingback on your post "%s"'=>'ನಿಮ್ಮ ಲೇಖನ "%s" ದ ಮೇಲೆ ಹೊಸ ಮರುಕೋರಿಕೆ (Pingback):','A new trackback on the post "%s" is waiting for your approval'=>'"%s" ಲೇಖನಕ್ಕೆ ಹೊಸ ಮರುಚಾರಣವು (trackback) ನಿಮ್ಮ ಅನುಮೋದನೆಗೆ ಕಾಯುತ್ತಿದೆ.','A new pingback on the post "%s" is waiting for your approval'=>'ಲೇಖನ "%s" ದ ಮೇಲೆ ಹೊಸ ಮರುಕೋರಿಕೆ (Pingback) ನಿಮ್ಮ ಅನುಮೊದನೆಗಾಗಿ ಕಾಯುತ್ತಿದೆ.','A new comment on the post "%s" is waiting for your approval'=>'"%s" ಲೇಖನಕ್ಕೆ ಒಂದು ಹೊಸ ಪ್ರತಿಕ್ರಿಯೆ ನಿಮ್ಮ ಅನುಮೋದನೆಗೆ ಕಾಯುತ್ತಿದೆ.‍‍','File canceled.'=>'ಕಡತವನ್ನು ರದ್ದುಪಡಿಸಲಾಗಿದೆ.','This is the short link.'=>'ಇದು ಚಿಕ್ಕ ಲಿಂಕ್.','Navigation Menu Items'=>'ಸಂಚರಣಾ ಆಯ್ಕೆಪಟ್ಟಿಯ ಅಂಶಗಳು','Navigation Menu Item'=>'ಸಂಚರಣಾ ಆಯ್ಕೆಪಟ್ಟಿಯ ಅಂಶ','Navigation Menus'=>'ಸಂಚರಣಾ ಆಯ್ಕೆಪಟ್ಟಿಗಳು','Maintenance'=>'ನಿರ್ವಹಣೆ','Briefly unavailable for scheduled maintenance. Check back in a minute.'=>'ನಿಗದಿತ ನಿರ್ವಹಣೆಗಾಗಿ ಸ್ವಲ್ಪ ತಡೆಹಿಡಿಯಲಾಗಿದೆ. ಕೆಲ ಸಮಯದ ನಂತರ ಪ್ರಯತ್ನಿಸಿ.','Page %s'=>'ಪುಟ %s','Completed <span class="count">(%s)</span>'=>'ಮುಗಿದಿದೆ <span class="count">(%s)</span>' . "\0" . 'ಮುಗಿದಿವೆ <span class="count">(%s)</span>','Could not calculate resized image dimensions'=>'ಮರುಗಾತ್ರಿಸಿದ ಚಿತ್ರದ ಅಳತೆಗಳನ್ನು ಲೆಕ್ಕಹಾಕಲಾಗಲಿಲ್ಲ','A valid URL was not provided.'=>'ಸಮಂಜಸವಾದ URL ಅನ್ನು ಒದಗಿಸಿಲ್ಲ.','Your email address will not be published.'=>'ನಿಮ್ಮ ಮಿಂಚೆ ವಿಳಾಸ ಎಲ್ಲೂ ಪ್ರಕಟವಾಗುವುದಿಲ್ಲ.','An error occurred adding you to this site. Go to the <a href="%s">homepage</a>.'=>'ನಿಮ್ಮನ್ನು ಈ ಜಾಲತಾಣಕ್ಕೆ ಸೇರಿಸುವಲ್ಲಿ ದೋಷ ಉಂಟಾಗಿದೆ.  <a href="%s">ಮುಖಪುಟ</a>ಕ್ಕೆ ಮರಳಿ.','The email address entered did not appear to be a valid email address. Please enter a valid email address.'=>'ನಮೂದಿಸಿರುವ ಮಿಂಚೆ ವಿಳಾಸ ಸಮಂಜಸವಾಗಿಲ್ಲ ಎನಿಸುತ್ತಿದೆ. ದಯವಿಟ್ಟು ಸರಿಯಾದ ಮಿಂಚೆ ವಿಳಾಸ ವನ್ನು ನಮೂದಿಸಿ.','The WordPress address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'ನೀವು ನಮೂದಿಸಿರುವ WordPress  ವಿಳಾಸ ಸಮಂಜಸವಾದ URL ಅಲ್ಲ ಎನಿಸುತ್ತಿದೆ. ದಯವಿಟ್ಟು ಸರಿಯಾದ  URL ಅನ್ನು ನಮೂದಿಸಿ.','The Site address you entered did not appear to be a valid URL. Pl