After you activate, you can visit your site here:

%2$s'=>'ನಿಮ್ಮ ಬ್ಲಾಗ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು, ದಯವಿಟ್ಟು ಈ ಕೆಳಗಿನ ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ:

%1$s

