navigation'=>'ವರ್ಗಗಳ ಪಟ್ಟಿ ಸಂಚರಣೆ','Tags list'=>'ಟ್ಯಾಗ್‌ಗಳ ಪಟ್ಟಿ','Categories list'=>'ವರ್ಗಗಳ ಪಟ್ಟಿ','Are you sure it exists?'=>'ಇದು ಅಸ್ತಿತ್ವದಲ್ಲಿರುವುದು ನಿಮಗೆ ಖಚಿತವೇ?','Does the user %1$s have permission to use the %2$s database?'=>'%2$s ಡೇಟಾಬೇಸ್ ಬಳಸಲು %1$s ಬಳಕೆದಾರರಿಗೆ ಅನುಮತಿ ಇದೆಯೇ?','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'‍ಕೆಲವು ವ್ಯವಸ್ಥೆಗಳಲ್ಲಿ ನಿಮ್ಮ ಡೇಟಾಬೇಸ್‍ನ ಹೆಸರು ನಿಮ್ಮ ಬಳಕೆದಾರ ಹೆಸರಿನೊಂದಿಗೆ ಪೂರ್ವಪ್ರತ್ಯಯಗೊಂಡಿದೆ, ಆದ್ದರಿಂದ ಇದು <code>username_%1$s</code> ನಂತೆ ಇರುತ್ತದೆ. ಅದು ಸಮಸ್ಯೆಯಾಗಬಹುದೇ?','Are you sure you have the correct username and password?'=>'ನೀವು ಸರಿಯಾದ ಬಳಕೆದಾರ ಹೆಸರು ಮತ್ತು ಗುಪ್ತಪದ ಹೊಂದಿರುವಿರಾ?','Are you sure you have typed the correct hostname?'=>'‍ನೀವು ಸರಿಯಾದ ಸರ್ವರ್ ಹೆಸರನ್ನು ‌ಟೈಪಿಸಿರುವಿರಾ?','Are you sure the database server is running?'=>'ಡೇಟಾಬೇಸ್ ಸರ್ವರ್ ಚಾಲನೆಯಲ್ಲಿರುವುದು ಖಚಿತವೇ?','If you are unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress Support Forums</a>.'=>'ಈ ನಿಯಮಗಳ ಅರ್ಥವೇನೆಂದು ನಿಮಗೆ ಖಚಿತವಿಲ್ಲದಿದ್ದರೆ ನೀವು ಬಹುಶಃ ನಿಮ್ಮ ಹೋಸ್ಟ್ ಅನ್ನು ಸಂಪರ್ಕಿಸಬೇಕು. ನಿಮಗೆ ಇನ್ನೂ ಸಹಾಯ ಬೇಕಾದರೆ ನೀವು ಯಾವಾಗಲೂ <a href="%s">ವರ್ಡ್ಪ್ರೆಸ್ ಬೆಂಬಲ ವೇದಿಕೆಗಳಿಗೆ</a> ಭೇಟಿ ನೀಡಬಹುದು.','Error reconnecting to the database'=>'ಡೇಟಾಬೇಸ್ಗೆ ಮರುಸಂಪರ್ಕಿಸುವಲ್ಲಿ ದೋಷ ಕಂಡುಬಂದಿದೆ','Are you sure the database server is not under particularly heavy load?'=>'ಡೇಟಾಬೇಸ್ ಸರ್ವರ್ ಭಾರೀ ಹೊರೆಯ ಮೇಲಿಲ್ಲ ಎಂದು ನಿಮಗೆ ಖಚಿತವಾಗಿದೆಯೇ?','Continue reading %s'=>'%s ಓದಲು ಮುಂದುವರೆಸಿ','The menu name %s conflicts with another menu name. Please try another.'=>'ಮೆನು ಹೆಸರು %s ಮತ್ತೊಂದು ಮೆನು ಹೆಸರಿನೊಂದಿಗೆ ಘರ್ಷಿಸುತ್ತದೆ. ದಯವಿಟ್ಟು ಇನ್ನೊಂದನ್ನು ಪ್ರಯತ್ನಿಸಿ.','This site has not been activated yet. If you are having problems activating your site, please contact %s.'=>'ಈ ತಾಣವು ಇನ್ನೂ ಸಕ್ರಿಯವಾಗಿಲ್ಲ. ನಿಮ್ಮ ತಾಣವನ್ನು ಸಕ್ರಿಯವಾಗಿಸುವಲ್ಲಿ ಏನಾದರು ತೊಂದರೆ ಇದ್ದಲ್ಲಿ, ದಯವಿಟ್ಟು %s ರನ್ನು ಸಂಪರ್ಕಿಸಿ.','Medium-Large size image width'=>'ಮಧ್ಯಮ ದೊಡ್ಡ ಗಾತ್ರದ ಚಿತ್ರ ಅಗಲ','Medium-Large size image height'=>'ಮಧ್ಯಮ ದೊಡ್ಡ ಗಾತ್ರದ ಚಿತ್ರದ ಎತ್ತರ','Sharing options'=>'ಹಂಚಿಕೊಳ್ಳುವ ಆಯ್ಕೆಗಳು','decline months names: on or offoff'=>'ಆಫ್ ','genitiveJanuary'=>'ಜನವರಿ','genitiveFebruary'=>'ಫೆಬ್ರವರಿ','genitiveMarch'=>'ಮಾರ್ಚ್','genitiveApril'=>'ಏಪ್ರಿಲ್','genitiveMay'=>'ಮೇ','genitiveJune'=>'ಜೂನ್','genitiveJuly'=>'ಜುಲೈ','genitiveAugust'=>'ಆಗಸ್ಟ್','genitiveSeptember'=>'ಸೆಪ್ಟಂಬರ್','genitiveOctober'=>'ಅಕ್ಟೋಬರ್','genitiveNovember'=>'ನವೆಂಬರ್','genitiveDecember'=>'ಡಿಸೆಂಬರ್','Term ID is shared between multiple taxonomies'=>'ಟರ್ಮ್ ID ಯನ್ನು ಬಹು ಟ್ಯಾಕ್ಸಾನಮಿಗಳ ನಡುವೆ ಹಂಚಿಕೊಳ್ಳಲಾಗಿದೆ','Use %s instead.'=>'ಪರ್ಯಾಯವಾಗಿ %s ಅನ್ನು ಬಳಸಿ‍‍.','Please see <a href="%s">Debugging in WordPress</a> for more information.'=>'ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ <a href="%s"> ವರ್ಡ್ಪ್ರೆಸ್ನಲ್ಲಿ ಡೀಬಗ್ ಮಾಡುವಿಕೆ </a> ಅನ್ನು ನೋಡಿ.','menu location(Current: %s)'=>'(ಪ್ರಸ್ತುತ: %s)','Invalid parameter.'=>'ಅಮಾನ್ಯವಾದ ಪ್ಯಾರಮೀಟರ್.','Paste URL or type to search'=>'ಹುಡುಕಲು URL ಅಂಟಿಸಿ ಅಥವಾ ಟೈಪ್ ಮಾಡಿ','Invalid object type.'=>'ಅಮಾನ್ಯವಾದ ವಸ್ತು ಪ್ರಕಾರ.','comment statusApproved'=>'ಅನುಮೋದಿಸಲಾಗಿದೆ','comment statusSpam'=>'ಸ್ಪ್ಯಾಮ್','comment statusTrash'=>'ಕಸದಬುಟ್ಟಿ','<strong>Error:</strong> Your name is too long.'=>'<strong>ದೋಷ:</strong> ನಿಮ್ಮ ಹೆಸರು ತುಂಬಾ ಉದ್ದವಾಗಿದೆ.','<strong>Error:</strong> Your email address is too long.'=>'<strong>ದೋಷ:</strong> ನಿಮ್ಮ ಇಮೇಲ್ ವಿಳಾಸ ತುಂಬಾ ಉದ್ದವಾಗಿದೆ.','<strong>Error:</strong> Your URL is too long.'=>'<strong>ದೋಷ:</strong> ನಿಮ್ಮ URL ತುಂಬಾ ಉದ್ದವಾಗಿದೆ.','<strong>Error:</strong> Your comment is too long.'=>'<strong>ದೋಷ: </strong> ನಿಮ್ಮ ಕಾಮೆಂಟ್ ತುಂಬಾ ಉದ್ದವಾಗಿದೆ.','Partial render must echo the content or return the content string (or array), but not both.'=>'ಭಾಗಶಃ ನಿರೂಪಣೆಯು ವಿಷಯವನ್ನು ಪ್ರತಿಧ್ವನಿಸಬೇಕು ಅಥವಾ ವಿಷಯದ ಸ್ಟ್ರಿಂಗ್ (ಅಥವಾ ಅರೇಯನ್ನು) ಹಿಂದಿರುಗಿಸಬೇಕು, ಆದರೆ ಎರಡನ್ನೂ ಅಲ್ಲ.','%s is forbidden'=>'‍%s ಅನ್ನು  ನಿಷೇಧಿಸಲಾಗಿದೆ','Close dialog'=>'ಸಂವಾದ ಮುಚ್ಚಿ','%1$s %2$s %3$s %4$s Feed'=>'%1$s %2$s %3$s %4$s ಫೀಡ್','<strong>Error:</strong> Invalid username, email address or incorrect password.'=>'‍<strong>ದೋಷ