%2$s, %3$s ago (%4$s)'=>'%1$s %2$s , %3$s ಹಿಂದೆ ( %4$s )','Attachment Attributes'=>'ಲಗತ್ತು ಗುಣಲಕ್ಷಣಗಳು','Custom CSS'=>'ಕಸ್ಟಮ್ CSS','post type general nameChangesets'=>'ಬದಲಾವಣೆಗಳನ್ನು','post type singular nameChangeset'=>'ಬದಲಾವಣೆ','Customize ChangesetAdd New'=>'ಹೊಸತನ್ನು ಸೇರಿಸಿ','Add New Changeset'=>'ಹೊಸ ಬದಲಾವಣೆಗಳನ್ನು ಸೇರಿಸಿ','New Changeset'=>'ಹೊಸ ಬದಲಾವಣೆ','Edit Changeset'=>'ಬದಲಾವಣೆಗಳನ್ನು ಸಂಪಾದಿಸಿ','View Changeset'=>'ಬದಲಾವಣೆಗಳನ್ನು ವೀಕ್ಷಿಸಿ','All Changesets'=>'ಎಲ್ಲಾ ಬದಲಾವಣೆಗಳನ್ನು','Search Changesets'=>'ಬದಲಾವಣೆಗಳನ್ನು ಹುಡುಕಿ','No changesets found.'=>'ಯಾವುದೇ ಬದಲಾವಣೆಗಳಿಲ್ಲ.','No changesets found in Trash.'=>'ಅನುಪಯುಕ್ತದಲ್ಲಿ ಬದಲಾವಣೆಗಳಿಲ್ಲ.','View Posts'=>'ಪೋಸ್ಟ್ಗಳನ್ನು ವೀಕ್ಷಿಸಿ','View Pages'=>'ಪುಟಗಳು ವೀಕ್ಷಿಸಿ','Post Attributes'=>'ಗುಣಲಕ್ಷಣಗಳನ್ನು ಪೋಸ್ಟ್ ಮಾಡಿ','Page Attributes'=>'ಪುಟ ಗುಣಲಕ್ಷಣಗಳು','The REST API can no longer be completely disabled, the %s filter can be used to restrict access to the API, instead.'=>'ಉಳಿದ ಎಪಿಐ ಅನ್ನು ಇನ್ನು ಮುಂದೆ ಸಂಪೂರ್ಣವಾಗಿ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ಬದಲಿಗೆ ಎಪಿಐಗೆ ಪ್ರವೇಶವನ್ನು ನಿರ್ಬಂಧಿಸಲು %s ಫಿಲ್ಟರ್ ಅನ್ನು ಬಳಸಬಹುದು.','Sorry, you are not allowed to upload media on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಮಾಧ್ಯಮವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to upload media to this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್‌ಗೆ ಮಾಧ್ಯಮವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Invalid parent type.'=>'ಅಮಾನ್ಯವಾದ ಪೋಷಕ ಪ್ರಕಾರ.','Alternative text to display when attachment is not displayed.'=>'ಲಗತ್ತನ್ನು ಪ್ರದರ್ಶಿಸದಿದ್ದಾಗ ಪ್ರದರ್ಶಿಸಲು ಪರ್ಯಾಯ ಪಠ್ಯ.','Details about the media file, specific to its type.'=>'ಮಾಧ್ಯಮ ಫೈಲ್ ಬಗ್ಗೆ ವಿವರಗಳು, ಅದರ ಪ್ರಕಾರಕ್ಕೆ ನಿರ್ದಿಷ್ಟವಾಗಿ.','The ID for the associated post of the attachment.'=>'ಲಗತ್ತಿನ ಸಂಬಂಧಿತ ಪೋಸ್ಟ್‌ಗಾಗಿ ID.','No data supplied.'=>'ಯಾವುದೇ ಡೇಟಾವನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ.','No Content-Type supplied.'=>'ಯಾವುದೇ ವಿಷಯ-ಪ್ರಕಾರವನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ.','No Content-Disposition supplied.'=>'ಯಾವುದೇ ವಿಷಯ-ವಿತರಣೆಯನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ.','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'ಅಮಾನ್ಯ ವಿಷಯ-ಸ್ಥಿತಿ ಒದಗಿಸಲಾಗಿದೆ. ವಿಷಯ-ಸ್ವಭಾವವನ್ನು \'ಜೋಡಣೆ\' ಎಂದು ಸ್ವರೂಪಿಸಬೇಕಾಗಿದೆ; ಫೈಲ್ ನೇಮ್="ಇಮೇಜ್.png"ಅಥವಾ ಅದೇ ರೀತಿಯದು.','Content hash did not match expected.'=>'ವಿಷಯದ ಹ್ಯಾಶ್ ನಿರೀಕ್ಷೆಗೆ ಹೊಂದಿಕೆಯಾಗಲಿಲ್ಲ.','Could not open file handle.'=>'ಫೈಲ್ ಹ್ಯಾಂಡಲ್ ತೆರೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Limit result set to attachments of a particular media type.'=>'ಮಿತಿಮೀರಿದ ಫಲಿತಾಂಶವು ನಿರ್ದಿಷ್ಟ ಮಾಧ್ಯಮ ಪ್ರಕಾರದ ಲಗತ್ತುಗಳಿಗೆ ಹೊಂದಿಸಲಾಗಿದೆ.','Limit result set to attachments of a particular MIME type.'=>'ನಿರ್ದಿಷ್ಟ MIME ಪ್ರಕಾರದ ಲಗತ್ತುಗಳಿಗೆ ಸೀಮಿತವಾದ ಫಲಿತಾಂಶವನ್ನು ಹೊಂದಿಸಲಾಗಿದೆ.','Whether to bypass Trash and force deletion.'=>'ಅನುಪಯುಕ್ತವನ್ನು ಬೈಪಾಸ್ ಮಾಡಬೇಕೇ ಮತ್ತು ಅಳಿಸಲು ಒತ್ತಾಯಿಸಬೇಕೇ.','Query parameter not permitted: %s'=>'ಪ್ರಶ್ನೆ ಪ್ಯಾರಾಮೀಟರ್ ಅನುಮತಿಸಲಾಗಿಲ್ಲ: %s','Sorry, you must be logged in to comment.'=>'ಕ್ಷಮಿಸಿ, ಕಾಮೆಂಟ್ ಮಾಡಲು ನೀವು ಲಾಗ್ ಇನ್ ಆಗಿರಬೇಕು.','Cannot create existing comment.'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಕಾಮೆಂಟ್ ಅನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Creating a comment requires valid author name and email values.'=>'ಕಾಮೆಂಟ್ ರಚಿಸುವುದರಿಂದ ಮಾನ್ಯ ಲೇಖಕರ ಹೆಸರು ಮತ್ತು ಇಮೇಲ್ ಮೌಲ್ಯಗಳು ಅಗತ್ಯವಿದೆ.','Creating comment failed.'=>'ಕಾಮೆಂಟ್ ರಚಿಸುವುದು ವಿಫಲವಾಗಿದೆ.','Updating comment status failed.'=>'ಕಾಮೆಂಟ್ ಸ್ಥಿತಿಯನ್ನು ನವೀಕರಿಸುವುದು ವಿಫಲವಾಗಿದೆ.','Updating comment failed.'=>'ಕಾಮೆಂಟ್ ನವೀಕರಿಸುವುದು ವಿಫಲವಾಗಿದೆ.','The comment has already been trashed.'=>'ಕಾಮೆಂಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಟ್ರ್ಯಾಶ್ ಮಾಡಲಾಗಿದೆ.','The comment cannot be deleted.'=>'ಕಾಮೆಂಟ್ ಅನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','Invalid comment author ID.'=>'ಅಮಾನ್ಯವಾದ ಕಾಮೆಂಟ್ ಲೇಖಕ ID.','Unique identifier for the object.'=>'ವಸ್ತುವಿನ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The ID of the user object, if author was a user.'=>'ಲೇಖಕರು ಬಳಕೆದಾರರಾಗಿದ್ದರೆ, ಬಳಕೆದಾರ ವಸ್ತುವಿನ ID.','Email address for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರಿಗೆ ಇಮೇಲ್ ವಿಳಾಸ.','IP address for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರಿಗೆ IP ವಿಳಾಸ.','Display name for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರ ಹೆಸರು ಪ್ರದರ್ಶಿಸಿ.','URL for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರ URL.','User agent for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರ ಬಳಕೆದಾರ ಏಜೆಂಟ್.','The content for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವಿಷಯ.','Content for the post, as it exists in the database.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವಿಷಯ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','HTML content for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ HTML ವಿಷಯ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The date the post was published, as GMT.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, GMT ಯಾಗಿ.','URL to the object.'=>'ಆಬ್ಜೆಕ್ಟ್ಗೆ URL.','The ID for the parent of the post.'=>'ಪೋಸ್ಟ್‌ನ ಪೋಷಕಕಾಗಿ ID.','The ID of the associated post object.'=>'ಸಂಬಂಧಿತ ಪೋಸ್ಟ್ ವಸ್ತುವಿನ ID.','State of the comment.'=>'ಕಾಮೆಂಟ್ ಸ್ಥಿತಿ.','Avatar URL with image size of %d pixels.'=>'%d ಪಿಕ್ಸೆಲ್ಗಳ ಚಿತ್ರದ ಗಾತ್ರದೊಂದಿಗೆ ಅವತಾರ್ URL.','Avatar URLs for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರಿಗಾಗಿ ಅವತಾರ್ URL ಗಳು.','Limit response to posts published after a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ನಂತರ ಪ್ರಕಟಿಸಿದ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'ನಿರ್ದಿಷ್ಟ ಬಳಕೆದಾರ ID ಗಳಿಗೆ ನಿಗದಿಪಡಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಮಿತಿಗೊಳಿಸಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'ಫಲಿತಾಂಶದ ಸೆಟ್ ನಿರ್ದಿಷ್ಟ ಬಳಕೆದಾರ ID ಗಳಿಗೆ ನಿಯೋಜಿಸಲಾದ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಹೊರತುಪಡಿಸುತ್ತದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Limit result set to that from a specific author email. Requires authorization.'=>'ನಿರ್ದಿಷ್ಟ ಲೇಖಕ ಇಮೇಲ್ನಿಂದ ನಿಗದಿಪಡಿಸಲಾದ ಮಿತಿ ಫಲಿತಾಂಶ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Limit response to posts published before a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ಮೊದಲು ಪ್ರಕಟಿಸಿದ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Ensure result set excludes specific IDs.'=>'ನಿರ್ದಿಷ್ಟ ID ಗಳನ್ನು ಹೊರತುಪಡಿಸಿ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','Limit result set to specific IDs.'=>'ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ID ಗೆ ಹೊಂದಿಸಲಾಗಿದೆ.','Order sort attribute ascending or descending.'=>'ಆರ್ಡರ್ ರೀತಿಯ ಗುಣಲಕ್ಷಣ ಆರೋಹಣ ಅಥವಾ ಅವರೋಹಣ.','Sort collection by object attribute.'=>'ಆಬ್ಜೆಕ್ಟ್ ಗುಣಲಕ್ಷಣಗಳಿಂದ ಸಂಗ್ರಹಣೆಯನ್ನು ವಿಂಗಡಿಸಿ.','Limit result set to comments of specific parent IDs.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ಪೋಷಕ IDಗಳ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Ensure result set excludes specific parent IDs.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಷಕ ID ಗಳನ್ನು ಹೊರತುಪಡಿಸಿ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','Limit result set to comments assigned to specific post IDs.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ಪೋಸ್ಟ್ IDಗಳಿಗೆ ನಿಗದಿಪಡಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Limit result set to comments assigned a specific status. Requires authorization.'=>'ನಿರ್ದಿಷ್ಟ ಸ್ಥಿತಿಯನ್ನು ನಿಗದಿಪಡಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Limit result set to comments assigned a specific type. Requires authorization.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ರೀತಿಯ ನಿಯೋಜಿತ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Current page of the collection.'=>'ಸಂಗ್ರಹಣೆಯ ಪ್ರಸ್ತುತ ಪುಟ.','Maximum number of items to be returned in result set.'=>'ಫಲಿತಾಂಶ ಸೆಟ್ ನಲ್ಲಿ ಹಿಂತಿರುಗಿಸಬೇಕಾದ ಗರಿಷ್ಠ ಸಂಖ್ಯೆಯ ಐಟಂಗಳು.','Limit results to those matching a string.'=>'ಸ್ಟ್ರಿಂಗ್ಗೆ ಹೊಂದಿಕೆಯಾಗುವವರಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Scope under which the request is made; determines fields present in response.'=>'ವಿನಂತಿಯನ್ನು ಮಾಡುವ ವ್ಯಾಪ್ತಿ; ಪ್ರತಿಕ್ರಿಯೆಯಾಗಿ ಕ್ಷೇತ್ರಗಳನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ.','Whether posts with this status should be private.'=>'ಈ ಸ್ಥಿತಿಯೊಂದಿಗೆ ಪೋಸ್ಟ್ಗಳು ಖಾಸಗಿಯಾಗಿರಬೇಕು.','Whether posts with this status should be protected.'=>'ಈ ಸ್ಥಿತಿಯನ್ನು ಹೊಂದಿರುವ ಪೋಸ್ಟ್ಗಳನ್ನು ರಕ್ಷಿಸಬೇಕು.','Method \'%s\' not implemented. Must be overridden in subclass.'=>'\'%s\' ವಿಧಾನವು ಕಾರ್ಯಗತಗೊಂಡಿಲ್ಲ. ಉಪವರ್ಗದಲ್ಲಿ ಅತಿಕ್ರಮಿಸಬೇಕು.','Whether posts of this status should be shown in the front end of the site.'=>'ಈ ಸ್ಥಿತಿಯ ಪೋಸ್ಟ್ಗಳು ಸೈಟ್ನ ಮುಂಭಾಗದ ತುದಿಯಲ್ಲಿ ತೋರಿಸಬೇಕೇ.','Whether posts with this status should be publicly-queryable.'=>'ಈ ಸ್ಥಿತಿಯೊಂದಿಗೆ ಪೋಸ್ಟ್ಗಳು ಸಾರ್ವಜನಿಕವಾಗಿ ಪ್ರಶ್ನಾರ್ಹವಾಗಬೇಕೇ.','Whether to include posts in the edit listing for their post type.'=>'ಅವರ ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಸಂಕಲನ ಪಟ್ಟಿಯಲ್ಲಿ ಪೋಸ್ಟ್ ಗಳನ್ನು ಸೇರಿಸಬೇಕೆ.','An alphanumeric identifier for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫಯರ್.','Sorry, you are not allowed to manage post statuses.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಸ್ಥಾನಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','All capabilities used by the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿ ಬಳಸುವ ಎಲ್ಲಾ ಸಾಮರ್ಥ್ಯಗಳು.','A human-readable description of the taxonomy.'=>'ಜೀವಿವರ್ಗೀಕರಣ ಶಾಸ್ತ್ರದ ಮಾನವ-ಓದಬಲ್ಲ ವಿವರಣೆ.','Whether or not the taxonomy should have children.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಮಕ್ಕಳು ಇರಬೇಕೇ ಅಥವಾ ಬೇಡವೇ?','Human-readable labels for the taxonomy for various contexts.'=>'ವಿವಿಧ ಸಂದರ್ಭಗಳಲ್ಲಿ ಟ್ಯಾಕ್ಸಾನಮಿಗಾಗಿ ಮಾನವ-ಓದಬಲ್ಲ ಲೇಬಲ್ಗಳು.','The password for the post if it is password protected.'=>'ಪಾಸ್ವರ್ಡ್ ಅನ್ನು ರಕ್ಷಿಸಿದರೆ ಪೋಸ್ಟ್ಗೆ ಪಾಸ್ವರ್ಡ್.','You need to define a search term to order by relevance.'=>'ಪ್ರಸ್ತುತತೆ ಮೂಲಕ ಆದೇಶಕ್ಕೆ ಹುಡುಕಾಟ ಪದವನ್ನು ನೀವು ವ್ಯಾಖ್ಯಾನಿಸಬೇಕಾಗಿದೆ.','Incorrect post password.'=>'ತಪ್ಪಾದ ಪೋಸ್ಟ್ ಪಾಸ್ವರ್ಡ್.','Sorry, you are not allowed to create new users.'=>'ಕ್ಷಮಿಸಿ, ಹೊಸ ಬಳಕೆದಾರರನ್ನು ರಚಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Cannot create existing post.'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಪೋಸ್ಟ್ ಅನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Sorry, you are not allowed to manage this plugin.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit comments.'=>'ಕ್ಷಮಿಸಿ, ಕಾಮೆಂಟ್ಗಳನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The post has already been deleted.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಅಳಿಸಲಾಗಿದೆ.','A post can not be sticky and have a password.'=>'ಒಂದು ಪೋಸ್ಟ್ ಜಿಗುಟಾದ ಮತ್ತು ಪಾಸ್ವರ್ಡ್ ಹೊಂದಲು ಸಾಧ್ಯವಿಲ್ಲ.','A sticky post can not be password protected.'=>'ಜಿಗುಟಾದ ಪೋಸ್ಟ್ ಅನ್ನು ಪಾಸ್ವರ್ಡ್ ರಕ್ಷಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','A password protected post can not be set to sticky.'=>'ಪಾಸ್ವರ್ಡ್ ರಕ್ಷಿತ ಪೋಸ್ಟ್ ಅನ್ನು ಸ್ಟಿಕಿಯಂತೆ ಹೊಂದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Invalid post parent ID.'=>'ಅಮಾನ್ಯವಾದ ಪೋಸ್ಟ್ ಪೋಷಕ ID.','Invalid featured media ID.'=>'ಅಮಾನ್ಯ ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ ಮಾಧ್ಯಮ ID.','The date the revision was published, in the site\'s timezone.'=>'ಪರಿಷ್ಕರಣೆಯನ್ನು ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','The date the revision was published, as GMT.'=>'ಪರಿಷ್ಕರಣೆಯನ್ನು ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, GMT ಯಂತೆ.','The globally unique identifier for the post.'=>'ಪೋಸ್ಟ್‌ನ ಜಾಗತಿಕವಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','GUID for the revision, as it exists in the database.'=>'ಪರಿಷ್ಕರಣೆಗಾಗಿ GUID, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','GUID for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ GUID, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The date the revision was last modified, in the site\'s timezone.'=>'ಪರಿಷ್ಕರಣೆಯನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','The date the revision was last modified, as GMT.'=>'GMT ಯಂತೆ ಪರಿಷ್ಕರಣೆಯನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ.','An alphanumeric identifier for the revision unique to its type.'=>'ಅದರ ಪ್ರಕಾರಕ್ಕೆ ವಿಶಿಷ್ಟವಾದ ಪರಿಷ್ಕರಣೆಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫೈಯರ್.','A named status for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಹೆಸರಿಸಲಾದ ಸ್ಥಿತಿ.','The title for the object.'=>'ವಸ್ತುವಿನ ಶೀರ್ಷಿಕೆ.','Title for the post, as it exists in the database.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','HTML title for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ HTML ಶೀರ್ಷಿಕೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Whether the content is protected with a password.'=>'ವಿಷಯವು ಪಾಸ್ವರ್ಡ್ನೊಂದಿಗೆ ಸಂರಕ್ಷಿತವಾಗಿದೆಯೇ.','The ID for the author of the post.'=>'ಪೋಸ್ಟ್‌ ಲೇಖಕನ ID.','The excerpt for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಆಯ್ದ ಭಾಗ.','Excerpt for the post, as it exists in the database.'=>'ಡೇಟಾಬೇಸ್ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವುದರಿಂದ ವಸ್ತುವಿನ ಆಯ್ದ ಭಾಗಗಳು.','HTML excerpt for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ HTML ಆಯ್ದ ಭಾಗ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Whether the excerpt is protected with a password.'=>'ಆಯ್ದ ಭಾಗಗಳು ಪಾಸ್ವರ್ಡ್ನೊಂದಿಗೆ ಸಂರಕ್ಷಿತವಾಗಿದೆಯೇ.','The ID of the featured media for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ ಮಾಧ್ಯಮದ ID.','Whether or not comments are open on the post.'=>'ಪೋಸ್ಟ್‌ನಲ್ಲಿ ಕಾಮೆಂಟ್‌ಗಳು ತೆರೆದಿವೆಯೋ ಇಲ್ಲವೋ.','Whether or not the post can be pinged.'=>'ವಸ್ತುವನ್ನು ಪಿಂಗ್ ಮಾಡಬಹುದೇ ಅಥವಾ ಇಲ್ಲವೇ.','The format for the post.'=>'ವಸ್ತುವಿನ ಸ್ವರೂಪ.','Whether or not the post should be treated as sticky.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಸ್ಟಿಕಿ ಎಂದು ಪರಿಗಣಿಸಬೇಕೇ ಅಥವಾ ಇಲ್ಲವೇ.','A password to protect access to the content and excerpt.'=>'ವಿಷಯ ಮತ್ತು ಆಯ್ದ ಭಾಗಕ್ಕೆ ಪ್ರವೇಶವನ್ನು ರಕ್ಷಿಸಲು ಪಾಸ್‌ವರ್ಡ್.','The theme file to use to display the post.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸಲು ಬಳಸಲು ಥೀಮ್ ಫೈಲ್.','The terms assigned to the post in the %s taxonomy.'=>'%s ವರ್ಗೀಕರಣದಲ್ಲಿ ವಸ್ತುವಿಗೆ ನಿಯೋಜಿಸಲಾದ ಪದಗಳು','Limit result set to posts assigned to specific authors.'=>'ನಿಶ್ಚಿತ ಲೇಖಕರ ನಿಯೋಜಿಸಲಾದ ಪೋಸ್ಟ್ಗಳಿಗೆ ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Ensure result set excludes posts assigned to specific authors.'=>'ಫಲಿತಾಂಶದ ಸೆಟ್ ನಿರ್ದಿಷ್ಟ ಲೇಖಕರಿಗೆ ನಿಯೋಜಿಸಲಾದ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಹೊರತುಪಡಿಸಿರುವುದನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','Limit result set to posts with a specific menu_order value.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ menu_order ಮೌಲ್ಯದೊಂದಿಗೆ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Offset the result set by a specific number of items.'=>'ನಿರ್ದಿಷ್ಟ ಸಂಖ್ಯೆಯ ಐಟಂಗಳನ್ನು ಹೊಂದಿಸಿದ ಫಲಿತಾಂಶವನ್ನು ಸರಿದೂಗಿಸಿ.','Limit result set to items with particular parent IDs.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಷಕ ID ಗಳೊಂದಿಗೆ ಐಟಂಗಳಿಗೆ ಹೊಂದಿಸಲಾದ ಮಿತಿ ಫಲಿತಾಂಶ.','Limit result set to all items except those of a particular parent ID.'=>'ನಿರ್ದಿಷ್ಟ ಮೂಲ ID ಯ ಹೊರತುಪಡಿಸಿ ಎಲ್ಲಾ ಐಟಂಗಳಿಗೆ ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'%s ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ನಿಗದಿಪಡಿಸಲಾದ ನಿಗದಿತ ಅವಧಿಯನ್ನು ಹೊಂದಿರುವ ಎಲ್ಲಾ ಐಟಂಗಳಿಗೆ ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Limit result set to items that are sticky.'=>'ಫಲಿತಾಂಶವನ್ನು ಸ್ಟಿಕಿ ಐಟಂಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Invalid revision ID.'=>'ಅಮಾನ್ಯ ಪರಿಷ್ಕರಣೆ ID.','The %s property has an invalid stored value, and cannot be updated to null.'=>'%s ಆಸ್ತಿಯು ಅಮಾನ್ಯವಾದ ಸಂಗ್ರಹಿಸಿದ ಮೌಲ್ಯವನ್ನು ಹೊಂದಿದೆ ಮತ್ತು ಅದನ್ನು ಶೂನ್ಯಕ್ಕೆ ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ.','Whether or not the term cloud should be displayed.'=>'ಟರ್ಮ್ ಕ್ಲೌಡ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸಬೇಕೇ ಅಥವಾ ಇಲ್ಲವೇ.','Limit results to taxonomies associated with a specific post type.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕೆ ಸಂಬಂಧಿಸಿದ ಟ್ಯಾಕ್ಸಾನಮಿಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Required to be true, as users do not support trashing.'=>'ಬಳಕೆದಾರರು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸದ ಕಾರಣ, ಇದು ನಿಜವಾಗಲು ಅಗತ್ಯವಿದೆ.','The template cannot be deleted.'=>'ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','Unique identifier for the user.'=>'ಬಳಕೆದಾರರಿಗೆ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','Number of published posts for the term.'=>'ಪದಕ್ಕಾಗಿ ಪ್ರಕಟವಾದ ಲೇಖನಗಳ ಸಂಖ್ಯೆ.','HTML description of the term.'=>'ಪದದ HTML ವಿವರಣೆ.','An alphanumeric identifier for the term unique to its type.'=>'ಅದರ ಪ್ರಕಾರದ ವಿಶಿಷ್ಟವಾದ ಪದಕ್ಕೆ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಗುರುತಿಸುವಿಕೆ.','Type attribution for the term.'=>'ಪದಕ್ಕಾಗಿ ಗುಣಲಕ್ಷಣ ಟೈಪ್ ಮಾಡಿ.','The ID for the parent of the revision.'=>'ಪರಿಷ್ಕರಣೆಯ ಪೋಷಕರಿಗೆ ID.','Sort collection by term attribute.'=>'ಪದ ಗುಣಲಕ್ಷಣದ ಪ್ರಕಾರ ಸಂಗ್ರಹವನ್ನು ವಿಂಗಡಿಸಿ.','Whether to hide terms not assigned to any posts.'=>'ಯಾವುದೇ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ನಿಯೋಜಿಸದ ಪದಗಳನ್ನು ಮರೆಮಾಡಬೇಕೆ.','Limit result set to terms assigned to a specific parent.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಷಕರಿಗೆ ನಿಯೋಜಿಸಲಾದ ನಿಯಮಗಳಿಗೆ ಮಿತಿಗೊಳಿಸಿದ ಫಲಿತಾಂಶ.','Limit result set to terms assigned to a specific post.'=>'ನಿರ್ದಿಷ್ಟ ಹುದ್ದೆಗೆ ನಿಗದಿಪಡಿಸಿದ ಫಲಿತಾಂಶಗಳನ್ನು ಟರ್ಮ್ಸ್ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','You are not currently logged in.'=>'ನೀವು ಪ್ರಸ್ತುತ ಲಾಗ್‍ಇನ್ ಆಗಿಲ್ಲ.','Cannot create existing user.'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಬಳಕೆದಾರರನ್ನು ಸೃಷ್ಟಿಸಲಾಗುವುದಿಲ್ಲ.','Sorry, you are not allowed to delete this revision.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪರಿಷ್ಕರಣೆಯನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit roles of this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರ ಪಾತ್ರಗಳನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Username is not editable.'=>'ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಸಂಪಾದಿಸಲಾಗುವುದಿಲ್ಲ.','Sorry, you are not allowed to delete this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರನನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Invalid user ID for reassignment.'=>'ಪುನರ್ವಿತರಣೆಗಾಗಿ ಅಮಾನ್ಯವಾದ ಬಳಕೆದಾರ ID.','The role %s does not exist.'=>'ಪಾತ್ರ %s ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','The email address for the user.'=>'ಬಳಕೆದಾರರ ಮಿಂಚಂಚೆ ವಿಳಾಸ.','Registration date for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ನೋಂದಣಿ ದಿನಾಂಕ.','Password for the user (never included).'=>'ಬಳಕೆದಾರರಿಗೆ ಗುಪ್ತಪದ (ಸೇರಿಸಲಾಗಿಲ್ಲ).','All capabilities assigned to the user.'=>'ಬಳಕೆದಾರರಿಗೆ ನಿಯೋಜಿಸಲಾದ ಎಲ್ಲಾ ಸಾಮರ್ಥ್ಯಗಳು.','Any extra capabilities assigned to the user.'=>'ಬಳಕೆದಾರನಿಗೆ ನಿಯೋಜಿಸಲಾದ ಯಾವುದೇ ಹೆಚ್ಚುವರಿ ಸಾಮರ್ಥ್ಯಗಳು.','Limit result set to users matching at least one specific role provided. Accepts csv list or single role.'=>'ಒದಗಿಸಿದ ಕನಿಷ್ಠ ಒಂದು ನಿರ್ದಿಷ್ಟ ಪಾತ್ರಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುವ ಬಳಕೆದಾರರಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಸೀಮಿತಗೊಳಿಸಿ. CSV ಪಟ್ಟಿ ಅಥವಾ ಒಂದೇ ಪಾತ್ರವನ್ನು ಸ್ವೀಕರಿಸುತ್ತದೆ.','Could not delete meta value from database.'=>'ಡೇಟಾಬೇಸ್‌ನಿಂದ ಮೆಟಾ ಮೌಲ್ಯವನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Meta fields.'=>'Meta ಕ್ಷೇತ್ರಗಳು.','%1$s is not one of %2$s.'=>'%1$s %2$s ನಲ್ಲ.','%1$s is not of type %2$s.'=>'%1$s ವಿಧದ %2$s ನಲ್ಲ.','%s is not a valid IP address.'=>'%s ಮಾನ್ಯವಾದ IP ವಿಳಾಸವಲ್ಲ.','%1$s must be between %2$d (exclusive) and %3$d (exclusive)'=>'%1$s %2$d (ಪ್ರತ್ಯೇಕ) ಮತ್ತು %3$d (ಪ್ರತ್ಯೇಕ) ನಡುವೆ ಇರಬೇಕು','%1$s must be between %2$d (inclusive) and %3$d (exclusive)'=>'%1$s %2$d (ಅಂತರ್ಗತ) ಮತ್ತು %3$d (ಮೀಸಲು) ನಡುವೆ ಇರಬೇಕು','%1$s must be between %2$d (exclusive) and %3$d (inclusive)'=>'%1$s %2$d (ಪ್ರತ್ಯೇಕ) ಮತ್ತು %3$d (ಅಂತರ್ಗತ) ನಡುವೆ ಇರಬೇಕು','%1$s must be between %2$d (inclusive) and %3$d (inclusive)'=>'%1$s %2$d (ಅಂತರ್ಗತ) ಮತ್ತು %3$d (ಅಂತರ್ಗತ) ನಡುವೆ ಇರಬೇಕು','Item selected.'=>'ವಸ್ತು ಆಯ್ಕೆಮಾಡಲಾಗಿದೆ.','Comment is required.'=>'ಪ್ರತಿಕ್ರಿಯೆ ಅಗತ್ಯವಿದೆ.','Limit result set to posts with one or more specific slugs.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚು ನಿರ್ದಿಷ್ಟವಾದ ಸ್ಲಗ್ಗಳು ಇರುವ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಸೀಮಿತಗೊಳಿಸಿ.','Taxonomies associated with post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕೆ ಸಂಬಂಧಿಸಿದ ಟ್ಯಾಕ್ಸಾನಮಿಗಳು.','Comment field exceeds maximum length allowed.'=>'ಪ್ರತಿಕ್ರಿಯೆ ಕ್ಷೇತ್ರವು ಗರಿಷ್ಠ ಮಿತಿಯನ್ನು ಮೀರುತ್ತದೆ.','Limit result set to posts assigned one or more statuses.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚು ಸ್ಥಿತಿಗಳನ್ನು ನಿಗದಿಪಡಿಸಿದ ಲೇಖನಗಳಿಗೆ ಹೊಂದಿಸಲಾದ ಮಿತಿ ಫಲಿತಾಂಶ.','Invalid JSON body passed.'=>'ಅಮಾನ್ಯವಾದ JSON ಅಂಗವನ್ನು ರವಾನಿಸಲಾಗಿದೆ.','The comment does not support trashing. Set \'%s\' to delete.'=>'ಕಾಮೆಂಟ್ ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಅನ್ನು ಹೊಂದಿಸಿ.','The post does not support trashing. Set \'%s\' to delete.'=>'ಪೋಸ್ಟ್ ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಅನ್ನು ಹೊಂದಿಸಿ.','Revisions do not support trashing. Set \'%s\' to delete.'=>'ಪರಿಷ್ಕರಣೆಗಳು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಅನ್ನು ಹೊಂದಿಸಿ.','Terms do not support trashing. Set \'%s\' to delete.'=>'ನಿಯಮಗಳು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಅನ್ನು ಹೊಂದಿಸಿ.','Users do not support trashing. Set \'%s\' to delete.'=>'ಬಳಕೆದಾರರು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಅನ್ನು ಹೊಂದಿಸಿ.','Caption for the attachment, as it exists in the database.'=>'ಲಗತ್ತಿನ ಶೀರ್ಷಿಕೆ, ಡಾಟಾಬೇಸ್ನಲ್ಲಿ ಹೇಗಿದೆಯೋ ಹಾಗೆ.','HTML caption for the attachment, transformed for display.'=>'ಲಗತ್ತಿನ HTML ಶೀರ್ಷಿಕೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ಪರಿವರ್ತಿಸಲಾಗಿದೆ.','Description for the attachment, as it exists in the database.'=>'ಲಗತ್ತಿನ ವಿವರಣೆ, ಡಾಟಾಬೇಸ್ನಲ್ಲಿ ಹೇಗಿದೆಯೋ ಹಾಗೆ.','HTML description for the attachment, transformed for display.'=>'ಲಗತ್ತಿನ HTML ವಿವರಣೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ಪರಿವರ್ತಿಸಲಾಗಿದೆ.','default site languageSite Default'=>'ಪೂರ್ವನಿಯೋಜಿತ ತಾಣ','REST base route for the taxonomy.'=>'ವರ್ಗೀಕರಣಕ್ಕೆ REST ಮೂಲ ಮಾರ್ಗ.','Document Preview'=>'ದಸ್ತಾವೇಜಿನ ಪೂರ್ವವೀಕ್ಷಣೆ','Invalid user parameter(s).'=>'ಅಮಾನ್ಯ ಬಳಕೆದಾರ ಪ್ಯಾರಾಮೀಟರ್(ಗಳು).','Passwords cannot be empty.'=>'ಗುಪ್ತಪದಗಳು ಖಾಲಿ ಇರಬಾರದು.','Passwords cannot contain the "%s" character.'=>'ಪಾಸ್‌ವರ್ಡ್‌ಗಳು "%s" ಅಕ್ಷರವನ್ನು ಒಳಗೊಂಡಿರಬಾರದು.','Select video'=>'ವೀಡಿಯೊ ಆಯ್ಕೆಮಾಡಿ','Change video'=>'ವೀಡಿಯೊ ಬದಲಿಸಿ','No video selected'=>'ಯಾವುದೇ ವೀಡಿಯೊ ಆಯ್ಕೆ ಮಾಡಿಲ್ಲ','Choose video'=>'ವೀಡಿಯೊ ಆಯ್ಕೆಮಾಡಿ','Reassign the deleted user\'s posts and links to this user ID.'=>'ಅಳಿಸಿದ ಬಳಕೆದಾರರ ಪೋಸ್ಟ್‌ಗಳು ಮತ್ತು ಲಿಂಕ್‌ಗಳನ್ನು ಈ ಬಳಕೆದಾರ ID ಗೆ ಮರುಹೊಂದಿಸಿ.','Sorry, you are not allowed to make posts sticky.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್‌ಗಳನ್ನು ಜಿಗುಟಾದಂತೆ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ','Sorry, you are not allowed to assign the provided terms.'=>'ಕ್ಷಮಿಸಿ, ಒದಗಿಸಿದ ನಿಯಮಗಳನ್ನು ನಿಯೋಜಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit the %s custom field.'=>'ಕ್ಷಮಿಸಿ, %s ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರವನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to read comments without a post.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಇಲ್ಲದೆ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to read this comment.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ರತಿಕ್ರಿಯೆ ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to read the post for this comment.'=>'ಕ್ಷಮಿಸಿ, ಈ ಕಾಮೆಂಟ್ಗಾಗಿ ಪೋಸ್ಟ್ ಅನ್ನು ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit \'%s\' for comments.'=>'ಕ್ಷಮಿಸಿ, ಕಾಮೆಂಟ್‌ಗಳಿಗಾಗಿ \'%s\' ಅನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to create this comment without a post.'=>'ಕ್ಷಮಿಸಿ, ಲೇಖನ ಇಲ್ಲದೆ ಈ ಕಾಮೆಂಟ್ ಅನ್ನು ರಚಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to create a comment on this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಲೇಖನದಲ್ಲಿ ಪ್ರತಿಕ್ರಿಯೆ ಸೃಷ್ಟಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to view revisions of this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಲೇಖನದ ಪರಿಷ್ಕರಣೆಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to view menu items.'=>'ಕ್ಷಮಿಸಿ, ಮೆನು ಐಟಂಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Sorry, you are not allowed to delete this comment.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to filter users by role.'=>'ಕ್ಷಮಿಸಿ, ಪಾತ್ರದಿಂದ ಬಳಕೆದಾರರನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to order users by this parameter.'=>'ಕ್ಷಮಿಸಿ, ಈ ನಿಯತಾಂಕದ ಮೂಲಕ ಬಳಕೆದಾರರನ್ನು ಆದೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to give users that role.'=>'ಕ್ಷಮಿಸಿ, ಬಳಕೆದಾರರಿಗೆ ಆ ಪಾತ್ರವನ್ನು ನೀಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to change the comment type.'=>'ಕ್ಷಮಿಸಿ, ಕಾಮೆಂಟ್ ಪ್ರಕಾರವನ್ನು ಬದಲಾಯಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Invalid date.'=>'ಅಮಾನ್ಯವಾದ ದಿನಾಂಕ.','Invalid page template.'=>'ಅಮಾನ್ಯ ಪುಟ ಟೆಂಪ್ಲೇಟ್.','Invalid JSONP callback function.'=>'ಅಮಾನ್ಯ JSONP ಕಾಲ್‌ಬ್ಯಾಕ್ ಕಾರ್ಯ.','Invalid comment content.'=>'ಅಮಾನ್ಯವಾದ ಪ್ರತಿಕ್ರಿಯೆ ವಿಷಯ.','Invalid email address.'=>'ಅಮಾನ್ಯವಾದ ಇಮೇಲ್ ವಿಳಾಸ.','Invalid slug.'=>'ಅಮಾನ್ಯ ಸ್ಲಗ್.','Cannot create a comment with that type.'=>'ಆ ರೀತಿಯೊಂದಿಗೆ ಪ್ರತಿಕ್ರಿಯೆ ಸೃಷ್ಟಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','New site notification email subject[%1$s] Activate %2$s'=>'[%1$s] ಸಕ್ರಿಯಗೊಳಿಸಿ %2$s','New user notification email subject[%1$s] Activate %2$s'=>'[%1$s ]%2$s ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ','theme authorBy %s'=>'‍%s ಮೂಲಕ','Site tagline.'=>'ತಾಣದ ಅಡಿಬರಹ.','Default post category.'=>'ಅಗತ್ಯಾನುಗುಣಗೊಳಿಸಿದ ಲೇಖನದ ವರ್ಗ.','The attachment caption.'=>'ಲಗತ್ತು ಶೀರ್ಷಿಕೆ.','The attachment description.'=>'ಲಗತ್ತು ವಿವರಣೆ.','Attachment type.'=>'ಲಗತ್ತು ಪ್ರಕಾರ.','The attachment MIME type.'=>'ಲಗತ್ತಿಸುವಿಕೆ MIME ಪ್ರಕಾರ.','URL to the original attachment file.'=>'ಮೂಲ ಲಗತ್ತು ಕಡತಕ್ಕೆ URL.','Invalid status.'=>'ಸ್ಥಿತಿ ಸಿಂಧುವಲ್ಲ.','Cannot view status.'=>'ಸ್ಥಿತಿಯನ್ನು ವೀಕ್ಷಿಸಲಾಗುವುದಿಲ್ಲ.','The title for the status.'=>'ಸ್ಥಿತಿಗಾಗಿ ಶೀರ್ಷಿಕೆ.','Cannot view post type.'=>'ಲೇಖನದ ಪ್ರಕಾರವನ್ನು ವೀಕ್ಷಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','The title for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರದ ಶೀರ್ಷಿಕೆ.','The title for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಶೀರ್ಷಿಕೆ.','Types associated with the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಸಂಬಂಧಿಸಿದ ವಿಧಗಳು.','Term does not exist.'=>'ಪದ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Cannot set parent term, taxonomy is not hierarchical.'=>'ಪೋಷಕ ಪದವನ್ನು ಹೊಂದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ಟ್ಯಾಕ್ಸಾನಮಿ ಕ್ರಮಾನುಗತವಾಗಿಲ್ಲ.','Sorry, you are not allowed to view themes.'=>'ಕ್ಷಮಿಸಿ, ಥೀಮ್‌ಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The term cannot be deleted.'=>'ಪದವನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','URL of the term.'=>'ಪದದ URL.','HTML title for the term.'=>'ಪದಕ್ಕಾಗಿ HTML ಶೀರ್ಷಿಕೆ.','The parent term ID.'=>'ಮೂಲ ಪದದ ID.','Error creating new user.'=>'ಹೊಸ ಬಳಕೆದಾರರನ್ನು ಸೃಷ್ಟಿಸುವಾಗ ದೋಷ ಕಂಡುಬಂದಿದೆ.','The user cannot be deleted.'=>'ಬಳಕೆದಾರರನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Login name for the user.'=>'ಬಳಕೆದಾರರ ಲಾಗಿನ್ ಹೆಸರು.','Display name for the user.'=>'ಬಳಕೆದಾರರ ಹೆಸರನ್ನು ಪ್ರದರ್ಶಿಸಿ.','First name for the user.'=>'ಬಳಕೆದಾರರಿಗೆ ಮೊದಲ ಹೆಸರು.','Last name for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಕೊನೆಯ ಹೆಸರು.','URL of the user.'=>'ಬಳಕೆದಾರರ URL.','Description of the user.'=>'ಬಳಕೆದಾರರ ವಿವರಣೆ.','Author URL of the user.'=>'ಬಳಕೆದಾರರ ಲೇಖಕರ URL.','Locale for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಸ್ಥಳ.','The nickname for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಅಡ್ಡಹೆಸರು.','Roles assigned to the user.'=>'ಬಳಕೆದಾರನಿಗೆ ನಿಯೋಜಿಸಲಾದ ಪಾತ್ರಗಳು.','Avatar URLs for the user.'=>'ಬಳಕೆದಾರರಿಗೆ ಅವತಾರ್ URL ಗಳು.','Limit response to comments published after a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ನಂತರ ಪ್ರಕಟಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit response to comments published before a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ಮೊದಲು ಪ್ರಕಟಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','An alphanumeric identifier for the status.'=>'ಸ್ಥಿತಿಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫಯರ್.','All capabilities used by the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರದಿಂದ ಬಳಸಲಾದ ಎಲ್ಲಾ ಸಾಮರ್ಥ್ಯಗಳು.','A human-readable description of the post type.'=>'ಪೋಸ್ಟ್ ರೀತಿಯ ಮಾನವನ ಓದಬಹುದಾದ ವಿವರಣೆ.','Whether or not the post type should have children.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರವು ಮಕ್ಕಳನ್ನು ಹೊಂದಿರಬೇಕೆ ಅಥವಾ ಬೇಡವೇ.','Human-readable labels for the post type for various contexts.'=>'ವಿವಿಧ ಸಂದರ್ಭಗಳಿಗಾಗಿ ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಮಾನವ-ಓದಬಲ್ಲ ಲೇಬಲ್‌ಗಳು.','An alphanumeric identifier for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫೈಯರ್.','REST base route for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕೆ REST ಮೂಲ ಮಾರ್ಗ.','Required to be true, as revisions do not support trashing.'=>'ಸತ್ಯವಾಗಿರಬೇಕು, ಏಕೆಂದರೆ ಪರಿಷ್ಕರಣೆಗಳು ಕಸದ ಬುಟ್ಟಿಗೆ ಬೆಂಬಲ ನೀಡುವುದಿಲ್ಲ.','An alphanumeric identifier for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫಯರ್.','Required to be true, as terms do not support trashing.'=>'ನಿಯಮಗಳು ಕಸದ ಬುಟ್ಟಿಗೆ ಬೆಂಬಲ ನೀಡದ ಕಾರಣ, ಸತ್ಯವಾಗಿರಬೇಕು.','Unique identifier for the term.'=>'ಪದಕ್ಕಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','This address is used for admin purposes, like new user notification.'=>'ಹೊಸ ಬಳಕೆದಾರರ ಅಧಿಸೂಚನೆಯಂತಹ ನಿರ್ವಾಹಕ ಉದ್ದೇಶಗಳಿಗಾಗಿ ಈ ವಿಳಾಸವನ್ನು ಬಳಸಲಾಗುತ್ತದೆ.','Date/time'=>'ದಿನಾಂಕ/ಸಮಯ','Table of Contents'=>'ಪರಿವಿಡಿ','Insert/edit code sample'=>'ಕೋಡ್ ಮಾದರಿಯನ್ನು ಸೇರಿಸಿ/ಸಂಪಾದಿಸಿ','Insert/edit media'=>'ಮಾಧ್ಯಮವನ್ನು ಸೇರಿಸಿ/ಸಂಪಾದಿಸಿ','Short for red in RGBR'=>'R','Short for green in RGBG'=>'G','Short for blue in RGBB'=>'B','The URL of the resource for which to fetch oEmbed data.'=>'OEmbed ಡೇಟಾವನ್ನು ಪಡೆಯಲು ಸಂಪನ್ಮೂಲದ URL.','The oEmbed format to use.'=>'ಬಳಸಲು oEmbed ಫಾರ್ಮ್ಯಾಟ್.','The maximum width of the embed frame in pixels.'=>'ಎಂಬೆಡ್ ಚೌಕಟ್ಟಿನ ಗರಿಷ್ಟ ಅಗಲ ಪಿಕ್ಸೆಲ್ಗಳಲ್ಲಿ.','The maximum height of the embed frame in