ಾಮೆಂಟ್','Comment Author User Agent'=>'ಲೇಖಕ ಬಳಕೆದಾರ ಏಜೆಂಟ್ ಕಾಮೆಂಟ್','Comment Date'=>'ಕಾಮೆಂಟ್ ದಿನಾಂಕ','Comment Content'=>'ಪ್ರತಿಕ್ರಿ‍ಯೆ ವಿಷಯ','Comment URL'=>'ಪ್ರತಿಕ್ರಿ‍ಯೆ URL','request statusPending'=>'ಬಾಕಿಯಿರುವ','request statusConfirmed'=>'ದೃಢೀಕರಿಸಲಾಗಿದೆ','request statusFailed'=>'ವಿಫಲವಾಗಿದೆ','request statusCompleted'=>'ಪೂರ್ಣಗೊಂಡಿದೆ','Comment %d contains personal data but could not be anonymized.'=>'%d ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಒಳಗೊಂಡಿದೆ ಆದರೆ ಅನಾಮಧೇಯಗೊಳಿಸಲಾಗುವುದಿಲ್ಲ.','[deleted]'=>'[ಅಳಿಸಲಾಗಿದೆ]','This content was deleted by the author.'=>'ಲೇಖಕರು ಈ ವಿಷಯವನ್ನು ಅಳಿಸಿದ್ದಾರೆ.','User Requests'=>'ಬಳಕೆದಾರ ವಿನಂತಿಗಳು','User Request'=>'ಬಳಕೆದಾರ ವಿನಂತಿ','WordPress Media'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಮಾಧ್ಯಮ','Save my name, email, and website in this browser for the next time I comment.'=>'ಮುಂದಿನ ಬಾರಿ ನಾನು ಕಾಮೆಂಟ್ ಮಾಡಿದರೆ ಈ ಬ್ರೌಸರ್ನಲ್ಲಿ ನನ್ನ ಹೆಸರು, ಇಮೇಲ್ ಮತ್ತು ವೆಬ್ಸೈಟ್ ಉಳಿಸಿ.','Not enough space to upload. %s KB needed.'=>'ಅಪ್ಲೋಡ್ ಮಾಡಲು ಸಾಕಷ್ಟು ಸ್ಥಳವಿಲ್ಲ. %s KB ಅಗತ್ಯವಿದೆ.','You have used your space quota. Please delete files before uploading.'=>'ನಿಮ್ಮ ಸ್ಪೇಸ್ ಕೋಟಾವನ್ನು ನೀವು ಬಳಸಿದ್ದೀರಿ. ಅಪ್ಲೋಡ್ ಮಾಡುವ ಮೊದಲು ದಯವಿಟ್ಟು ಫೈಲ್ಗಳನ್ನು ಅಳಿಸಿ.','The current user can publish this post.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಈ ಪೋಸ್ಟ್ ಅನ್ನು ಪ್ರಕಟಿಸಬಹುದು.','The current user can sticky this post.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಈ ಪೋಸ್ಟ್ ಅನ್ನು ಸ್ಟಿಕಿ ಮಾಡಬಹುದು.','The current user can change the author on this post.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಈ ಪೋಸ್ಟ್ನಲ್ಲಿ ಲೇಖಕನನ್ನು ಬದಲಾಯಿಸಬಹುದು.','The current user can assign terms in the %s taxonomy.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು %s ಟ್ಯಾಕ್ಸಾನಮಿ ಪದಗಳನ್ನು ನಿಯೋಜಿಸಬಹುದು.','The current user can create terms in the %s taxonomy.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು %s ಟ್ಯಾಕ್ಸಾನಮಿ ಪದಗಳನ್ನು ರಚಿಸಬಹುದು.','The offset number requested is larger than or equal to the number of available revisions.'=>'ವಿನಂತಿಸಲಾದ ಆಫ್ಸೆಟ್ ಸಂಖ್ಯೆಯು ಲಭ್ಯವಿರುವ ಪರಿಷ್ಕರಣೆಗಳ ಸಂಖ್ಯೆಗಿಂತ ದೊಡ್ಡದಾಗಿದೆ ಅಥವಾ ಸಮನಾಗಿರುತ್ತದೆ.','Post published.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಟಿಸಲಾಗಿದೆ.','Page published.'=>'ಪುಟ ಪ್ರಕಟಿಸಲಾಗಿದೆ.','Post published privately.'=>'ಪೋಸ್ಟ್ ಖಾಸಗಿಯಾಗಿ ಪ್ರಕಟವಾಗಿದೆ.','Page published privately.'=>'ಪುಟವನ್ನು ಖಾಸಗಿಯಾಗಿ ಪ್ರಕಟಿಸಲಾಗಿದೆ.','Post reverted to draft.'=>'ಪೋಸ್ಟ್ ಡ್ರಾಫ್ಟ್ಗೆ ಮರಳಿದೆ.','Page reverted to draft.'=>'ಪುಟ ಡ್ರಾಫ್ಟ್ಗೆ ಹಿಂತಿರುಗಿಸಲಾಗಿದೆ.','Post scheduled.'=>'ಪೋಸ್ಟ್ ನಿಗದಿಯಾಗಿದೆ.','Page scheduled.'=>'ಪುಟ ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Post updated.'=>'‍ಲೇಖನವನ್ನು ಪರಿಷ್ಕರಿಸಲಾಗಿದೆ.','Page updated.'=>'ಪುಟವನ್ನು ಪರಿಷ್ಕರಿಸಲಾಗಿದೆ.','There is no autosave revision for this post.'=>'ಈ ಪೋಸ್ಟ್ಗೆ ಆಟೋಸೇವ್ ಪರಿಷ್ಕರಣೆ ಇಲ್ಲ.','Preview link for the post.'=>'ಪೋಸ್ಟ್ಗಾಗಿ ಪೂರ್ವವೀಕ್ಷಣೆ ಲಿಂಕ್.','There is nothing to save. The autosave and the post content are the same.'=>'ಉಳಿಸಲು ಏನೂ ಇಲ್ಲ. ಆಟೋಸೇವ್ ಮತ್ತು ಪೋಸ್ಟ್ ವಿಷಯಗಳು ಒಂದೇ ಆಗಿವೆ.','Permalink template for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಪರ್ಮಾಲಿಂಕ್ ಟೆಂಪ್ಲೇಟ್.','Slug automatically generated from the post title.'=>'ಸ್ಲಗ್ ಪೋಸ್ಟ್ ಶೀರ್ಷಿಕೆಯಿಂದ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಉತ್ಪತ್ತಿಯಾಗುತ್ತದೆ.','Version of the content block format used by the post.'=>'ಪೋಸ್ಟ್ ಬಳಸಿದ ವಿಷಯ ಬ್ಲಾಕ್ ಸ್ವರೂಪದ ಆವೃತ್ತಿ.','The current user can post unfiltered HTML markup and JavaScript.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಫಿಲ್ಟರ್ ಮಾಡದ HTML ಮಾರ್ಕ್ಅಪ್ ಮತ್ತು ಜಾವಾಸ್ಕ್ರಿಪ್ಟ್ ಅನ್ನು ಪೋಸ್ಟ್ ಮಾಡಬಹುದು.','REST search handlers must extend the %s class.'=>'REST ಹುಡುಕಾಟ ಹ್ಯಾಂಡ್ಲರ್ಗಳು %s ವರ್ಗವನ್ನು ವಿಸ್ತರಿಸಬೇಕು.','Internal search handler error.'=>'ಆಂತರಿಕ ಹುಡುಕಾಟ ಹ್ಯಾಂಡ್ಲರ್ ದೋಷ.','Object type.'=>'ವಸ್ತು ಪ್ರಕಾರ.','Object subtype.'=>'ವಸ್ತು ಉಪ ಪ್ರಕಾರ.','Limit results to items of an object type.'=>'ವಸ್ತು ಪ್ರಕಾರದ ಐಟಂಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit results to items of one or more object subtypes.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ವಸ್ತು ಉಪವಿಭಾಗಗಳ ಐಟಂಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Invalid type parameter.'=>'ಅಮಾನ್ಯ ಪ್ರಕಾರದ ನಿಯತಾಂಕ.','The visibility settings for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಗೋಚರತೆ ಸೆಟ್ಟಿಂಗ್‌ಗಳು.','Features supported by this theme.'=>'ಈ ಥೀಮ್ ಬೆಂಬಲಿಸುವ ವೈಶಿಷ್ಟ್ಯಗಳು.','Limit result set to themes assigned one or more statuses.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಸ್ಥಿತಿಗಳನ್ನು ನಿಗದಿಪಡಿಸಿದ ಥೀಮ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಸೀಮಿತಗೊಳಿಸಿ.','%s from now'=>'ಈಗಿನಿಂದ %s','Unique registered name for the block.'=>'ಬ್ಲಾಕ್‌ಗಾಗಿ ವಿಶಿಷ್ಟ ನೋಂದಾಯಿತ ಹೆಸರು.','Attributes for the block.'=>'ಬ್ಲಾಕ್ನ ಗುಣಲಕ್ಷಣಗಳು.','ID of the post context.'=>'ಪೋಸ್ಟ್ ಸಂದರ್ಭದ ID.','Sorry, you are not allowed to read blocks of this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್‌ನ ಬ್ಲಾಕ್‌ಗಳನ್ನು ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to read blocks as this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಂತೆ ಬ್ಲಾಕ್‌ಗಳನ್ನು ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Invalid block.'=>'ಅಮಾನ್ಯ ಬ್ಲಾಕ್.','The rendered block.'=>'ಪ್ರದರ್ಶಿತವಾದ ಬ್ಲಾಕ್.','M j, Y g:i a'=>'M j, Y g:i a','Replace image'=>'ಚಿತ್ರವನ್ನು ಬದಲಾಯಿಸಿ','Copied!'=>'‍ನಕಲಿಸಲಾಗಿದೆ!','Edit image'=>'ಚಿತ್ರ ಸಂಪಾದಿಸು','Sorry, you are not allowed to view autosaves of this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಲೇಖನದ ಸ್ವಉಳಿಕೆಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Classic Block Keyboard Shortcuts'=>'ಕ್ಲಾಸಿಕ್ ಬ್ಲಾಕ್ ಕೀಬೋರ್ಡ್ ಶಾರ್ಟ್ಕಟ್ಗಳು','A variable mismatch has been detected.'=>'ವೇರಿಯಬಲ್ ಅಸಾಮರಸ್ಯ ಪತ್ತೆಯಾಗಿದೆ.','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಯನ್ನು ಅಡ್ಮಿನ್ ಇಂಟರ್ಫೇಸ್ ಮೂಲಕ ಅಥವಾ ಫ್ರಂಟ್-ಎಂಡ್ ಬಳಕೆದಾರರಿಂದ ಸಾರ್ವಜನಿಕವಾಗಿ ಬಳಸಲು ಉದ್ದೇಶಿಸಲಾಗಿದೆಯೇ','Whether the taxonomy is publicly queryable.'=>'ವರ್ಗೀಕರಣವು ಸಾರ್ವಜನಿಕವಾಗಿ ಪ್ರಶ್ನಾರ್ಹವಾಗಿದೆಯೇ.','Whether to generate a default UI for managing this taxonomy.'=>'ಈ ವರ್ಗೀಕರಣವನ್ನು ನಿರ್ವಹಿಸಲು ಡೀಫಾಲ್ಟ್ UI ಅನ್ನು ರಚಿಸಬೇಕೆ','Whether to allow automatic creation of taxonomy columns on associated post-types table.'=>'ಸಂಬಂಧಿತ ಪೋಸ್ಟ್-ಟೈಪ್ ಟೇಬಲ್‌ನಲ್ಲಿ ಟ್ಯಾಕ್ಸಾನಮಿ ಕಾಲಮ್‌ಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ರಚಿಸಲು ಅನುಮತಿಸಬೇಕೆ.','Whether to make the taxonomy available for selection in navigation menus.'=>'ನ್ಯಾವಿಗೇಷನ್ ಮೆನುಗಳಲ್ಲಿ ಆಯ್ಕೆಗೆ ಟ್ಯಾಕ್ಸಾನಮಿ ಲಭ್ಯವಾಗುವಂತೆ ಮಾಡಬೇಕೆ','Whether to show the taxonomy in the quick/bulk edit panel.'=>'ತ್ವರಿತ/ಬೃಹತ್ ಸಂಪಾದನಾ ಫಲಕದಲ್ಲಿ ವರ್ಗೀಕರಣವನ್ನು ತೋರಿಸಬೇಕೆ.','This theme failed to load properly and was paused within the admin backend.'=>'ಈ ಥೀಮ್ ಸರಿಯಾಗಿ ಲೋಡ್ ಮಾಡಲು ವಿಫಲವಾಗಿದೆ ಮತ್ತು ನಿರ್ವಾಹಕ ಬ್ಯಾಕೆಂಡ್‌ನಲ್ಲಿ ವಿರಾಮಗೊಳಿಸಲಾಗಿದೆ','%1$s by %2$s pixels'=>'%1$s ಮೂಲಕ %2$s ಪಿಕ್ಸೆಲ್‌ಗಳು','%s minute'=>'%s ನಿಮಿಷ' . "\0" . '%s ನಿಮಿಷಗಳು','%s second'=>'%s ಸೆಕೆಂಡ್' . "\0" . '%s ಸೆಕೆಂಡುಗಳು','localized PHP upgrade information pagehttps://wordpress.org/support/update-php/'=>'https://wordpress.org/support/update-php/','This resource is provided by your web host, and is specific to your site. For more information, <a href="%s" target="_blank">see the official WordPress documentation</a>.'=>'ಈ ಸಂಪನ್ಮೂಲವನ್ನು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟ್ ಒದಗಿಸಿದೆ ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ನಿರ್ದಿಷ್ಟವಾಗಿದೆ. ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ, <a href="%s" target="_blank">ಅಧಿಕೃತ ವರ್ಡ್ಪ್ರೆಸ್ ದಸ್ತಾವೇಜನ್ನು ನೋಡಿ</a>.','%1$s, %2$s'=>'%1$s, %2$s','Unable to submit this form, please try again.'=>'ಈ ಫಾರ್ಮ್ ಅನ್ನು ಸಲ್ಲಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ದಯವಿಟ್ಟು ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ.','Could not insert site into the database.'=>'ಸೈಟ್ ಅನ್ನು ಡೇಟಾಬೇಸ್‌ಗೆ ಸೇರಿಸಲಾಗಲಿಲ್ಲ.','Site ID must not be empty.'=>'ಸೈಟ್ ಐಡಿ ಖಾಲಿಯಾಗಿರಬಾರದು.','Site does not exist.'=>'ತಾಣ ಅಸ್ಥಿತ್ವದಲ್ಲಿಲ್ಲ.','Could not update site in the database.'=>'ಡೇಟಾಬೇಸ್ನಲ್ಲಿ ಸೈಟ್ ಅನ್ನು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Could not delete site from the database.'=>'ಡೇಟಾಬೇಸ್‌ನಿಂದ ಸೈಟ್ ಅನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Site domain must not be empty.'=>'ಸೈಟ್ ಡೊಮೇನ್ ಖಾಲಿಯಾಗಿರಬಾರದು.','Site path must not be empty.'=>'ಸೈಟ್ ಪಥ ಖಾಲಿಯಾಗಿರಬಾರದು.','Site network ID must be provided.'=>'ಸೈಟ್ ನೆಟ್ವರ್ಕ್ ಐಡಿ ನೀಡಬೇಕು.','Both registration and last updated dates must be provided.'=>'ನೋಂದಣಿ ಮತ್ತು ಕೊನೆಯ ನವೀಕರಿಸಿದ ದಿನಾಂಕಗಳನ್ನು ಒದಗಿಸಬೇಕು.','Both registration and last updated dates must be valid dates.'=>'ನೋಂದಣಿ ಮತ್ತು ಕೊನೆಯ ನವೀಕರಿಸಿದ ದಿನಾಂಕಗಳು ಎರಡೂ ಮಾನ್ಯ ದಿನಾಂಕಗಳಾಗಿರಬೇಕು.','Site with the ID does not exist.'=>'ID ಹೊಂದಿರುವ ಸೈಟ್ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','The site appears to be already initialized.'=>'ಸೈಟ್ ಈಗಾಗಲೇ ಆರಂಭಗೊಂಡಂತೆ ಕಾಣುತ್ತದೆ.','Site %d'=>'ತಾಣ %d','The site appears to be already uninitialized.'=>'ಈ ಸೈಟ್ ಈಗಾಗಲೇ ಆರಂಭಿಸದಿರುವಂತೆ ತೋರುತ್ತಿದೆ.','The %s table is not installed. Please run the network database upgrade.'=>'%s ಟೇಬಲ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿಲ್ಲ. ದಯವಿಟ್ಟು ನೆಟ್‌ವರ್ಕ್ ಡೇಟಾಬೇಸ್ ನವೀಕರಣವನ್ನು ಚಾಲನೆ ಮಾಡಿ.','Failed <span class="count">(%s)</span>'=>'ವಿಫಲವಾಗಿದೆ <span class="count">(%s)</span>' . "\0" . 'ವಿಫಲವಾಗಿದೆ <span class="count">(%s)</span>','%1$s, and %2$s'=>'%1$s, ಮತ್ತು %2$s','REST API routes must be registered on the %s action.'=>'REST API ಮಾರ್ಗಗಳನ್ನು %s ಕ್ರಿಯೆಯಲ್ಲಿ ನೋಂದಾಯಿಸಬೇಕು.','Could not retrieve site data.'=>'ಸೈಟ್ ಡೇಟಾವನ್ನು ಹಿಂಪಡೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Update PHP'=>'PHP ಪರಿಷ್ಕರಿಸಿ','https://developer.wordpress.org/themes/advanced-topics/child-themes/'=>'https://developer.wordpress.org/themes/advanced-topics/child-themes/','An error of type %1$s was caused in line %2$s of the file %3$s. Error message: %4$s'=>'%3$s ಕಡತದ %2$s ಸಾಲಿನಲ್ಲಿ %1$s ವಿಧದ ದೋಷ ಉಂಟಾಗಿದೆ. ದೋಷ ಸಂದೇಶ: %4$s','No cookie present.'=>'ಯಾವುದೇ ಕುಕೀ ಪ್ರಸ್ತುತವಿಲ್ಲ.','Invalid cookie format.'=>'ಅಮಾನ್ಯವಾದ ಕುಕೀ ಸ್ವರೂಪ.','Cookie expired.'=>'ಕುಕೀ ಅವಧಿ ಮುಗಿದಿದೆ.','Invalid cookie.'=>'ಅಮಾನ್ಯ ಕುಕೀ.','Select site icon'=>'ಸೈಟ್ ಐಕಾನ್ ಆಯ್ಕೆಮಾಡಿ','Recovery Mode not initialized.'=>'ಮರುಪಡೆಯುವಿಕೆ ಮೋಡ್ ಅನ್ನು ಪ್ರಾರಂಭಿಸಲಾಗಿಲ್ಲ.','Invalid recovery key format.'=>'ಅಮಾನ್ಯ ಮರುಪಡೆಯುವಿಕೆ ಕೀ ಫಾರ್ಮ್ಯಾಟ್.','Invalid recovery key.'=>'ಅಮಾನ್ಯ ಮರುಪಡೆಯುವಿಕೆ ಕೀ.','Recovery key expired.'=>'ಮರುಪಡೆಯುವಿಕೆ ಕೀ ಅವಧಿ ಮುಗಿದಿದೆ.','Could not update the email last sent time.'=>'ಕೊನೆಯದಾಗಿ ಕಳುಹಿಸಿದ ಇಮೇಲ್ ಸಮಯವನ್ನು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','The email could not be sent. Possible reason: your host may have disabled the %s function.'=>'ಇಮೇಲ್ ಕಳುಹಿಸಲಾಗಲಿಲ್ಲ. ಸಂಭವನೀಯ ಕಾರಣ: ನಿಮ್ಮ ಹೋಸ್ಟ್ %s ಕಾರ್ಯವನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿರಬಹುದು.','A recovery link was already sent %1$s ago. Please wait another %2$s before requesting a new email.'=>'ಮರುಪಡೆಯುವಿಕೆ ಲಿಂಕ್ ಅನ್ನು ಈಗಾಗಲೇ %1$s ಹಿಂದೆ ಕಳುಹಿಸಲಾಗಿದೆ. ಹೊಸ ಇಮೇಲ್‌ಗೆ ವಿನಂತಿಸುವ ಮೊದಲು ದಯವಿಟ್ಟು %2$s ಕಾಯಿರಿ.','Error Details'=>'ದೋಷ ವಿವರಗಳು','[%s] Your Site is Experiencing a Technical Issue'=>'[%s] ನಿಮ್ಮ ಸೈಟ್ ತಾಂತ್ರಿಕ ಸಮಸ್ಯೆಯನ್ನು ಎದುರಿಸುತ್ತಿದೆ','Error not caused by a plugin or theme.'=>'ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್‌ನಿಂದ ದೋಷ ಉಂಟಾಗಿಲ್ಲ.','Failed to store the error.'=>'ದೋಷವನ್ನು ಸಂಗ್ರಹಿಸಲು ವಿಫಲವಾಗಿದೆ.','Exit recovery mode link expired.'=>'ಮರುಪಡೆಯುವಿಕೆ ಮೋಡ್‌ನಿಂದ ನಿರ್ಗಮಿಸುವ ಲಿಂಕ್ ಅವಧಿ ಮೀರಿದೆ.','Failed to exit recovery mode. Please try again later.'=>'ಮರುಪಡೆಯುವಿಕೆ ಮೋಡ್‌ನಿಂದ ನಿರ್ಗಮಿಸಲು ವಿಫಲವಾಗಿದೆ. ದಯವಿಟ್ಟು ನಂತರ ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ.','Edit gallery'=>'ಗ್ಯಾಲರಿಯನ್ನು ಸಂಪಾದಿಸಿ','[%s] Admin Email Changed'=>'[%s] ನಿರ್ವಾಹಕ ಇಮೇಲ್ ಬದಲಾಗಿದೆ','[%s] Network Admin Email Change Request'=>'[%s] ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕ ಇಮೇಲ್ ಬದಲಾವಣೆ ವಿನಂತಿ','[%s] Network Admin Email Changed'=>'[%s] ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕ ಇಮೇಲ್ ಬದಲಾಗಿದೆ','Restore from Trash'=>'ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಿ','Move to Trash'=>'ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಿ','[%s] Login Details'=>'[%s] ಲಾಗಿನ್ ವಿವರಗಳು','Error occurred on a non-protected endpoint.'=>'ರಕ್ಷಣೆಯಿಲ್ಲದ ಎಂಡ್‌ಪಾಯಿಂಟ್‌ನಲ್ಲಿ ದೋಷ ಸಂಭವಿಸಿದೆ.','Please contact your host for assistance with investigating this issue further.'=>'ಈ ಸಮಸ್ಯೆಯನ್ನು ಮತ್ತಷ್ಟು ತನಿಖೆ ಮಾಡಲು ಸಹಾಯಕ್ಕಾಗಿ ದಯವಿಟ್ಟು ನಿಮ್ಮ ಹೋಸ್ಟ್ ಅನ್ನು ಸಂಪರ್ಕಿಸಿ.','In this case, WordPress caught an error with one of your plugins, %s.'=>'ಈ ಸಂದರ್ಭದಲ್ಲಿ, ವರ್ಡ್ಪ್ರೆಸ್ ನಿಮ್ಮ ಪ್ಲಗ್‌ಇನ್‌ಗಳಲ್ಲಿ ಒಂದಾದ %s ನೊಂದಿಗೆ ದೋಷವನ್ನು ಹಿಡಿದಿದೆ.','Howdy!

Since WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'ನಮಸ್ಕಾರ!

ವರ್ಡ್ಪ್ರೆಸ್ 5.2 ರಿಂದ ಒಂದು ಅಂತರ್ನಿರ್ಮಿತ ವೈಶಿಷ್ಟ್ಯವು ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್ ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಮಾರಕ ದೋಷವನ್ನು ಉಂಟುಮಾಡಿದಾಗ ಪತ್ತೆ ಮಾಡುತ್ತದೆ ಮತ್ತು ಈ ಸ್ವಯಂಚಾಲಿತ ಇಮೇಲ್ ಮೂಲಕ ನಿಮಗೆ ತಿಳಿಸುತ್ತದೆ.

###CAUSE###
ಮೊದಲು, ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ಗೆ ಭೇಟಿ ನೀಡಿ (###SITEURL###) ಮತ್ತು ಯಾವುದೇ ಗೋಚರ ಸಮಸ್ಯೆಗಳಿವೆಯೇ ಎಂದು ಪರಿಶೀಲಿಸಿ. ಮುಂದೆ, ದೋಷವನ್ನು ಹಿಡಿದಿರುವ ಪುಟಕ್ಕೆ ಭೇಟಿ ನೀಡಿ (###PAGEURL###) ಮತ್ತು ಯಾವುದೇ ಗೋಚರ ಸಮಸ್ಯೆಗಳಿವೆಯೇ ಎಂದು ಪರಿಶೀಲಿಸಿ.

###SUPPORT###

ನಿಮ್ಮ ಸೈಟ್ ಮುರಿದಂತೆ ಕಂಡುಬಂದರೆ ಮತ್ತು ನಿಮ್ಮ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್ ಅನ್ನು ನೀವು ಸಾಮಾನ್ಯವಾಗಿ ಪ್ರವೇಶಿಸಲು ಸಾಧ್ಯವಾಗದಿದ್ದರೆ, ವರ್ಡ್‌ಪ್ರೆಸ್ ಈಗ ವಿಶೇಷ "ರಿಕವರಿ ಮೋಡ್" ಅನ್ನು ಹೊಂದಿದೆ. ಇದು ನಿಮ್ಮ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್‌ಗೆ ಸುರಕ್ಷಿತವಾಗಿ ಲಾಗಿನ್ ಮಾಡಲು ಮತ್ತು ಮತ್ತಷ್ಟು ತನಿಖೆ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.

###LINK###

ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಸುರಕ್ಷಿತವಾಗಿರಿಸಲು, ಈ ಲಿಂಕ್ನ ಅವಧಿ ###EXPIRES### ನಲ್ಲಿ ಮುಕ್ತಾಯಗೊಳ್ಳುತ್ತದೆ  ಆದರೂ ಅದರ ಬಗ್ಗೆ ಚಿಂತಿಸಬೇಡಿ: ಹಳೆಯ ಲಿಂಕ್ ಅವಧಿ ಮುಗಿದ ನಂತರ ದೋಷ ಮತ್ತೆ ಸಂಭವಿಸಿದಲ್ಲಿ ನಿಮಗೆ ಹೊಸ ಲಿಂಕ್ ಅನ್ನು ಇಮೇಲ್ ಮಾಡಲಾಗುತ್ತದೆ.

ಈ ಸಮಸ್ಯೆಯ ಸಹಾಯವನ್ನು ಹುಡುಕುವಾಗ, ಈ ಕೆಳಗಿನ ಕೆಲವು ಮಾಹಿತಿಗಾಗಿ ನಿಮ್ಮನ್ನು ಕೇಳಬಹುದು:
###DEBUG###

###DETAILS###','In this case, WordPress caught an error with your theme, %s.'=>'ಈ ಸಂದರ್ಭದಲ್ಲಿ, ವರ್ಡ್ಪ್ರೆಸ್ ನಿಮ್ಮ ಥೀಮ್ ನೊಂದಿಗೆ ದೋಷವನ್ನು ಹಿಡಿದಿದೆ, %s.','<a href="%1$s" %2$s>Learn how to describe the purpose of the image%3$s</a>. Leave empty if the image is purely decorative.'=>'<a href="%1$s" %2$s>ಚಿತ್ರದ ಉದ್ದೇಶವನ್ನು ವಿವರಿಸಲು ತಿಳಿಯಿರಿ%3$s</a>. ಚಿತ್ರವು ಸಂಪೂರ್ಣವಾಗಿ ಅಲಂಕಾರಿಕವಾಗಿದ್ದರೆ ಖಾಲಿ ಬಿಡಿ.','New version available.'=>'ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ','Allow people to submit comments on new posts.'=>'ಹೊಸ ಪೋಸ್ಟ್‌ಗಳಲ್ಲಿ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಸಲ್ಲಿಸಲು ಜನರಿಗೆ ಅನುಮತಿಸಿ.','Your browser cannot upload files'=>'ನಿಮ್ಮ ಬ್ರೌಸರ್ ಗೆ ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ','Attachment Preview'=>'ಲಗತ್ತು ಪೂರ್ವವೀಕ್ಷಣೆ','Details'=>'ವಿವರಗಳು ','Caption&hellip;'=>'ಶೀರ್ಷಿಕೆ&hellip;','Video title'=>'ವೀಡಿಯೊ ಶೀರ್ಷಿಕೆ','Video title&hellip;'=>'ವೀಡಿಯೊ ಶೀರ್ಷಿಕೆ&hellip;','Audio title'=>'ಆಡಿಯೋ ಶೀರ್ಷಿಕೆ','Audio title&hellip;'=>'ಆಡಿಯೋ ಶೀರ್ಷಿಕೆ&hellip;','Media title'=>'ಮಾಧ್ಯಮ ಶೀರ್ಷಿಕೆ','Media title&hellip;'=>'ಮಾಧ್ಯಮ ಶೀರ್ಷಿಕೆ&hellip;','Image size in pixels'=>'ಪಿಕ್ಸೆಲ್‌ಗಳಲ್ಲಿ ಚಿತ್ರದ ಗಾತ್ರ ','Cannot resize the image. Both width and height are not set.'=>'ಚಿತ್ರವನ್ನು ಮರುಗಾತ್ರಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಅಗಲ ಮತ್ತು ಎತ್ತರ ಎರಡನ್ನೂ ಹೊಂದಿಸಲಾಗಿಲ್ಲ.','comment_excerpt_length20'=>'೨೦','excerpt_length55'=>'೫೫','Unexpected response from the server. The file may have been uploaded successfully. Check in the Media Library or reload the page.'=>'ಸರ್ವರ್‌ನಿಂದ ಅನಿರೀಕ್ಷಿತ ಪ್ರತಿಕ್ರಿಯೆ. ಫೈಲ್ ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಪ್‌ಲೋಡ್ ಮಾಡಿರಬಹುದು. ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಯಲ್ಲಿ ಪರಿಶೀಲಿಸಿ ಅಥವಾ ಪುಟವನ್ನು ಮರುಲೋಡ್ ಮಾಡಿ.','When registering an "array" meta type to show in the REST API, you must specify the schema for each array item in "show_in_rest.schema.items".'=>'REST API ನಲ್ಲಿ ತೋರಿಸಲು "ಅರೇ" ಮೆಟಾ ಪ್ರಕಾರವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ನೀವು "show_in_rest.schema.items" ನಲ್ಲಿ ಪ್ರತಿ ರಚನೆಯ ಐಟಂಗೆ ಸ್ಕೀಮಾವನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಬೇಕು.','Could not update the meta value of %s in database.'=>'ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ %s ಮೆಟಾ ಮೌಲ್ಯವನ್ನು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Sorry, you are not allowed to delete revisions of this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್‌ನ ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Whether posts of this status may have floating published dates.'=>'ಈ ಸ್ಥಿತಿಯ ಪೋಸ್ಟ್‌ಗಳು ಫ್ಲೋಟಿಂಗ್ ಪ್ರಕಟಿತ ದಿನಾಂಕಗಳನ್ನು ಹೊಂದಿರಬಹುದೇ','Added:'=>'ಸೇರಿಸಲಾಗಿದೆ:','Unchanged:'=>'ಬದಲಾಗದೆ:','User&#8217;s comment data.'=>'ಬಳಕೆದಾರರ ಕಾಮೆಂಟ್ ಡೇಟಾ.','The %1$s, %2$s, and %3$s values can be edited to set the video track language and kind.'=>'ವೀಡಿಯೊ ಟ್ರ್ಯಾಕ್ ಭಾಷೆ ಮತ್ತು ರೀತಿಯನ್ನು ಹೊಂದಿಸಲು %1$s, %2$s, ಮತ್ತು %3$s ಮೌಲ್ಯಗಳನ್ನು ಸಂಪಾದಿಸಬಹುದು.','Requirements Not Met'=>'ಅವಶ್ಯಕತೆಗಳು ಪೂರೈಸಿಲ್ಲ','Documents'=>'ದಾಖಲೆಗಳು','Manage Documents'=>'ದಾಖಲೆಗಳನ್ನು ನಿರ್ವಹಿಸಿ','Spreadsheets'=>'ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ಗಳು','Manage Spreadsheets'=>'ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ','Spreadsheet <span class="count">(%s)</span>'=>'ಸ್ಪ್ರೆಡ್ಶೀಟ್ <span class="count">(%s)</span>' . "\0" . 'ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ಗಳು <span class="count">(%s)</span>','Manage Archives'=>'ಆರ್ಕೈವ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ','Archive <span class="count">(%s)</span>'=>'ಆರ್ಕೈವ್ <span class="count">(%s)</span>' . "\0" . 'ಆರ್ಕೈವ್ಗಳು <span class="count">(%s)</span>','Number of media items found: %d'=>'ಕಂಡುಬಂದಿರುವ ಮಾಧ್ಯಮ ಐಟಂಗಳ ಸಂಖ್ಯೆ: %d','No media items found. Try a different search.'=>'ಯಾವುದೇ ಮಾಧ್ಯಮ ವಸ್ತುಗಳು ಕಂಡುಬಂದಿಲ್ಲ. ಬೇರೆ ಹುಡುಕಾಟವನ್ನು ಪ್ರಯತ್ನಿಸಿ.','User&#8217;s media data.'=>'ಬಳಕೆದಾರರ ಮಾಧ್ಯಮ ಡೇಟಾ.','The image cannot be rotated because the embedded meta data cannot be updated.'=>'ಎಂಬೆಡೆಡ್ ಮೆಟಾ ಡೇಟಾವನ್ನು ಅಪ್‌ಡೇಟ್ ಮಾಡಲಾಗದ ಕಾರಣ ಚಿತ್ರವನ್ನು ತಿರುಗಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','There has been a critical error on this website, putting it in recovery mode. Please check the Themes and Plugins screens for more details. If you just installed or updated a theme or plugin, check the relevant page for that first.'=>'ಈ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ನಿರ್ಣಾಯಕ ದೋಷವಿದ್ದು, ಅದನ್ನು ರಿಕವರಿ ಮೋಡ್‌ನಲ್ಲಿ ಇರಿಸಲಾಗಿದೆ. ಹೆಚ್ಚಿನ ವಿವರಗಳಿಗಾಗಿ ದಯವಿಟ್ಟು ಥೀಮ್‌ಗಳು ಮತ್ತು ಪ್ಲಗಿನ್‌ಗಳ ಸ್ಕ್ರೀನ್‌ಗಳನ್ನು ಪರಿಶೀಲಿಸಿ. ನೀವು ಈಗಷ್ಟೇ ಥೀಮ್ ಅಥವಾ ಪ್ಲಗಿನ್ ಅನ್ನು ಸ್ಥಾಪನೆ ಅಥವಾ ನವೀಕರಣ ಮಾಡಿದ್ದರೆ, ಮೊದಲು ಅದಕ್ಕೆ ಸಂಬಂಧಿಸಿದ ಪುಟವನ್ನು ಪರಿಶೀಲಿಸಿ.','There has been a critical error on this website. Please check your site admin email inbox for instructions.'=>'ಈ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ನಿರ್ಣಾಯಕ ದೋಷ ಕಂಡುಬಂದಿದೆ. ಸೂಚನೆಗಳಿಗಾಗಿ ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸೈಟ್ ನಿರ್ವಾಹಕ ಇಮೇಲ್ ಇನ್‌ಬಾಕ್ಸ್ ಅನ್ನು ಪರಿಶೀಲಿಸಿ.','There has been a critical error on this website.'=>'ಈ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ನಿರ್ಣಾಯಕ ದೋಷ ಕಂಡುಬಂದಿದೆ.','https://wordpress.org/support/article/debugging-in-wordpress/'=>'https://wordpress.org/support/article/debugging-in-wordpress/','Your timezone is set to %1$s (%2$s), currently %3$s (Coordinated Universal Time %4$s).'=>'ನಿಮ್ಮ ಸಮಯವಲಯವನ್ನು %1$s (%2$s) ಗೆ ಹೊಂದಿಸಲಾಗಿದೆ, ಪ್ರಸ್ತುತ %3$s (ಸಂಯೋಜಿತ ಸಾರ್ವತ್ರಿಕ ಸಮಯ %4$s).','Your timezone is set to %1$s (Coordinated Universal Time %2$s).'=>'ನಿಮ್ಮ ಸಮಯವಲಯವನ್ನು %1$s (ಸಮನ್ವಯ ಸಾರ್ವತ್ರಿಕ ಸಮಯ %2$s) ಗೆ ಹೊಂದಿಸಲಾಗಿದೆ.','https://wordpress.org/support/article/wordpress-widgets/'=>'https://wordpress.org/support/article/wordpress-widgets/','Posts'=>'ಪೋಸ್ಟ್‌ಗಳು','https://wordpress.org/support/article/using-permalinks/#choosing-your-permalink-structure'=>'https://wordpress.org/support/article/using-permalinks/#choosing-your-permalink-structure','https://wordpress.org/support/article/debugging-a-wordpress-network/'=>'https://wordpress.org/support/article/debugging-a-wordpress-network/','WordPress version %s'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ %s','Active theme: %1$s (version %2$s)'=>'ಪ್ರಸ್ತುತ ಥೀಮ್: %1$s (ಆವೃತ್ತಿ %2$s)','Current plugin: %1$s (version %2$s)'=>'ಪ್ರಸ್ತುತ ಪ್ಲಗಿನ್: %1$s (ಆವೃತ್ತಿ %2$s)','PHP version %s'=>'PHP ಆವೃತ್ತಿ %s','Nav menu locations must be strings.'=>'ನವ್ ಮೆನು ಸ್ಥಳಗಳು ಸ್ಟ್ರಿಂಗ್ಗಳಾಗಿರಬೇಕು.','List view'=>'ಪಟ್ಟಿ ನೋಟ ','Grid view'=>'ಗ್ರಿಡ್ ನೋಟ ','Filter media'=>'ಮಾಧ್ಯಮವನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಿ','Media list'=>'ಮಾಧ್ಯಮ ಪಟ್ಟಿ ','List of the missing image sizes of the attachment.'=>'ಲಗತ್ತಿನಲ್ಲಿ ಕಾಣೆಯಾದ ಚಿತ್ರದ ಗಾತ್ರಗಳ ಪಟ್ಟಿ.','file type groupArchives'=>'ಸಂಗ್ರಹಗಳು','media modal menu actionsActions'=>'ಆಕ್ಷನ್ ಗಳು','media modal menuMenu'=>'ಮೆನು ','Selected media actions'=>'ಆಯ್ದ ಮಾಧ್ಯಮ ಕ್ರಮಗಳು','minimum input length for searching post links3'=>'೩','Sorry, the post could not be created.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಅನ್ನು ರಚಿಸಲಾಗಲಿಲ್ಲ.','Sorry, this method is not supported.'=>'ಕ್ಷಮಿಸಿ, ಈ ವಿಧಾನವು ಬೆಂಬಲಿತವಾಗಿಲ್ಲ.','Limit result set based on relationship between multiple taxonomies.'=>'ಬಹು ಟ್ಯಾಕ್ಸಾನಮಿಗಳ ನಡುವಿನ ಸಂಬಂಧದ ಆಧಾರದ ಮೇಲೆ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಮಿತಿಗೊಳಿಸಿ.','HTTP redirect status code must be a redirection code, 3xx.'=>'HTTP ಮರುನಿರ್ದೇಶನ ಸ್ಥಿತಿ ಕೋಡ್ ಒಂದು ಮರುನಿರ್ದೇಶನ ಕೋಡ್ ಆಗಿರಬೇಕು, 3xx.','In reply to: %s'=>'ಇದಕ್ಕೆ ಪ್ರತ್ಯುತ್ತರವಾಗಿ: %s','Once Weekly'=>'ವಾರಕ್ಕೊಮ್ಮೆ','Original image:'=>'ಮೂಲ ಚಿತ್ರ:','The "%1$s" taxonomy "%2$s" property (%3$s) conflicts with an existing property on the REST API Posts Controller. Specify a custom "rest_base" when registering the taxonomy to avoid this error.'=>'"%1$s" ಟ್ಯಾಕ್ಸಾನಮಿ "%2$s" ಆಸ್ತಿ (%3$s) ಉಳಿದ ಎಪಿಐ ಪೋಸ್ಟ್ಗಳ ನಿಯಂತ್ರಕದಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಆಸ್ತಿಯೊಂದಿಗೆ ಸಂಘರ್ಷಿಸುತ್ತದೆ. ಈ ದೋಷವನ್ನು ತಪ್ಪಿಸಲು ಟ್ಯಾಕ್ಸಾನಮಿಯನ್ನು ನೋಂದಾಯಿಸುವಾಗ "rest_base" ಕಸ್ಟಮ್ ಅನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಿ.','When registering an "array" setting to show in the REST API, you must specify the schema for each array item in "show_in_rest.schema.items".'=>'REST API ನಲ್ಲಿ ತೋರಿಸಲು "ಅರೇ" ಸೆಟ್ಟಿಂಗ್ ಅನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ನೀವು "show_in_rest.schema.items" ನಲ್ಲಿ ಪ್ರತಿ ಅರೇ ಐಟಂನ ಸ್ಕೀಮಾವನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಬೇಕು.','Previous and next months'=>'ಹಿಂದಿನ ಮತ್ತು ಮುಂದಿನ ತಿಂಗಳುಗಳು','In reply to %s.'=>'%s ಗೆ ಪ್ರತ್ಯುತ್ತರವಾಗಿ.','Small'=>'‍ಸಣ್ಣ','Select poster image'=>'ಪೋಸ್ಟರ್ ಚಿತ್ರವನ್ನು ಆಯ್ಕೆ ಮಾಡಿ','Sorry, the post could not be updated.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗಲಿಲ್ಲ.','Sorry, the post could not be deleted.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಅನ್ನು ಅಳಿಸಲಾಗಲಿಲ್ಲ.','Sorry, the category could not be created.'=>'ಕ್ಷಮಿಸಿ, ವರ್ಗವನ್ನು ರಚಿಸಲಾಗಲಿಲ್ಲ.','Namespace must not start or end with a slash.'=>'ನೇಮ್‌ಸ್ಪೇಸ್ ಸ್ಲಾಶ್‌ನೊಂದಿಗೆ ಆರಂಭವಾಗಬಾರದು ಅಥವಾ ಕೊನೆಗೊಳ್ಳಬಾರದು.','Password protected'=>'ಪಾಸ್ವರ್ಡ್ ರಕ್ಷಿಸಲಾಗಿದೆ','This image cannot be displayed in a web browser. For best results convert it to JPEG before uploading.'=>'ಈ ಚಿತ್ರವನ್ನು ವೆಬ್ ಬ್ರೌಸರ್‌ನಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಉತ್ತಮ ಫಲಿತಾಂಶಗಳಿಗಾಗಿ ಅದನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಮೊದಲು JPEGಗೆ ಪರಿವರ್ತಿಸಿ.','When registering a default meta value the data must match the type provided.'=>'ಡೀಫಾಲ್ಟ್ ಮೆಟಾ ಮೌಲ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ ಡೇಟಾವು ಒದಗಿಸಿದ ಪ್ರಕಾರಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗಬೇಕು.','Block name.'=>'ಬ್ಲಾಕ್ ಹೆಸರು. ','Sorry, you are not allowed to manage block types.'=>'ಕ್ಷಮಿಸಿ, ಬ್ಲಾಕ್ ಪ್ರಕಾರಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Invalid block type.'=>'ಅಮಾನ್ಯ ಬ್ಲಾಕ್ ಪ್ರಕಾರ.','Title of block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ಶೀರ್ಷಿಕೆ.','Unique name identifying the block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರವನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಹೆಸರು.','Description of block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ವಿವರಣೆ.','Icon of block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ಐಕಾನ್.','Block attributes.'=>'ಬ್ಲಾಕ್ ಗುಣಲಕ್ಷಣಗಳು.','Context provided by blocks of this type.'=>'ಈ ರೀತಿಯ ಬ್ಲಾಕ್‌ಗಳಿಂದ ಒದಗಿಸಲಾದ ಸಂದರ್ಭ.','Context values inherited by blocks of this type.'=>'ಈ ರೀತಿಯ ಬ್ಲಾಕ್‌ಗಳಿಂದ ಆನುವಂಶಿಕವಾಗಿ ಪಡೆದ ಸನ್ನಿವೇಶ ಮೌಲ್ಯಗಳು.','Block supports.'=>'ಬ್ಲಾಕ್ ಬೆಂಬಲಿಸುತ್ತದೆ.','Block category.'=>'ಬ್ಲಾಕ್ ವರ್ಗ.','Is the block dynamically rendered.'=>'ಬ್ಲಾಕ್ ಕ್ರಿಯಾತ್ಮಕವಾಗಿ ನಿರೂಪಿಸಲಾಗಿದೆಯೇ.','Block style variations.'=>'ಬ್ಲಾಕ್ ಶೈಲಿಯ ವ್ಯತ್ಯಾಸಗಳು.','Unique name identifying the style.'=>'ಶೈಲಿಯನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಹೆಸರು.','The human-readable label for the style.'=>'ಶೈಲಿಗೆ ಮಾನವ-ಓದಬಲ್ಲ ಲೇಬಲ್.','Inline CSS code that registers the CSS class required for the style.'=>'ಶೈಲಿಗೆ ಅಗತ್ಯವಿರುವ CSS ವರ್ಗವನ್ನು ನೋಂದಾಯಿಸುವ ಇನ್ಲೈನ್ ​​CSS ಕೋಡ್.','Contains the handle that defines the block style.'=>'ಬ್ಲಾಕ್ ಶೈಲಿಯನ್ನು ವ್ಯಾಖ್ಯಾನಿಸುವ ಹ್ಯಾಂಡಲ್ ಅನ್ನು ಒಳಗೊಂಡಿದೆ.','Public text domain.'=>'ಸಾರ್ವಜನಿಕ ಪಠ್ಯ ಡೊಮೇನ್.','Parent blocks.'=>'ಪೋಷಕ ಬ್ಲಾಕ್ಗಳು.','Block keywords.'=>'ಬ್ಲಾಕ್ ಕೀವರ್ಡ್‌ಗಳು.','Block example.'=>'ಬ್ಲಾಕ್ ಉದಾಹರಣೆ.','The attributes used in the example.'=>'ಉದಾಹರಣೆಯಲ್ಲಿ ಬಳಸಿದ ಗುಣಲಕ್ಷಣಗಳು.','The list of inner blocks used in the example.'=>'ಉದಾಹರಣೆಯಲ್ಲಿ ಬಳಸಲಾದ ಒಳ ಬ್ಲಾಕ್‌ಗಳ ಪಟ್ಟಿ.','The name of the inner block.'=>'ಒಳ ಬ್ಲಾಕ್ ಹೆಸರು.','The attributes of the inner block.'=>'ಆಂತರಿಕ ಬ್ಲಾಕ್ನ ಗುಣಲಕ್ಷಣಗಳು.','A list of the inner block\'s own inner blocks. This is a recursive definition following the parent innerBlocks schema.'=>'ಒಳ ಬ್ಲಾಕ್‌ನ ಸ್ವಂತ ಒಳ ಬ್ಲಾಕ್‌ಗಳ ಪಟ್ಟಿ. ಇದು ಮೂಲ ಇನ್‌ರ್‌ಬ್ಲಾಕ್ಸ್ ಸ್ಕೀಮಾವನ್ನು ಅನುಸರಿಸಿ ಮರುಕಳಿಸುವ ವ್ಯಾಖ್ಯಾನವಾಗಿದೆ.','Block namespace.'=>'ಬ್ಲಾಕ್ ನೇಮ್ ಸ್ಪೇಸ್.','The theme\'s stylesheet. This uniquely identifies the theme.'=>'ಥೀಮ್‌ನ ಸ್ಟೈಲ್‌ಶೀಟ್. ಇದು ಅನನ್ಯವಾಗಿ ಥೀಮ್ ಅನ್ನು ಗುರುತಿಸುತ್ತದೆ.','The theme\'s template. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet.'=>'ಥೀಮ್ ಟೆಂಪ್ಲೇಟ್. ಇದು ಚೈಲ್ಡ್ ಥೀಮ್ ಆಗಿದ್ದರೆ, ಇದು ಪೋಷಕ ಥೀಮ್ ಅನ್ನು ಸೂಚಿಸುತ್ತದೆ, ಇಲ್ಲದಿದ್ದರೆ ಇದು ಥೀಮ್‌ನ ಸ್ಟೈಲ್‌ಶೀಟ್‌ನಂತೆಯೇ ಇರುತ್ತದೆ.','The theme author.'=>'ಥೀಮ್ ಲೇಖಕ.','The theme author\'s name, as found in the theme header.'=>'ಥೀಮ್ ಲೇಖಕರ ಹೆಸರು, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','HTML for the theme author, transformed for display.'=>'ಥೀಮ್ ಲೇಖಕರಿಗಾಗಿ HTML, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The website of the theme author.'=>'ಥೀಮ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್.','The website of the theme author, as found in the theme header.'=>'ಥೀಮ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','The website of the theme author, transformed for display.'=>'ಥೀಮ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','A description of the theme.'=>'ಥೀಮ್‌ನ ವಿವರಣೆ.','The theme description, as found in the theme header.'=>'ಥೀಮ್ ವಿವರಣೆ, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','The theme description, transformed for display.'=>'ಥೀಮ್ ವಿವರಣೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The name of the theme.'=>'ಥೀಮ್ ಹೆಸರು.','The theme name, as found in the theme header.'=>'ಥೀಮ್ ಹೆಸರು, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','The theme name, transformed for display.'=>'ಥೀಮ್ ಹೆಸರು, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The minimum PHP version required for the theme to work.'=>'ಥೀಮ್ ಕೆಲಸ ಮಾಡಲು ಅಗತ್ಯವಿರುವ ಕನಿಷ್ಠ PHP ಆವೃತ್ತಿ.','The minimum WordPress version required for the theme to work.'=>'ಥೀಮ್ ಕೆಲಸ ಮಾಡಲು ಅಗತ್ಯವಿರುವ ಕನಿಷ್ಠ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ.','The theme\'s screenshot URL.'=>'ಥೀಮ್‌ನ ಸ್ಕ್ರೀನ್‌ಶಾಟ್ URL.','Tags indicating styles and features of the theme.'=>'ಥೀಮ್‌ನ ಶೈಲಿಗಳು ಮತ್ತು ವೈಶಿಷ್ಟ್ಯಗಳನ್ನು ಸೂಚಿಸುವ ಟ್ಯಾಗ್‌ಗಳು.','The theme tags, as found in the theme header.'=>'ಥೀಮ್ ಟ್ಯಾಗ್‌ಗಳು, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','The theme tags, transformed for display.'=>'ಥೀಮ್ ಟ್ಯಾಗ್‌ಗಳು, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿವೆ.','The theme\'s text domain.'=>'ಥೀಮ್ನ ಪಠ್ಯ ಡೊಮೇನ್.','The URI of the theme\'s webpage.'=>'ಥೀಮ್‌ನ ವೆಬ್‌ಪುಟದ URI.','The URI of the theme\'s webpage, as found in the theme header.'=>'ಥೀಮ್ ವೆಬ್‌ಪುಟದ URI, ಥೀಮ್ ಶಿರೋಲೇಖದಲ್ಲಿ ಕಂಡುಬಂದಂತೆ.','The URI of the theme\'s webpage, transformed for display.'=>'ಥೀಮ್‌ನ ವೆಬ್‌ಪುಟದ URI, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The theme\'s current version.'=>'ಥೀಮ್‌ನ ಪ್ರಸ್ತುತ ಆವೃತ್ತಿ.','WordPress.org plugin directory slug.'=>'WordPress.org ಪ್ಲಗಿನ್ ಡೈರೆಕ್ಟರಿ ಸ್ಲಗ್.','The plugin activation status.'=>'ಪ್ಲಗಿನ್ ಸಕ್ರಿಯಗೊಳಿಸುವ ಸ್ಥಿತಿ.','Sorry, you are not allowed to manage plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ಗಾಗಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Plugin not found.'=>'ಪ್ಲಗಿನ್ ಕಂಡುಬಂದಿಲ್ಲ.','Sorry, you are not allowed to install plugins on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to activate plugins.'=>'ಕ್ಷಮಿಸಿ, ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Unable to connect to the filesystem. Please confirm your credentials.'=>'ಕಡತ ವ್ಯವಸ್ಥೆಗೆ ಸಂಪರ್ಕಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ರುಜುವಾತುಗಳನ್ನು ದೃಡೀಕರಿಸಿ.','Unable to determine what plugin was installed.'=>'ಯಾವ ಪ್ಲಗಿನ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿದೆ ಎಂಬುದನ್ನು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Sorry, you are not allowed to delete plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ಗಾಗಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Cannot delete an active plugin. Please deactivate it first.'=>'ಸಕ್ರಿಯ ಪ್ಲಗಿನ್ ಅನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ದಯವಿಟ್ಟು ಮೊದಲು ಅದನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ.','Sorry, you are not allowed to deactivate this plugin.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Network only plugin must be network activated.'=>'ನೆಟ್‌ವರ್ಕ್ ಮಾತ್ರ ಪ್ಲಗಿನ್ ಅನ್ನು ನೆಟ್‌ವರ್ಕ್ ಸಕ್ರಿಯಗೊಳಿಸಬೇಕು.','The filesystem is currently unavailable for managing plugins.'=>'ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ಫೈಲ್‌ಸಿಸ್ಟಮ್ ಪ್ರಸ್ತುತ ಲಭ್ಯವಿಲ್ಲ.','The plugin file.'=>'ಪ್ಲಗಿನ್ ಫೈಲ್.','The plugin name.'=>'ಪ್ಲಗಿನ್ ಹೆಸರು.','The plugin\'s website address.'=>'ಪ್ಲಗಿನ್‌ನ ವೆಬ್‌ಸೈಟ್ ವಿಳಾಸ.','The plugin author.'=>'ಪ್ಲಗಿನ್ ಲೇಖಕ.','Plugin author\'s website address.'=>'ಪ್ಲಗಿನ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್ ವಿಳಾಸ.','The plugin description.'=>'ಪ್ಲಗಿನ್ ವಿವರಣೆ.','The raw plugin description.'=>'ಕಚ್ಚಾ ಪ್ಲಗಿನ್ ವಿವರಣೆ.','The plugin description formatted for display.'=>'ಪ್ಲಗಿನ್ ವಿವರಣೆಯನ್ನು ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ಫಾರ್ಮ್ಯಾಟ್ ಮಾಡಲಾಗಿದೆ.','The plugin version number.'=>'ಪ್ಲಗಿನ್ ಆವೃತ್ತಿ ಸಂಖ್ಯೆ.','Whether the plugin can only be activated network-wide.'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ನೆಟ್ವರ್ಕ್-ವ್ಯಾಪಕವಾಗಿ ಮಾತ್ರ ಸಕ್ರಿಯಗೊಳಿಸಬಹುದೇ.','Minimum required version of WordPress.'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ಕನಿಷ್ಠ ಅಗತ್ಯವಿರುವ ಆವೃತ್ತಿ.','Minimum required version of PHP.'=>'PHP ಯ ಕನಿಷ್ಠ ಆವೃತ್ತಿ.','The plugin\'s text domain.'=>'ಪ್ಲಗಿನ್‌ನ ಪಠ್ಯ ಡೊಮೇನ್.','Limits results to plugins with the given status.'=>'ನೀಡಿರುವ ಸ್ಥಿತಿಯೊಂದಿಗೆ ಪ್ಲಗಿನ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಸೀಮಿತಗೊಳಿಸುತ್ತದೆ.','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'ಈ ಬಳಕೆದಾರಹೆಸರು ಅಮಾನ್ಯವಾಗಿದೆ ಏಕೆಂದರೆ ಇದು ಕಾನೂನುಬಾಹಿರ ಅಕ್ಷರಗಳನ್ನು ಬಳಸುತ್ತದೆ. ದಯವಿಟ್ಟು ಮಾನ್ಯವಾದ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ನಮೂದಿಸಿ.','Sorry, you are not allowed to browse the block directory.'=>'ಕ್ಷಮಿಸಿ, ಬ್ಲಾಕ್ ಡೈರೆಕ್ಟರಿಯನ್ನು ಬ್ರೌಸ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The block name, in namespace/block-name format.'=>'ಬ್ಲಾಕ್ ಹೆಸರು, ನೇಮ್‌ಸ್ಪೇಸ್/ಬ್ಲಾಕ್-ನೇಮ್ ಫಾರ್ಮ್ಯಾಟ್‌ನಲ್ಲಿ.','The block title, in human readable format.'=>'ಬ್ಲಾಕ್ ಶೀರ್ಷಿಕೆ, ಮಾನವ ಓದಬಲ್ಲ ರೂಪದಲ್ಲಿ.','A short description of the block, in human readable format.'=>'ಬ್ಲಾಕ್‌ನ ಚಿಕ್ಕ ವಿವರಣೆ, ಮಾನವ ಓದಬಲ್ಲ ರೂಪದಲ್ಲಿ.','The block slug.'=>'ಬ್ಲಾಕ್ ಸ್ಲಗ್.','The star rating of the block.'=>'ಬ್ಲಾಕ್‌ನ ಸ್ಟಾರ್ ರೇಟಿಂಗ್.','The number of ratings.'=>'ರೇಟಿಂಗ್‌ಗಳ ಸಂಖ್ಯೆ.','The number sites that have activated this block.'=>'ಈ ಬ್ಲಾಕ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿದ ಸೈಟ್ಗಳ ಸಂಖ್ಯೆ.','The average rating of blocks published by the same author.'=>'ಅದೇ ಲೇಖಕರು ಪ್ರಕಟಿಸಿದ ಬ್ಲಾಕ್‌ಗಳ ಸರಾಸರಿ ರೇಟಿಂಗ್.','The number of blocks published by the same author.'=>'ಅದೇ ಲೇಖಕರು ಪ್ರಕಟಿಸಿದ ಬ್ಲಾಕ್‌ಗಳ ಸಂಖ್ಯೆ.','The WordPress.org username of the block author.'=>'ಬ್ಲಾಕ್ ಲೇಖಕರ WordPress.org ಬಳಕೆದಾರಹೆಸರು.','The block icon.'=>'ಬ್ಲಾಕ್ ಐಕಾನ್.','The date when the block was last updated, in fuzzy human readable format.'=>'ಬ್ಲಾಕ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ನವೀಕರಿಸಿದ ದಿನಾಂಕ, ಅಸ್ಪಷ್ಟ ಮಾನವ ಓದಬಲ್ಲ ಸ್ವರೂಪದಲ್ಲಿ.','Limit result set to blocks matching the search term.'=>'ಹುಡುಕಾಟ ಪದಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುವ ಬ್ಲಾಕ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Unable to get meta information for file.'=>'ಫೈಲ್‌ಗಾಗಿ ಮೆಟಾ ಮಾಹಿತಿಯನ್ನು ಪಡೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','This type of file cannot be edited.'=>'ಈ ರೀತಿಯ ಫೈಲ್ ಅನ್ನು ಸಂಪಾದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','The image was not edited. Edit the image before applying the changes.'=>'ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಲಾಗಿಲ್ಲ. ಬದಲಾವಣೆಗಳನ್ನು ಅನ್ವಯಿಸುವ ಮೊದಲು ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಿ.','Unable to edit this image.'=>'ಈ ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Unable to rotate this image.'=>'ಈ ಚಿತ್ರವನ್ನು ತಿರುಗಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Unable to crop this image.'=>'ಈ ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ.','URL to the edited image file.'=>'ಸಂಪಾದಿಸಿದ ಇಮೇಜ್ ಫೈಲ್‌ಗೆ URL.','Please consider writing more inclusive code.'=>'ದಯವಿಟ್ಟು ಹೆಚ್ಚು ಅಂತರ್ಗತ ಕೋಡ್ ಬರೆಯುವುದನ್ನು ಪರಿಗಣಿಸಿ.','This notice was triggered by the %s handle.'=>'ಈ ಸೂಚನೆಯು %s ಹ್ಯಾಂಡಲ್‌ನಿಂದ ಪ್ರಚೋದಿಸಲ್ಪಟ್ಟಿದೆ.','The "type" schema keyword for %1$s can only contain the built-in types: %2$l.'=>'%1$s ಗಾಗಿ "ಟೈಪ್" ಸ್ಕೀಮಾ ಕೀವರ್ಡ್ ಅಂತರ್ನಿರ್ಮಿತ ಪ್ರಕಾರಗಳನ್ನು ಮಾತ್ರ ಒಳಗೊಂಡಿರುತ್ತದೆ: %2$l.','Cannot stabilize objects. Convert the object to an array first.'=>'ವಸ್ತುಗಳನ್ನು ಸ್ಥಿರಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ವಸ್ತುವನ್ನು ಮೊದಲು ಅರೇಯಾಗಿ ಪರಿವರ್ತಿಸಿ.','The "type" schema keyword for %s is required.'=>'%s ಗಾಗಿ "ಟೈಪ್" ಸ್ಕೀಮಾ ಕೀವರ್ಡ್ ಅಗತ್ಯವಿದೆ.','The "type" schema keyword for %1$s can only be one of the built-in types: %2$l.'=>'%1$s ಗಾಗಿ "ಟೈಪ್" ಸ್ಕೀಮಾ ಕೀವರ್ಡ್ ಅಂತರ್ನಿರ್ಮಿತ ಪ್ರಕಾರಗಳಲ್ಲಿ ಒಂದಾಗಿರಬಹುದು: %2$l.','%1$s must contain at least %2$s item.'=>'%1$s ಕನಿಷ್ಠ %2$s ಐಟಂ ಅನ್ನು ಹೊಂದಿರಬೇಕು.' . "\0" . '%1$s ಕನಿಷ್ಠ %2$s ಐಟಂಗಳನ್ನು ಹೊಂದಿರಬೇಕು.','%1$s must contain at most %2$s item.'=>'%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಐಟಂ ಅನ್ನು ಹೊಂದಿರಬೇಕು.' . "\0" . '%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಐಟಂಗಳನ್ನು ಹೊಂದಿರಬೇಕು.','%s has duplicate items.'=>'%s ನಕಲಿ ಐಟಂಗಳನ್ನು ಹೊಂದಿದೆ.','%1$s is a required property of %2$s.'=>'%1$s ಎನ್ನುವುದು %2$s ನ ಅಗತ್ಯವಿರುವ ಆಸ್ತಿಯಾಗಿದೆ.','%1$s must be at least %2$s character long.'=>'%1$s ಕನಿಷ್ಠ %2$s ಅಕ್ಷರ ಉದ್ದವಿರಬೇಕು.' . "\0" . '%1$s ಕನಿಷ್ಠ %2$s ಅಕ್ಷರಗಳಷ್ಟು ಉದ್ದವಿರಬೇಕು.','%1$s must be at most %2$s character long.'=>'%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಅಕ್ಷರ ಉದ್ದವಿರಬೇಕು.' . "\0" . '%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಅಕ್ಷರಗಳಷ್ಟು ಉದ್ದವಿರಬೇಕು.','%1$s does not match pattern %2$s.'=>'%1$s %2$s ಮಾದರಿಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','Invalid hex color.'=>'ಅಮಾನ್ಯವಾದ ಹೆಕ್ಸ್ ಬಣ್ಣ.','%s is not a valid UUID.'=>'%s ಮಾನ್ಯ UUID ಅಲ್ಲ.','File URL:'=>'ಫೈಲ್ URL :','Could not update comment in the database.'=>'ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಕಾಮೆಂಟ್ ಅನ್ನು ನವೀಕರಿಸಲು  ಸಾಧ್ಯವಿಲ್ಲ.','Could not insert attachment into the database.'=>'ಲಗತ್ತನ್ನು ಡೇಟಾಬೇಸ್‌ಗೆ ಸೇರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Add media'=>'ಮಾಧ್ಯಮವನ್ನು ಸೇರಿಸಿ','Attachment details'=>'ಲಗತ್ತು ವಿವರಗಳು','<strong>Error:</strong> There was a problem creating site entry.'=>'<strong>ದೋಷ:</strong> ಸೈಟ್ ನಮೂದನ್ನು ರಚಿಸುವಲ್ಲಿ ಸಮಸ್ಯೆ ಕಂಡುಬಂದಿದೆ.','category archive title prefixCategory:'=>'ವರ್ಗ:','tag archive title prefixTag:'=>'ಟ್ಯಾಗ್:','author archive title prefixAuthor:'=>'ಲೇಖಕ:','date archive title prefixYear:'=>'ವರ್ಷ:','date archive title prefixMonth:'=>'ತಿಂಗಳು:','date archive title prefixDay:'=>'ದಿನ:','post type archive title prefixArchives:'=>'ಆರ್ಕೈವ್ಗಳು','taxonomy term archive title prefix%s:'=>'%s:','archive title%1$s %2$s'=>'%1$s %2$s','admin color schemeModern'=>'ಆಧುನಿಕ ','unit symbolTB'=>'TB','unit symbolGB'=>'GB','unit symbolMB'=>'MB','unit symbolKB'=>'KB','unit symbolB'=>'B','Return a %1$s or %2$s object from your callback when using the REST API.'=>'REST API ಬಳಸುವಾಗ ನಿಮ್ಮ ಕಾಲ್‌ಬ್ಯಾಕ್‌ನಿಂದ %1$s ಅಥವಾ %2$s ವಸ್ತುವನ್ನು ಹಿಂತಿರುಗಿಸಿ.','Read the <a href="%s" target="_blank">Debugging a WordPress Network</a> article. Some of the suggestions there may help you figure out what went wrong.'=>'<a href="%s" target="_blank">ವರ್ಡ್ಪ್ರೆಸ್ ನೆಟ್ವರ್ಕ್ ಡೀಬಗ್ ಮಾಡುವುದು</a> ಲೇಖನವನ್ನು ಓದಿ. ಅಲ್ಲಿನ ಕೆಲವು ಸಲಹೆಗಳು ತಪ್ಪಾಗಿರುವುದನ್ನು ಕಂಡುಹಿಡಿಯಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡಬಹುದು.','Embed Handler'=>'ಎಂಬೆಡ್ ಹ್ಯಾಂಡ್ಲರ್','The file URL has been copied to your clipboard'=>'ಫೈಲ್ URL ಅನ್ನು ನಿಮ್ಮ ಕ್ಲಿಪ್‌ಬೋರ್ಡ್‌ಗೆ ನಕಲಿಸಲಾಗಿದೆ','Crop'=>'ಕತ್ತರಿಸಿ','Sorry, you are not allowed to activate this plugin.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Could not update attachment in the database.'=>'ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಲಗತ್ತನ್ನು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','The REST API route definition for %1$s is missing the required %2$s argument. For REST API routes that are intended to be public, use %3$s as the permission callback.'=>'%1$s ಉಳಿದ ಎಪಿಐ ಮಾರ್ಗ ವ್ಯಾಖ್ಯಾನವು ಅಗತ್ಯವಿರುವ %2$s ವಾದವನ್ನು ಕಾಣೆಯಾಗಿದೆ. ಸಾರ್ವಜನಿಕವಾಗಿರಲು ಉದ್ದೇಶಿಸಿರುವ ರೆಸ್ಟ್ ಎಪಿಐ ಮಾರ್ಗಗಳಿಗಾಗಿ, ಅನುಮತಿ ಕಾಲ್ ಬ್ಯಾಕ್ ಆಗಿ %3$s ಬಳಸಿ.','Sorry, you are not allowed to manage network plugins.'=>'ಕ್ಷಮಿಸಿ, ನೆಟ್‌ವರ್ಕ್ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The "%1$s" option key has been renamed to "%2$s".'=>'"%1$s" ಆಯ್ಕೆ ಕೀಲಿಯನ್ನು "%2$s" ಎಂದು ಮರುಹೆಸರಿಸಲಾಗಿದೆ.','Please use %s to add new schema properties.'=>'ಹೊಸ ಸ್ಕೀಮಾ ಗುಣಲಕ್ಷಣಗಳನ್ನು ಸೇರಿಸಲು ದಯವಿಟ್ಟು %s ಬಳಸಿ.','This theme does not work with your versions of WordPress and PHP.'=>'ಈ ಥೀಮ್ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಮತ್ತು PHP ಆವೃತ್ತಿಗಳೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">ದಯವಿಟ್ಟು ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸಿ</a>, ತದನಂತರ <a href="%2$s">PHP ನವೀಕರಿಸುವ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">ದಯವಿಟ್ಟು ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸಿ</a>.','<a href="%s">Learn more about updating PHP</a>.'=>'<a href="%s">PHP ನವೀಕರಿಸುವ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','This theme does not work with your version of WordPress.'=>'ಈ ಥೀಮ್ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','This theme does not work with your version of PHP.'=>'ಈ ಥೀಮ್ ನಿಮ್ಮ PHP ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','There is a new version of %s available, but it does not work with your versions of WordPress and PHP.'=>'%s ನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ, ಆದರೆ ಇದು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಮತ್ತು PHP ಯ ಆವೃತ್ತಿಗಳೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','There is a new version of %s available, but it does not work with your version of WordPress.'=>'%s ನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ, ಆದರೆ ಇದು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','There is a new version of %s available, but it does not work with your version of PHP.'=>'%s ನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ, ಆದರೆ ಇದು ನಿಮ್ಮ PHP ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','The %s constant is no longer supported.'=>'%s ಸ್ಥಿರವನ್ನು ಇನ್ನು ಮುಂದೆ ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Sorry, you are not allowed to comment on this post.'=>'ಈ ಲೇಖನದ ಬಗ್ಗೆ ಪ್ರತಿಕ್ರಿಯೆ ನೀಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The handler for the route is invalid.'=>'ಮಾರ್ಗಕ್ಕಾಗಿ ಹ್ಯಾಂಡ್ಲರ್ ಅಮಾನ್ಯವಾಗಿದೆ.','Could not parse the path.'=>'ಮಾರ್ಗವನ್ನು ಪಾರ್ಸ್ ಮಾಡಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','The requested route does not support batch requests.'=>'ವಿನಂತಿಸಿದ ಮಾರ್ಗವು ಬ್ಯಾಚ್ ವಿನಂತಿಗಳನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Invalid parameters.'=>'ಅಮಾನ್ಯ ಪ್ಯಾರಾಮೀಟರ್ಗಳು.','Version of block API.'=>'ಬ್ಲಾಕ್ API ನ ಆವೃತ್ತಿ.','Directory sizes could not be returned.'=>'ಡೈರೆಕ್ಟರಿ ಗಾತ್ರಗಳನ್ನು ಹಿಂತಿರುಗಿಸಲಾಗಲಿಲ್ಲ.','The name of the test being run.'=>'ಚಾಲನೆಯಲ್ಲಿರುವ ಪರೀಕ್ಷೆಯ ಹೆಸರು.','A label describing the test.'=>'ಪರೀಕ್ಷೆಯನ್ನು ವಿವರಿಸುವ ಲೇಬಲ್.','The status of the test.'=>'ಪರೀಕ್ಷೆಯ ಸ್ಥಿತಿ.','The category this test is grouped in.'=>'ಈ ಪರೀಕ್ಷೆಯನ್ನು ವರ್ಗೀಕರಿಸಿದ ವರ್ಗ.','A more descriptive explanation of what the test looks for, and why it is important for the user.'=>'ಪರೀಕ್ಷೆಯು ಏನು ಹುಡುಕುತ್ತದೆ ಮತ್ತು ಬಳಕೆದಾರರಿಗೆ ಅದು ಏಕೆ ಮುಖ್ಯವಾಗಿದೆ ಎಂಬುದರ ಕುರಿತು ಹೆಚ್ಚು ವಿವರಣಾತ್ಮಕ ವಿವರಣೆ.','HTML containing an action to direct the user to where they can resolve the issue.'=>'HTML ಬಳಕೆದಾರನಿಗೆ ಸಮಸ್ಯೆಯನ್ನು ಎಲ್ಲಿ ಪರಿಹರಿಸಬಹುದು ಎಂದು ನಿರ್ದೇಶಿಸುವ ಕ್ರಿಯೆಯನ್ನು ಒಳಗೊಂಡಿದೆ.','Sorry, you are not allowed to manage application passwords for this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಿಗಾಗಿ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Application passwords are not available.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು ಲಭ್ಯವಿಲ್ಲ.','Application passwords are not available for your account. Please contact the site administrator for assistance.'=>'ನಿಮ್ಮ ಖಾತೆಗೆ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು ಲಭ್ಯವಿಲ್ಲ. ಸಹಾಯಕ್ಕಾಗಿ ದಯವಿಟ್ಟು ಸೈಟ್ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','Application password not found.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಸಿಗಲಿಲ್ಲ.','The unique identifier for the application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಾಗಿ ಅನನ್ಯ ಗುರುತಿಸುವಿಕೆ.','A UUID provided by the application to uniquely identify it. It is recommended to use an UUID v5 with the URL or DNS namespace.'=>'ಅನನ್ಯವಾಗಿ ಗುರುತಿಸಲು ಅಪ್ಲಿಕೇಶನ್‌ನಿಂದ ಒದಗಿಸಲಾದ UUID. URL ಅಥವಾ DNS ನೇಮ್‌ಸ್ಪೇಸ್‌ನೊಂದಿಗೆ UUID v5 ಅನ್ನು ಬಳಸಲು ಶಿಫಾರಸು ಮಾಡಲಾಗಿದೆ.','The name of the application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ವರ್ಡ್ ಹೆಸರು.','The generated password. Only available after adding an application.'=>'ರಚಿಸಿದ ಪಾಸ್ವರ್ಡ್. ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಸೇರಿಸಿದ ನಂತರ ಮಾತ್ರ ಲಭ್ಯವಿದೆ.','The GMT date the application password was created.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ರಚಿಸಿದ GMT ದಿನಾಂಕ.','The GMT date the application password was last used.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಬಳಸಿದ GMT ದಿನಾಂಕ.','The IP address the application password was last used by.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಬಳಸಿದ IP ವಿಳಾಸ.','%1$s is not a valid %2$s. Reason: %3$s'=>'%1$s ಮಾನ್ಯವಾದ %2$s ಅಲ್ಲ. ಕಾರಣ: %3$s','%1$s does not match the expected format. Reason: %2$s'=>'%1$s ನಿರೀಕ್ಷಿತ ಸ್ವರೂಪಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುತ್ತಿಲ್ಲ. ಕಾರಣ: %2$s','%1$s is not a valid %2$l.'=>'%1$s ಮಾನ್ಯ %2$l ಅಲ್ಲ.','%s does not match any of the expected formats.'=>'%s ಯಾವುದೇ ನಿರೀಕ್ಷಿತ ಸ್ವರೂಪಗಳಿಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','%1$s matches %2$l, but should match only one.'=>'%1$s %2$l ಗೆ ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ, ಆದರೆ ಒಂದಕ್ಕೆ ಮಾತ್ರ ಹೊಂದಿಕೆಯಾಗಬೇಕು.','%s matches more than one of the expected formats.'=>'%s ನಿರೀಕ್ಷಿತ ಸ್ವರೂಪಗಳಲ್ಲಿ ಒಂದಕ್ಕಿಂತ ಹೆಚ್ಚು ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ.','%1$s must contain at least %2$s property.'=>'%1$s ಕನಿಷ್ಠ %2$s ಪ್ರಾಪರ್ಟಿಗಳನ್ನು ಹೊಂದಿರಬೇಕು.' . "\0" . '%1$s ಕನಿಷ್ಠ %2$s ಗು