ೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit this application password.'=>'ಕ್ಷಮಿಸಿ, ಈ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to delete application passwords for this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಿಗಾಗಿ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to delete this application password.'=>'ಕ್ಷಮಿಸಿ, ಈ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The authenticated application password can only be introspected for the current user.'=>'ದೃಢೀಕರಿಸಿದ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಪ್ರಸ್ತುತ ಬಳಕೆದಾರನಿಗೆ ಮಾತ್ರ ಆತ್ಮಾವಲೋಕನ ಮಾಡಿಕೊಳ್ಳಬಹುದು.','Cannot introspect application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಆತ್ಮಾವಲೋಕನ ಮಾಡಲಾಗುವುದಿಲ್ಲ','Array of image edits.'=>'ಚಿತ್ರ ಸಂಪಾದನೆಗಳ ಅರೇ.','Image edit.'=>'ಚಿತ್ರ ಸಂಪಾದನೆ.','Rotation'=>'ಸುತ್ತುವಿಕೆ ','Rotation type.'=>'ತಿರುಗುವಿಕೆಯ ಪ್ರಕಾರ.','Rotation arguments.'=>'ತಿರುಗುವಿಕೆ ವಾದಗಳು.','Angle to rotate clockwise in degrees.'=>'ಡಿಗ್ರಿಗಳಲ್ಲಿ ಪ್ರದಕ್ಷಿಣಾಕಾರವಾಗಿ ತಿರುಗಲು ಕೋನ.','Crop type.'=>'ಕ್ರಾಪ್ ಪ್ರಕಾರ.','Crop arguments.'=>'ಕ್ರಾಪ್ ವಾದಗಳು.','Horizontal position from the left to begin the crop as a percentage of the image width.'=>'ಚಿತ್ರದ ಅಗಲದ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಮಾಡಲು ಎಡದಿಂದ ಅಡ್ಡ ಸ್ಥಾನ.','Vertical position from the top to begin the crop as a percentage of the image height.'=>'ಚಿತ್ರದ ಎತ್ತರದ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಪ್ರಾರಂಭಿಸಲು ಮೇಲಿನಿಂದ ಲಂಬವಾದ ಸ್ಥಾನ.','Width of the crop as a percentage of the image width.'=>'ಚಿತ್ರದ ಅಗಲದ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಅಗಲ.','Height of the crop as a percentage of the image height.'=>'ಚಿತ್ರದ ಎತ್ತರಕ್ಕೆ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಎತ್ತರ.','The amount to rotate the image clockwise in degrees. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರವನ್ನು ಪ್ರದಕ್ಷಿಣಾಕಾರವಾಗಿ ಡಿಗ್ರಿಗಳಲ್ಲಿ ತಿರುಗಿಸುವ ಮೊತ್ತ. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','As a percentage of the image, the x position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, ಕ್ರಾಪ್ ಆರಂಭಿಸಲು x ಸ್ಥಾನ. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','As a percentage of the image, the y position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, y ಸ್ಥಾನದಿಂದ ಕ್ರಾಪ್ ಆರಂಭಿಸಲು. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ`ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','As a percentage of the image, the width to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, ಅಗಲವು ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ','As a percentage of the image, the height to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು ಎತ್ತರ. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','Event timestamp must be a valid Unix timestamp.'=>'ಈವೆಂಟ್ ಟೈಮ್‌ಸ್ಟ್ಯಾಂಪ್ ಮಾನ್ಯ Unix ಟೈಮ್‌ಸ್ಟ್ಯಾಂಪ್ ಆಗಿರಬೇಕು.','A plugin prevented the event from being scheduled.'=>'ಒಂದು ಪ್ಲಗಿನ್ ಈವೆಂಟ್ ಅನ್ನು ನಿಗದಿಯಾಗದಂತೆ ತಡೆಯುತ್ತದೆ.','A duplicate event already exists.'=>'ನಕಲಿ ಈವೆಂಟ್ ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','A plugin disallowed this event.'=>'ಒಂದು ಪ್ಲಗಿನ್ ಈ ಈವೆಂಟ್ ಅನ್ನು ಅನುಮತಿಸಲಿಲ್ಲ.','Event schedule does not exist.'=>'ಈವೆಂಟ್ ವೇಳಾಪಟ್ಟಿ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','A plugin prevented the event from being rescheduled.'=>'ಒಂದು ಪ್ಲಗಿನ್ ಈವೆಂಟ್ ಅನ್ನು ಮರುಹೊಂದಿಸದಂತೆ ತಡೆಯಿತು.','A plugin prevented the event from being unscheduled.'=>'ಒಂದು ಪ್ಲಗಿನ್ ಈವೆಂಟ್ ಅನ್ನು ನಿಗದಿಯಾಗದಂತೆ ತಡೆಯಿತು.','A plugin prevented the hook from being cleared.'=>'ಒಂದು ಪ್ಲಗಿನ್ ಹುಕ್ ಅನ್ನು ತೆರವುಗೊಳಿಸುವುದನ್ನು ತಡೆಯಿತು.','The cron event list could not be saved.'=>'ಕ್ರಾನ್ ಈವೆಂಟ್ ಪಟ್ಟಿಯನ್ನು ಉಳಿಸಲಾಗಲಿಲ್ಲ.','%1$s is not %2$s.'=>'%1$s %2$s ಅಲ್ಲ.','%1$s is not one of %2$l.'=>'%1$s %2$l ನಲ್ಲಿ ಒಂದಲ್ಲ.','It looks like the response did not come from this site.'=>'ಈ ಸೈಟ್‌ನಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಬಂದಿಲ್ಲ ಎಂದು ತೋರುತ್ತಿದೆ.','https://wordpress.org/support/article/faq-troubleshooting/'=>'https://wordpress.org/support/article/faq-troubleshooting/','Learn more about troubleshooting WordPress.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ದೋಷನಿವಾರಣೆ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ.','https://wordpress.org/support/article/why-should-i-use-https/'=>'https://wordpress.org/support/article/why-should-i-use-https/','Filter by category'=>'ವರ್ಗದ ಪ್ರಕಾರ ಫಿಲ್ಟರ್ 