.','Indicates whether the current variation is the default one.'=>'ಪ್ರಸ್ತುತ ವ್ಯತ್ಯಾಸವು ಡೀಫಾಲ್ಟ್ ನದಾಗಿದೆಯೇ ಎಂದು ಸೂಚಿಸುತ್ತದೆ.','The initial values for attributes.'=>'ಗುಣಲಕ್ಷಣಗಳಿಗಾಗಿ ಆರಂಭಿಕ ಮೌಲ್ಯಗಳು.','The list of scopes where the variation is applicable. When not provided, it assumes all available scopes.'=>'ವ್ಯತ್ಯಾಸವು ಅನ್ವಯವಾಗುವ ವ್ಯಾಪ್ತಿಯ ಪಟ್ಟಿ. ಒದಗಿಸದಿದ್ದಾಗ, ಇದು ಲಭ್ಯವಿರುವ ಎಲ್ಲ ವ್ಯಾಪ್ತಿಯನ್ನು ಊಹಿಸುತ್ತದೆ.','Unique identifier for the comment.'=>'ಕಾಮೆಂಟ್‌ಗಾಗಿ ಅನನ್ಯ ಗುರುತಿಸುವಿಕೆ.','URL to the comment.'=>'ಕಾಮೆಂಟ್‌ಗೆ URL','Type of the comment.'=>'ಕಾಮೆಂಟ್ ನ ಪ್ರಕಾರ.','Sort collection by comment attribute.'=>'ಕಾಮೆಂಟ್ ಗುಣಲಕ್ಷಣದ ಮೂಲಕ ಸಂಗ್ರಹವನ್ನು ವಿಂಗಡಿಸಿ.','Sorry, you are not allowed to browse the local block pattern directory.'=>'ಕ್ಷಮಿಸಿ, ಸ್ಥಳೀಯ ಬ್ಲಾಕ್ ಪ್ಯಾಟರ್ನ್ ಡೈರೆಕ್ಟರಿಯನ್ನು ಬ್ರೌಸ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The pattern ID.'=>'ಪ್ಯಾಟರ್ನ್ ಐಡಿ.','The pattern title, in human readable format.'=>'ಮಾದರಿಯ ಶೀರ್ಷಿಕೆ, ಮಾನವ ಓದಬಲ್ಲ ರೂಪದಲ್ಲಿ.','The pattern content.'=>'ಮಾದರಿಯ ವಿಷಯ.','The pattern\'s category slugs.'=>'ಮಾದರಿಯ ವರ್ಗದ ಸ್ಲಗ್ಗಳು.','The pattern\'s keywords.'=>'ಮಾದರಿಯ ಕೀವರ್ಡ್‌ಗಳು.','A description of the pattern.'=>'ಮಾದರಿಯ ವಿವರಣೆ','The preferred width of the viewport when previewing a pattern, in pixels.'=>'ಮಾದರಿಯನ್ನು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡುವಾಗ ವೀಕ್ಷಣಾ ಪೋರ್ಟ್‌ನ ಆದ್ಯತೆಯ ಅಗಲ, ಪಿಕ್ಸೆಲ್‌ಗಳಲ್ಲಿ.','Limit results to those matching a category ID.'=>'ವರ್ಗದ ID ಗೆ ಹೊಂದುವವರಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit results to those matching a keyword ID.'=>'ಕೀವರ್ಡ್ ID ಗೆ ಹೊಂದುವವರಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Unique identifier for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','URL to the post.'=>'ಪೋಸ್ಟ್‌ಗೆ URL','Type of post.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರ.','The title for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಶೀರ್ಷಿಕೆ.','The order of the post in relation to other posts.'=>'ಇತರ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಪೋಸ್ಟ್‌ನ ಪಾಳಿ.','Sort collection by post attribute.'=>'ಪೋಸ್ಟ್ ಗುಣಲಕ್ಷಣದ ಮೂಲಕ ಸಂಗ್ರಹವನ್ನು ವಿಂಗಡಿಸಿ.','Whether items must be assigned all or any of the specified terms.'=>'ಐಟಂಗಳನ್ನು ಎಲ್ಲವೂ ಅಥವಾ ಯಾವುದೇ ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ನಿಯಮಗಳಿಗೆ ಮಾತ್ರ ನಿಯೋಜಿಸಬೇಕೆ.','Unique identifier for the revision.'=>'ಪರಿಷ್ಕರಣೆಗಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The ID for the author of the revision.'=>'ಪರಿಷ್ಕರಣೆಯ ಲೇಖಕರಿಗೆ ID','The id of a registered sidebar'=>'ನೋಂದಾಯಿತ ಸೈಡ್‌ಬಾರ್‌ನ ಐಡಿ','No sidebar exists with that id.'=>'ಆ ಐಡಿಯೊಂದಿಗೆ ಯಾವುದೇ ಸೈಡ್‌ಬಾರ್ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Sorry, you are not allowed to manage widgets on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ವಿಜೆಟ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','ID of sidebar.'=>'ಸೈಡ್‌ಬಾರ್‌ನ ID.','Unique name identifying the sidebar.'=>'ಸೈಡ್‌ಬಾರ್ ಅನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಹೆಸರು.','Description of sidebar.'=>'ಸೈಡ್‌ಬಾರ್‌ನ ವಿವರಣೆ.','Extra CSS class to assign to the sidebar in the Widgets interface.'=>'ವಿಜೆಟ್‌ಗಳ ಇಂಟರ್‌ಫೇಸ್‌ನಲ್ಲಿ ಸೈಡ್‌ಬಾರ್‌ಗೆ ನಿಯೋಜಿಸಲು ಹೆಚ್ಚುವರಿ CSS ವರ್ಗ.','HTML content to prepend to each widget\'s HTML output when assigned to this sidebar. Default is an opening list item element.'=>'ಈ ಸೈಡ್‌ಬಾರ್‌ಗೆ ನಿಯೋಜಿಸಿದಾಗ ಪ್ರತಿ ವಿಜೆಟ್‌ನ HTML ಔಟ್‌ಪುಟ್‌ಗೆ ಪೂರ್ವಭಾವಿಯಾಗಿ HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಆರಂಭಿಕ ಪಟ್ಟಿ ಐಟಂ ಅಂಶವಾಗಿದೆ.','HTML content to append to each widget\'s HTML output when assigned to this sidebar. Default is a closing list item element.'=>'ಈ ಸೈಡ್‌ಬಾರ್‌ಗೆ ನಿಯೋಜಿಸಿದಾಗ ಪ್ರತಿ ವಿಜೆಟ್‌ನ HTML ಔಟ್‌ಪುಟ್‌ಗೆ ಸೇರಿಸಲು HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಮುಚ್ಚುವ ಪಟ್ಟಿ ಐಟಂ ಅಂಶವಾಗಿದೆ.','HTML content to prepend to the sidebar title when displayed. Default is an opening h2 element.'=>'ಪ್ರದರ್ಶಿಸಿದಾಗ ಸೈಡ್‌ಬಾರ್ ಶೀರ್ಷಿಕೆಗೆ ಅನುಗುಣವಾಗಿ HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಆರಂಭಿಕ h2 ಅಂಶವಾಗಿದೆ.','HTML content to append to the sidebar title when displayed. Default is a closing h2 element.'=>'ಪ್ರದರ್ಶಿಸಿದಾಗ ಸೈಡ್‌ಬಾರ್ ಶೀರ್ಷಿಕೆಗೆ ಸೇರಿಸಲು HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಮುಚ್ಚುವ h2 ಅಂಶವಾಗಿದೆ.','Status of sidebar.'=>'ಸೈಡ್‌ಬಾರ್‌ನ ಸ್ಥಿತಿ.','Nested widgets.'=>'ನೆಸ್ಟೆಡ್ ವಿಜೆಟ್‌ಗಳು.','The id of a template'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ಐಡಿ','Sorry, you are not allowed to access the templates on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','No templates exist with that id.'=>'ಆ ಐಡಿಯೊಂದಿಗೆ ಯಾವುದೇ ಟೆಂಪ್ಲೇಟ್‌ಗಳು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Templates based on theme files can\'t be removed.'=>'ಥೀಮ್ ಫೈಲ್‌ಗಳನ್ನು ಆಧರಿಸಿದ ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು ತೆಗೆದುಹಾಕಲಾಗುವುದಿಲ್ಲ.','The template has already been deleted.'=>'ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಅಳಿಸಲಾಗಿದೆ.','Limit to the specified post id.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಪೋಸ್ಟ್ ಐಡಿಗೆ ಮಿತಿಗೊಳಿಸಿ.','ID of template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ID.','Unique slug identifying the template.'=>'ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಸ್ಲಗ್.','Theme identifier for the template.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ ಥೀಮ್ ಗುರುತಿಸುವಿಕೆ.','Source of template'=>'ಟೆಂಪ್ಲೇಟ್ ಮೂಲ','Content of template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ವಿಷಯ.','Title of template.'=>'ಟೆಂಪ್ಲೇಟ್ ಶೀರ್ಷಿಕೆ.','Description of template.'=>'ಟೆಂಪ್ಲೇಟ್ ವಿವರಣೆ.','Status of template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ಸ್ಥಿತಿ.','Post ID.'=>'ಪೋಸ್ಟ್ ಐಡಿ.','Theme file exists.'=>'ಥೀಮ್ ಫೈಲ್ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','Sort collection by user attribute.'=>'ಬಳಕೆದಾರ ಗುಣಲಕ್ಷಣದಿಂದ ಸಂಗ್ರಹವನ್ನು ವಿಂಗಡಿಸಿ.','The widget type id.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರದ ಐಡಿ.','Current instance settings of the widget.'=>'ವಿಜೆಟ್‌ನ ಪ್ರಸ್ತುತ ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್‌ಗಳು.','Serialized widget form data to encode into instance settings.'=>'ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ಎನ್ಕೋಡ್ ಮಾಡಲು ಸರಣಿಗೊಳಿಸಿದ ವಿಜೆಟ್ ಫಾರ್ಮ್ ಡೇಟಾ.','Invalid widget type.'=>'ಅಮಾನ್ಯವಾದ ವಿಜೆಟ್ ಪ್ರಕಾರ.','Unique slug identifying the widget type.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರವನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಸ್ಲಗ್.','Human-readable name identifying the widget type.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರವನ್ನು ಗುರುತಿಸುವ ಮಾನವ-ಓದಬಲ್ಲ ಹೆಸರು.','Description of the widget.'=>'ವಿಜೆಟ್ ವಿವರಣೆ.','Whether the widget supports multiple instances'=>'ವಿಜೆಟ್ ಬಹು ನಿದರ್ಶನಗಳನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆಯೇ','Class name'=>'ಕ್ಲಾಸ್ ನ ಹೆಸರು ','Cannot preview a widget that does not extend WP_Widget.'=>'WP_Widget ಅನ್ನು ವಿಸ್ತರಿಸದ ವಿಜೆಟ್ ಅನ್ನು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ.','The provided instance is malformed.'=>'ಒದಗಿಸಿದ ಉದಾಹರಣೆಯು ತಪ್ಪಾಗಿದೆ.','Whether to force removal of the widget, or move it to the inactive sidebar.'=>'ವಿಜೆಟ್ ಅನ್ನು ತೆಗೆದುಹಾಕಲು ಒತ್ತಾಯಿಸಬೇಕೇ ಅಥವಾ ನಿಷ್ಕ್ರಿಯ ಸೈಡ್‌ಬಾರ್‌ಗೆ ಸರಿಸಬೇಕೆ.','No widget was found with that id.'=>'ಆ ಐಡಿಯೊಂದಿಗೆ ಯಾವುದೇ ವಿಜೆಟ್ ಕಂಡುಬಂದಿಲ್ಲ.','Widget type (id_base) is required.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರ (id_base) ಅಗತ್ಯವಿದೆ.','The provided widget type (id_base) cannot be updated.'=>'ಒದಗಿಸಿದ ವಿಜೆಟ್ ಪ್ರಕಾರವನ್ನು (id_base) ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ.','Cannot set instance on a widget that does not extend WP_Widget.'=>'WP_Widget ಅನ್ನು ವಿಸ್ತರಿಸದ ವಿಜೆಟ್‌ನಲ್ಲಿ ನಿದರ್ಶನವನ್ನು ಹೊಂದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Widget type does not support raw instances.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರವು ಕಚ್ಚಾ ನಿದರ್ಶನಗಳನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','The provided instance is invalid. Must contain raw OR encoded and hash.'=>'ಒದಗಿಸಿದ ಉದಾಹರಣೆಯು ಅಮಾನ್ಯವಾಗಿದೆ. ಕಚ್ಚಾ ಅಥವಾ ಎನ್ಕೋಡ್ ಮತ್ತು ಹ್ಯಾಶ್ ಹೊಂದಿರಬೇಕು.','The requested widget is invalid.'=>'ವಿನಂತಿಸಿದ ವಿಜೆಟ್ ಅಮಾನ್ಯವಾಗಿದೆ.','The sidebar to return widgets for.'=>'ವಿಜೆಟ್‌ಗಳನ್ನು ಹಿಂದಿರುಗಿಸಲು ಸೈಡ್‌ಬಾರ್.','Unique identifier for the widget.'=>'ವಿಜೆಟ್‌ಗಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The type of the widget. Corresponds to ID in widget-types endpoint.'=>'ವಿಜೆಟ್-ರೀತಿಯ ಅಂತ್ಯಬಿಂದು.','The sidebar the widget belongs to.'=>'ಸೈಡ್‌ಬಾರ್ ವಿಜೆಟ್ ಸೇರಿದೆ.','HTML representation of the widget.'=>'ವಿಜೆಟ್ನ HTML ಪ್ರಾತಿನಿಧ್ಯ.','HTML representation of the widget admin form.'=>'ವಿಜೆಟ್ ನಿರ್ವಾಹಕ ರೂಪದ HTML ಪ್ರಾತಿನಿಧ್ಯ.','Instance settings of the widget, if supported.'=>'ವಿಜೆಟ್ನ ಸಾಂದರ್ಬಿಕ ಸೆಟ್ಟಿಂಗ್ಗಳು, ಬೆಂಬಲಿತವಾಗಿದ್ದರೆ.','Base64 encoded representation of the instance settings.'=>'ಉದಾಹರಣೆ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಬೇಸ್ 64 ಎನ್‌ಕೋಡೆಡ್ ಪ್ರಾತಿನಿಧ್ಯ.','Cryptographic hash of the instance settings.'=>'ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಕ್ರಿಪ್ಟೋಗ್ರಾಫಿಕ್ ಹ್ಯಾಶ್.','Unencoded instance settings, if supported.'=>'ಬೆಂಬಲಿತವಾಗಿದ್ದರೆ ಎನ್ಕೋಡ್ ಮಾಡದಿರುವ ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್ಗಳು.','URL-encoded form data from the widget admin form. Used to update a widget that does not support instance. Write only.'=>'ವಿಜೆಟ್ ನಿರ್ವಾಹಕ ರೂಪದಿಂದ URL- ಎನ್ಕೋಡ್ ಮಾಡಿದ ಫಾರ್ಮ್ ಡೇಟಾ. ಉದಾಹರಣೆಯನ್ನು ಬೆಂಬಲಿಸದ ವಿಜೆಟ್ ಅನ್ನು ನವೀಕರಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ. ಬರೆಯಲು ಮಾತ್ರ.','This image cannot be processed by the web server. Convert it to JPEG or PNG before uploading.'=>'ಈ ಚಿತ್ರವನ್ನು ವೆಬ್ ಸರ್ವರ್ ಮೂಲಕ ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಮೊದಲು ಅದನ್ನು JPEG ಅಥವಾ PNG ಗೆ ಪರಿವರ್ತಿಸಿ.','navigation link block titleTag Link'=>'ಟ್ಯಾಗ್ ಲಿಂಕ್','navigation link block titleCategory Link'=>'ವರ್ಗ ಲಿಂಕ್','navigation link block descriptionA link to a tag.'=>'ಟ್ಯಾಗ್‌ಗೆ ಲಿಂಕ್.','navigation link block descriptionA link to a category.'=>'ಒಂದು ವರ್ಗಕ್ಕೆ ಲಿಂಕ್.','Reusable block updated.'=>'ಮರುಬಳಕೆ ಮಾಡಬಹುದಾದ ಬ್ಲಾಕ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.','The ID for the parent of the autosave.'=>'ಆಟೋಸೇವ್‌ನ ಪೋಷಕರಿಗೆ ಐಡಿ.','The content for the comment.'=>'ಕಾಮೆಂಟ್‌ಗಾಗಿ ವಿಷಯ.','Content for the comment, as it exists in the database.'=>'ಕಾಮೆಂಟ್‌ಗಾಗಿ ವಿಷಯ, ಏಕೆಂದರೆ ಇದು ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','HTML content for the comment, transformed for display.'=>'ಕಾಮೆಂಟ್‌ಗಾಗಿ HTML ವಿಷಯ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The date the comment was published, in the site\'s timezone.'=>'ಜಾಲತಾಣದ ಸಮಯವಲಯದಲ್ಲಿ ಕಾಮೆಂಟ್ ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ.','The ID for the parent of the comment.'=>'ಕಾಮೆಂಟ್‌ನ ಪೋಷಕರಿಗೆ ಐಡಿ.','The date the post was published, in the site\'s timezone.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','GUID for the post, as it exists in the database.'=>'ಪೋಸ್ಟ್‌ನ GUID, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಇರುವಂತೆ.','The date the post was last modified, in the site\'s timezone.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','The date the post was last modified, as GMT.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ, GMT ಯಂತೆ.','An alphanumeric identifier for the post unique to its type.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫೈಯರ್ ಅದರ ಪ್ರಕಾರಕ್ಕೆ ವಿಶಿಷ್ಟವಾಗಿದೆ.','The date the comment was published, as GMT.'=>'ಕಾಮೆಂಟ್ ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, GMT ಯಂತೆ.','This theme doesn\'t support Customizer.'=>'ಈ ಥೀಮ್ ಕಸ್ಟೊಮೈಜರ್ ಅನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','However, you can still <a href="%s">activate this theme</a>, and use the Site Editor to customize it.'=>'ಆದಾಗ್ಯೂ, ನೀವು ಇನ್ನೂ <a href="%s">ಈ ಥೀಮ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು</a> ಮತ್ತು ಅದನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಲು ಸೈಟ್ ಸಂಪಾದಕವನ್ನು ಬಳಸಬಹುದು.','Could not sanitize the %1$s option. Error code: %2$s'=>'%1$s ಆಯ್ಕೆಯನ್ನು ಸ್ವಚ್ಛಗೊಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ. ದೋಷ ಕೋಡ್: %2$s','Sorry, you are not allowed to upload this file type.'=>'ಕ್ಷಮಿಸಿ, ಈ ಫೈಲ್ ಪ್ರಕಾರವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','File %s doesn\'t exist!'=>'ಫೈಲ್ %s ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ!','Error when decoding a JSON file at path %1$s: %2$s'=>'%1$s ಪಥದಲ್ಲಿ JSON ಫೈಲ್ ಅನ್ನು ಡಿಕೋಡ್ ಮಾಡುವಾಗ ದೋಷ: %2$s','%1$s only accepts a non-empty path string, received %2$s.'=>'%1$s ಕೇವಲ ಖಾಲಿ-ಅಲ್ಲದ ಮಾರ್ಗ ಸ್ಟ್ರಿಂಗ್ ಅನ್ನು ಸ್ವೀಕರಿಸುತ್ತದೆ, %2$s ಅನ್ನು ಸ್ವೀಕರಿಸಿದೆ.','media itemsUnattached'=>'ಲಗತ್ತಿಸದ','<strong>Error:</strong> This email address is already registered. <a href="%s">Log in</a> with this address or choose another one.'=>'<strong>ದೋಷ:</strong> ಈ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಈಗಾಗಲೇ ನೋಂದಾಯಿಸಲಾಗಿದೆ. ಈ ವಿಳಾಸದೊಂದಿಗೆ <a href="%s">ಲಾಗ್ ಇನ್ ಮಾಡಿ</a> ಅಥವಾ ಇನ್ನೊಂದನ್ನು ಆಯ್ಕೆಮಾಡಿ.','post type general nameTemplates'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಳು','post type singular nameTemplate'=>'ಟೆಂಪ್ಲೇಟ್','post type general nameTemplate Parts'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳು','post type singular nameTemplate Part'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗ','Template PartAdd New'=>'ಹೊಸದನ್ನು ಸೇರಿಸಿ','Add New Template Part'=>'ಹೊಸ ಟೆಂಪ್ಲೇಟ್ ಭಾಗವನ್ನು ಸೇರಿಸಿ','New Template Part'=>'ಹೊಸ ಟೆಂಪ್ಲೇಟ್ ಭಾಗ','Edit Template Part'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗವನ್ನು ಸಂಪಾದಿಸಿ','View Template Part'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗವನ್ನು ವೀಕ್ಷಿಸಿ','Template Parts'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳು','Search Template Parts'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳನ್ನು ಹುಡುಕಿ','Parent Template Part:'=>'ಪೋಷಕ ಟೆಂಪ್ಲೇಟ್ ಭಾಗ:','No template parts found.'=>'ಯಾವುದೇ ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','No template parts found in Trash.'=>'ಅನುಪಯುಕ್ತದಲ್ಲಿ ಯಾವುದೇ ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','Template part archives'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗ ಆರ್ಕೈವ್ಗಳು','Insert into template part'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗಕ್ಕೆ ಸೇರಿಸಿ','Uploaded to this template part'=>'ಈ ಟೆಂಪ್ಲೇಟ್ ಭಾಗಕ್ಕೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ','Filter template parts list'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳ ಪಟ್ಟಿಯನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಿ','Template parts list navigation'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳ ಪಟ್ಟಿ ನ್ಯಾವಿಗೇಷನ್','Template parts list'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳ ಪಟ್ಟಿ','Template parts to include in your templates.'=>'ನಿಮ್ಮ ಟೆಂಪ್ಲೇಟ್‌ಗಳಲ್ಲಿ ಸೇರಿಸಲು ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳು.','post type general nameGlobal Styles'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳು','Global styles to include in