ngs.'=>'ಜಾಗತಿಕ ಸೆಟ್ಟಿಂಗ್‌ಗಳು','Title of the global styles variation.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳ ಬದಲಾವಣೆಯ ಶೀರ್ಷಿಕೆ.','Title for the global styles variation, as it exists in the database.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳ ಬದಲಾವಣೆಯ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವಂತೆ.','Sorry, you are not allowed to access the global styles on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಜಾಗತಿಕ ಶೈಲಿಗಳನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ.','Menu items do not support trashing. Set \'%s\' to delete.'=>'ಮೆನು ಐಟಂಗಳು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಹೊಂದಿಸಿ.','The title is required when using a custom menu item type.'=>'ಕಸ್ಟಮ್ ಮೆನು ಐಟಂ ಪ್ರಕಾರವನ್ನು ಬಳಸುವಾಗ ಶೀರ್ಷಿಕೆಯ ಅಗತ್ಯವಿದೆ.','The url is required when using a custom menu item type.'=>'ಕಸ್ಟಮ್ ಮೆನು ಐಟಂ ಪ್ರಕಾರವನ್ನು ಬಳಸುವಾಗ url ಅಗತ್ಯವಿದೆ.','Get linked object.'=>'ಲಿಂಕ್ ಮಾಡಲಾದ ವಸ್ತುವನ್ನು ಪಡೆಯಿರಿ.','Title for the object, as it exists in the database.'=>'ವಸ್ತುವಿನ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','HTML title for the object, transformed for display.'=>'ವಸ್ತುವಿನ HTML ಶೀರ್ಷಿಕೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'"post_type" ಅಥವಾ "taxonomy" ನಂತಹ ಮೂಲತಃ ಪ್ರತಿನಿಧಿಸುವ ವಸ್ತುಗಳ ಕುಟುಂಬ.','A named status for the object.'=>'ವಸ್ತುವಿಗೆ ಹೆಸರಿಸಲಾದ ಸ್ಥಿತಿ.','The ID for the parent of the object.'=>'ವಸ್ತುವಿನ ಪೋಷಕ ID.','Text for the title attribute of the link element for this menu item.'=>'ಈ ಮೆನು ಐಟಂಗಾಗಿ ಲಿಂಕ್ ಅಂಶದ ಶೀರ್ಷಿಕೆ ಗುಣಲಕ್ಷಣಕ್ಕಾಗಿ ಪಠ್ಯ.','Class names for the link element of this menu item.'=>'ಈ ಮೆನು ಐಟಂನ ಲಿಂಕ್ ಅಂಶಕ್ಕಾಗಿ ವರ್ಗ ಹೆಸರುಗಳು.','The description of this menu item.'=>'ಈ ಮೆನು ಐಟಂನ ವಿವರಣೆ.','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'ಈ ಐಟಂನ ಮೆನು ಮೂಲವಾಗಿರುವ nav_menu_item ನ DB ID, ಯಾವುದಾದರೂ ಇದ್ದರೆ, ಇಲ್ಲದಿದ್ದರೆ 0.','The type of object originally represented, such as "category", "post", or "attachment".'=>'ವಸ್ತುವಿನ ಪ್ರಕಾರವನ್ನು ಮೂಲತಃ ಪ್ರತಿನಿಧಿಸಲಾಗುತ್ತದೆ, ಉದಾಹರಣೆಗೆ "ವರ್ಗ", "ಪೋಸ್ಟ್" ಅಥವಾ "ಲಗತ್ತು".','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'ಈ ಮೆನು ಐಟಂ ಪ್ರತಿನಿಧಿಸುವ ಮೂಲ ವಸ್ತುವಿನ ಡೇಟಾಬೇಸ್ ID, ಉದಾಹರಣೆಗೆ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ID ಅಥವಾ ವರ್ಗಗಳಿಗೆ term_id.','The target attribute of the link element for this menu item.'=>'ಈ ಮೆನು ಐಟಂಗಾಗಿ ಲಿಂಕ್ ಅಂಶದ ಗುರಿ ಗುಣಲಕ್ಷಣ.','The singular label used to describe this type of menu item.'=>'ಈ ರೀತಿಯ ಮೆನು ಐಟಂ ಅನ್ನು ವಿವರಿಸಲು ಏಕವಚನ ಲೇಬಲ್ ಅನ್ನು ಬಳಸಲಾಗುತ್ತದೆ.','The URL to which this menu item points.'=>'ಈ ಮೆನು ಐಟಂ ಸೂಚಿಸುವ URL.','The XFN relationship expressed in the link of this menu item.'=>'XFN ಸಂಬಂಧವನ್ನು ಈ ಮೆನು ಐಟಂನ ಲಿಂಕ್‌ನಲ್ಲಿ ವ್ಯಕ್ತಪಡಿಸಲಾಗಿದೆ.','Whether the menu item represents an object that no longer exists.'=>'ಮೆನು ಐಟಂ ಇನ್ನು ಮುಂದೆ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲದ ವಸ್ತುವನ್ನು ಪ್ರತಿನಿಧಿಸುತ್ತದೆಯೇ.','The terms assigned to the object in the %s taxonomy.'=>'%s ಟ್ಯಾಕ್ಸಾನಮಿಯಲ್ಲಿ ಆಬ್ಜೆಕ್ಟ್‌ಗೆ ನಿಯೋಜಿಸಲಾದ ನಿಯಮಗಳು.','An alphanumeric identifier for the menu location.'=>'ಮೆನು ಸ್ಥಳಕ್ಕಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಗುರುತಿಸುವಿಕೆ.','Sorry, you are not allowed to view menu locations.'=>'ಕ್ಷಮಿಸಿ, ಮೆನು ಸ್ಥಳಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Invalid menu location.'=>'ಅಮಾನ್ಯ ಮೆನು ಸ್ಥಳ.','The name of the menu location.'=>'ಮೆನು ಸ್ಥಳದ ಹೆಸರು.','The description of the menu location.'=>'ಮೆನು ಸ್ಥಳದ ವಿವರಣೆ.','The ID of the assigned menu.'=>'ನಿಯೋಜಿಸಲಾದ ಮೆನುವಿನ ID.','Sorry, you are not allowed to view menus.'=>'ಕ್ಷಮಿಸಿ, ಮೆನುಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Menus do not support trashing. Set \'%s\' to delete.'=>'ಮೆನುಗಳು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಹೊಂದಿಸಿ.','The menu cannot be deleted.'=>'ಮೆನುವನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ','The locations assigned to the menu.'=>'ಮೆನುಗೆ ನಿಯೋಜಿಸಲಾದ ಸ್ಥಳಗಳು.','Whether to automatically add top level pages to this menu.'=>'ಈ ಮೆನುಗೆ ಉನ್ನತ ಮಟ್ಟದ ಪುಟಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸೇರಿಸಬೇಕೆ.','REST route\'s namespace for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ REST ಮಾರ್ಗದ ನೇಮ್‌ಸ್ಪೇಸ್.','The visibility settings for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಗೋಚರತೆಯ ಸೆಟ್ಟಿಂಗ್‌ಗಳು.','Whether to generate a default UI for managing this post type.'=>'ಈ ಪೋಸ್ಟ್ ಪ್ರಕಾರವನ್ನು ನಿರ್ವಹಿಸಲು ಡೀಫಾಲ್ಟ್ UI ಅನ್ನು ರಚಿಸಬೇಕೆ.','REST namespace route for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗಾಗಿ REST ನೇಮ್‌ಸ್ಪೇಸ್ ಮಾರ್ಗ.','Limit to the specified template part area.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಟೆಂಪ್ಲೇಟ್ ಭಾಗ ಪ್ರದೇಶಕ್ಕೆ ಮಿತಿಗೊಳಿಸಿ.','Post type to get the templates for.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು ಪಡೆಯಲು ಪೋಸ್ಟ್ ಪ್ರಕಾರ.','Type of template.'=>'ಟೆಂಪ್ಲೇಟ್ ಪ್ರಕಾರ.','Source of a customized template'=>'ಕಸ್ಟಮೈಸ್ ಮಾಡಿದ ಟೆಂಪ್ಲೇಟ್‌ನ ಮೂಲ','Content for the template, as it exists in the database.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ ವಿಷಯ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವಂತೆ.','Version of the content block format used by the template.'=>'ಟೆಂಪ್ಲೇಟ್ ಬಳಸುವ ಕಂಟೆಂಟ್ ಬ್ಲಾಕ್ ಫಾರ್ಮ್ಯಾಟ್‌ನ ಆವೃತ್ತಿ.','Title for the template, as it exists in the database.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವಂತೆ.','HTML title for the template, transformed for display.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ HTML ಶೀರ್ಷಿಕೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The ID for the author of the template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ಲೇಖಕರ ID.','Whether a template is a custom template.'=>'ಟೆಂಪ್ಲೇಟ್ ಕಸ್ಟಮ್ ಟೆಂಪ್ಲೇಟ್ ಆಗಿದೆಯೇ.','Where the template part is intended for use (header, footer, etc.)'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗವು ಬಳಕೆಗೆ ಉದ್ದೇಶಿಸಿದ್ದರೆ (ಹೆಡರ್, ಅಡಿಟಿಪ್ಪಣಿ, ಇತ್ಯಾದಿ.)','The URL to process.'=>'ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು URL.','The contents of the %s element from the URL.'=>'URL ನಿಂದ %s ಅಂಶದ ವಿಷಯಗಳು.','The favicon image link of the %s element from the URL.'=>'URL ನಿಂದ %s ಅಂಶದ ಫೆವಿಕಾನ್ ಇಮೇಜ್ ಲಿಂಕ್.','The content of the %s element from the URL.'=>'URL ನಿಂದ %s ಅಂಶದ ವಿಷಯ.','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'URL ನಿಂದ %1$s ಅಥವಾ %2$s ಅಂಶದ ಓಪನ್ ಗ್ರಾಫ್ ಇಮೇಜ್ ಲಿಂಕ್.','Invalid URL'=>'ಅಮಾನ್ಯ URL','Sorry, you are not allowed to process remote URLs.'=>'ಕ್ಷಮಿಸಿ, ರಿಮೋಟ್ URL ಗಳನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','URL not found. Response returned a non-200 status code for this URL.'=>'URL ಕಂಡುಬಂದಿಲ್ಲ. ಈ URL ಗಾಗಿ ಪ್ರತಿಕ್ರಿಯೆಯು 200 ಅಲ್ಲದ ಸ್ಥಿತಿ ಕೋಡ್ ಅನ್ನು ಹಿಂತಿರುಗಿಸಿದೆ.','Unable to retrieve body from response at this URL.'=>'ಈ URL ನಲ್ಲಿ ಪ್ರತಿಕ್ರಿಯೆಯಿಂದ ದೇಹವನ್ನು ಹಿಂಪಡೆಯಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ.','Sorry, you are not allowed to filter users by capability.'=>'ಕ್ಷಮಿಸಿ, ಸಾಮರ್ಥ್ಯದ ಮೂಲಕ ಬಳಕೆದಾರರನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'ಒದಗಿಸಿದ ಕನಿಷ್ಠ ಒಂದು ನಿರ್ದಿಷ್ಟ ಸಾಮರ್ಥ್ಯವನ್ನು ಹೊಂದಿಕೆಯಾಗುವ ಬಳಕೆದಾರರಿಗೆ ಮಿತಿ ಫಲಿತಾಂಶವನ್ನು ಹೊಂದಿಸಲಾಗಿದೆ. csv ಪಟ್ಟಿ ಅಥವಾ ಏಕ ಸಾಮರ್ಥ್ಯವನ್ನು ಸ್ವೀಕರಿಸುತ್ತದೆ.','Limit result set to users who have published posts.'=>'ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರಕಟಿಸಿದ ಬಳಕೆದಾರರಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಲಾಗಿದೆ.','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'ಸರ್ವರ್ ಚಿತ್ರವನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಸರ್ವರ್ ಕಾರ್ಯನಿರತವಾಗಿದ್ದರೆ ಅಥವಾ ಕಾರ್ಯವನ್ನು ಪೂರ್ಣಗೊಳಿಸಲು ಸಾಕಷ್ಟು ಸಂಪನ್ಮೂಲಗಳನ್ನು ಹೊಂದಿಲ್ಲದಿದ್ದರೆ ಇದು ಸಂಭವಿಸಬಹುದು. ಚಿಕ್ಕ ಚಿತ್ರವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುವುದರಿಂದ ಸಹಾಯವಾಗಬಹುದು. ಸೂಚಿಸಲಾದ ಗರಿಷ್ಠ ಗಾತ್ರವು 2560 ಪಿಕ್ಸೆಲ್‌ಗಳು.','The name is how it appears on your site.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಅದು ಹೇಗೆ ಕಾಣಿಸಿಕೊಳ್ಳುತ್ತದೆ ಎಂಬುದು ಹೆಸರು.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'&#8220;ಸ್ಲಗ್&#8221; ಒಂದು ಹೆಸರಿನ URL ಸ್ನೇಹಿ ಆವೃತ್ತಿಯಾಗಿದೆ. ಇದು ಸಾಮಾನ್ಯವಾಗಿ ಎಲ್ಲಾ ಸಣ್ಣಕ್ಷರವಾಗಿದೆ ಮತ್ತು ಅಕ್ಷರಗಳು, ಸಂಖ್ಯೆಗಳು ಮತ್ತು ಹೈಫನ್‌ಗಳನ್ನು ಮಾತ್ರ ಒಳಗೊಂಡಿರುತ್ತದೆ.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'ಕ್ರಮಾನುಗತವನ್ನು ರಚಿಸಲು ಪೋಷಕರ ಪದವನ್ನು ನಿಯೋಜಿಸಿ. ಉದಾಹರಣೆಗೆ Jazz ಎಂಬ ಪದವು ಬೇಬಾಪ್ ಮತ್ತು ಬಿಗ್ ಬ್ಯಾಂಡ್‌ನ ಮೂಲವಾಗಿದೆ.','The description is not prominent by default; however, some themes may show it.'=>'ವಿವರಣೆಯು ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ ಪ್ರಮುಖವಾಗಿಲ್ಲ; ಆದಾಗ್ಯೂ, ಕೆಲವು ಥೀಮ್‌ಗಳು ಅದನ್ನು ತೋರಿಸಬಹುದು.','WordPress database error: Could not perform query because it contains invalid data.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ದೋಷ: ಇದು ಅಮಾನ್ಯ ಡೇಟಾವನ್ನು ಹೊಂದಿರುವ ಕಾರಣ ಪ್ರಶ್ನೆಯನ್ನು ನಿರ್ವಹಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ದೋಷ: ಕೆಳಗಿನ ಕ್ಷೇತ್ರಕ್ಕೆ ಮೌಲ್ಯವನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸುವುದು ವಿಫಲವಾಗಿದೆ: %s. ಒದಗಿಸಿದ ಮೌಲ್ಯವು ತುಂಬಾ ಉದ್ದವಾಗಿರಬಹುದು ಅಥವಾ ಅಮಾನ್ಯ ಡೇಟಾವನ್ನು ಹೊಂದಿರಬಹುದು.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ದೋಷ: ಕೆಳಗಿನ ಕ್ಷೇತ್ರಗಳಿಗೆ ಮೌಲ್ಯಗಳನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸುವುದು ವಿಫಲವಾಗಿದೆ: %s. ಸರಬರಾಜು ಮಾಡಲಾದ ಮೌಲ್ಯಗಳು ತುಂಬಾ ಉದ್ದವಾಗಿರಬಹುದು ಅಥವಾ ಅಮಾನ್ಯ ಡೇಟಾವನ್ನು ಹೊಂದಿರಬಹುದು.','Could not retrieve table charset.'=>'ಟೇಬಲ್ ಅಕ್ಷರ ಸೆಟ್ ಅನ್ನು ಹಿಂಪಡೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not strip invalid text.'=>'ಅಮಾನ್ಯ ಪಠ್ಯವನ್ನು ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','File does not exist?'=>'ಕಡತ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ?','color schemeDark'=>'ಡಾರ್ಕ್','color schemeLight'=>'ಲೈಟ್','A title on that page cannot be found.'=>'ಆ ಪುಟದಲ್ಲಿ ಶೀರ್ಷಿಕೆ ಕಂಡುಬಂದಿಲ್ಲ.','unit symbolYB'=>'YB','unit symbolZB'=>'ZB','unit symbolEB'=>'EB','unit symbolPB'=>'PB','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>ದೋಷ:</strong> ಇದು ಮಾನ್ಯವಾದ ಫೀಡ್ ಟೆಂಪ್ಲೇಟ್ ಅಲ್ಲ.','Error in deleting the attachment.'=>'ಲಗತ್ತನ್ನು ಅಳಿಸುವಲ್ಲಿ ದೋಷ.','The category name.'=>'ವರ್ಗದ ಹೆಸರು.','The category label, in human readable format.'=>'ವರ್ಗದ ಲೇಬಲ್, ಮಾನವ ಓದಬಲ್ಲ ಸ್ವರೂಪದಲ್ಲಿ.','Cannot select database'=>'ಡೇಟಾಬೇಸ್ ಆಯ್ಕೆ ಮಾಡಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%2$s ಆವೃತ್ತಿಯಿಂದ %1$s ಕಾರ್ಯವನ್ನು <strong>ಅಸಮ್ಮತಿಗೊಳಿಸಲಾಗಿದೆ</strong>! ಬದಲಿಗೆ %3$s ಬಳಸಿ.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%2$s ಆವೃತ್ತಿಯಿಂದ %1$s ಕಾರ್ಯವನ್ನು <strong>ಅಸಮ್ಮತಿಗೊಳಿಸಲಾಗಿದೆ</strong> ಯಾವುದೇ ಪರ್ಯಾಯ ಲಭ್ಯವಿಲ್ಲ.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%2$s ಆವೃತ್ತಿಯಿಂದ %1$s ಫೈಲ್ ಅನ್ನು <strong>ಅಸಮ