ೀಕ್ಷಣೆ ಮಾಡಲಾಗುವುದಿಲ್ಲ.','This form is not live-previewable.'=>'ಈ ಫಾರ್ಮ್ ಅನ್ನು ಲೈವ್-ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಲಾಗುವುದಿಲ್ಲ.','Setting does not exist or is unrecognized.'=>'ಸೆಟ್ಟಿಂಗ್ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ ಅಥವಾ ಗುರುತಿಸಲಾಗಿಲ್ಲ.','Unauthorized to modify setting due to capability.'=>'ಸಾಮರ್ಥ್ಯದ ಕಾರಣ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಮಾರ್ಪಡಿಸಲು ಅನಧಿಕೃತ.','Are you sure you want to delete this theme?'=>'ನೀವು ಖಂಡಿತವಾಗಿಯೂ ಈ ಥೀಮ್ ಅನ್ನು ಅಳಿಸಲು ಬಯಸುತ್ತೀರಾ?','%d themes found'=>'%d ಥೀಮ್ಗಳು ಕಂಡುಬಂದಿವೆ','Displaying %d themes'=>'%d ಥೀಮ್ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತಿದೆ','Showing details for theme: %s'=>'ಥೀಮ್ಗಾಗಿ ವಿವರಗಳನ್ನು ತೋರಿಸಲಾಗುತ್ತಿದೆ: %s','If you add a video, the image will be used as a fallback while the video loads.'=>'ನೀವು ವೀಡಿಯೊವನ್ನು ಸೇರಿಸಿದರೆ, ವೀಡಿಯೊ ಲೋಡ್ ಆಗುವಾಗ ಚಿತ್ರವನ್ನು ಫಾಲ್ಬ್ಯಾಕ್ ಆಗಿ ಬಳಸಲಾಗುತ್ತದೆ.','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends dimensions of %2$s pixels.'=>'ನಿಮ್ಮ ವೀಡಿಯೊವನ್ನು %1$s ಸ್ವರೂಪದಲ್ಲಿ ಅಪ್ ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಉತ್ತಮ ಫಲಿತಾಂಶಗಳಿಗಾಗಿ ಅದರ ಫೈಲ್ ಗಾತ್ರವನ್ನು ಕಡಿಮೆ ಮಾಡಿ. ನಿಮ್ಮ ಥೀಮ್ %2$s ಪಿಕ್ಸೆಲ್ ಗಳ ಆಯಾಮಗಳನ್ನು ಶಿಫಾರಸು ಮಾಡುತ್ತದೆ.','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a width of %2$s pixels.'=>'ನಿಮ್ಮ ವೀಡಿಯೊವನ್ನು %1$s ಸ್ವರೂಪದಲ್ಲಿ ಅಪ್ ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಉತ್ತಮ ಫಲಿತಾಂಶಗಳಿಗಾಗಿ ಅದರ ಫೈಲ್ ಗಾತ್ರವನ್ನು ಕಡಿಮೆ ಮಾಡಿ. ನಿಮ್ಮ ಥೀಮ್ %2$s ಪಿಕ್ಸೆಲ್ ಗಳ ಅಗಲವನ್ನು ಶಿಫಾರಸು ಮಾಡುತ್ತದೆ.','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a height of %2$s pixels.'=>'ನಿಮ್ಮ ವೀಡಿಯೊವನ್ನು %1$s ಸ್ವರೂಪದಲ್ಲಿ ಅಪ್ ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಉತ್ತಮ ಫಲಿತಾಂಶಗಳಿಗಾಗಿ ಅದರ ಫೈಲ್ ಗಾತ್ರವನ್ನು ಕಡಿಮೆ ಮಾಡಿ. ನಿಮ್ಮ ಥೀಮ್ %2$s ಪಿಕ್ಸೆಲ್ ಗಳ ಎತ್ತರವನ್ನು ಶಿಫಾರಸು ಮಾಡುತ್ತದೆ.','Header Video'=>'ಶಿರೋಲೇಖ ವೀಡಿಯೊ','Background PresetPreset'=>'ಪೂರ್ವನಿಗದಿ','Default PresetDefault'=>'ಪೂರ್ವನಿಯೋಜಿತ','Fit to Screen'=>'ಪರದೆಗೆ ಹೊಂದಿಸು','Repeat ImageRepeat'=>'ಪುನರಾವರ್ತಿಸಿ','Custom PresetCustom'=>'ಅಗತ್ಯಾನುಗುಣ','Image Position'=>'ಚಿತ್ರದ ಸ್ಥಾನ','Image Size'=>'ಚಿತ್ರದ ಅಳತೆ','Repeat Background Image'=>'ಹಿನ್ನೆಲೆ ಚಿತ್ರವನ್ನು ಪುನರಾವರ್ತಿಸಿ','Scroll with Page'=>'ಪುಟದೊಂದಿಗೆ ಸ್ಕ್ರಾಲ್ ಮಾಡಿ','Additional CSS'=>'ಹೆಚ್ಚುವರಿ CSS','Learn more about CSS'=>'CSS ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ','Invalid value for background repeat.'=>'ಹಿನ್ನೆಲೆ ಪುನರಾವರ್ತಿತಕ್ಕಾಗಿ ಅಮಾನ್ಯ ಮೌಲ್ಯ.','Invalid value for background attachment.'=>'ಹಿನ್ನೆಲೆ ಲಗತ್ತಿಸುವಿಕೆಗೆ ಅಮಾನ್ಯ ಮೌಲ್ಯ.','Invalid value for background position X.'=>'ಹಿನ್ನೆಲೆ ಸ್ಥಾನ X ಗೆ ಅಮಾನ್ಯ ಮೌಲ್ಯ.','Invalid value for background position Y.'=>'ಹಿನ್ನೆಲೆ ಸ್ಥಾನ Y ಗೆ ಅಮಾನ್ಯವಾದ ಮೌಲ್ಯ.','Invalid value for background size.'=>'ಹಿನ್ನೆಲೆ ಗಾತ್ರಕ್ಕೆ ಅಮಾನ್ಯ ಮೌಲ್ಯ.','Unrecognized background setting.'=>'ಗುರುತಿಸಲಾಗದ ಹಿನ್ನೆಲೆ ಸೆಟ್ಟಿಂಗ್.','Post'=>'ಪೋಸ್ಟ್','%1$s could not be created: %2$s'=>'%1$s ರಚಿಸಲಾಗಲಿಲ್ಲ: %2$s','This video file is too large to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'ಈ ವೀಡಿಯೊ ಫೈಲ್ ತಲೆಬರಹ ವೀಡಿಯೊಆಗಿ ಬಳಸಲು ತುಂಬಾ ದೊಡ್ಡದಾಗಿದೆ. ಚಿಕ್ಕ ವೀಡಿಯೊ ಪ್ರಯತ್ನಿಸಿ ಅಥವಾ ಸಂಕೋಚನ ಸೆಟ್ಟಿಂಗ್ ಗಳನ್ನು ಆಪ್ಟಿಮೈಜ್ ಮಾಡಿ ಮತ್ತು 8ಎಂಬಿಗಿಂತ ಕಡಿಮೆ ಇರುವ ಫೈಲ್ ಅನ್ನು ಮರು ಅಪ್ ಲೋಡ್ ಮಾಡಿ. ಅಥವಾ, ನಿಮ್ಮ ವೀಡಿಯೊವನ್ನು ಯೂಟ್ಯೂಬ್ ಗೆ ಅಪ್ ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಕೆಳಗಿನ ಆಯ್ಕೆಯೊಂದಿಗೆ ಲಿಂಕ್ ಮಾಡಿ.','Only %1$s or %2$s files may be used for header video. Please convert your video file and try again, or, upload your video to YouTube and link it with the option below.'=>'ಹೆಡರ್ ವೀಡಿಯೊಗಾಗಿ ಮಾತ್ರ %1$s ಅಥವಾ %2$s ಫೈಲ್ಗಳನ್ನು ಬಳಸಬಹುದು. ದಯವಿಟ್ಟು ನಿಮ್ಮ ವೀಡಿಯೊ ಫೈಲ್ ಅನ್ನು ಪರಿವರ್ತಿಸಿ ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ ಅಥವಾ YouTube ಗೆ ನಿಮ್ಮ ವೀಡಿಯೊವನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಕೆಳಗಿನ ಆಯ್ಕೆಯನ್ನು ಲಿಂಕ್ ಮಾಡಿ.','Number of widgets found: %d'=>'ಕಂಡುಬಂದ ವಿಜೆಟ್‌ಗಳ ಸಂಖ್ಯೆ: %d','No widgets found.'=>'ಯಾವುದೇ ವಿಜೆಟ್‌ಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','Status is forbidden.'=>'ಸ್ಥಿತಿಯನ್ನು ನಿಷೇಧಿಸಲಾಗಿದೆ.','Homepage'=>'ಮುಖಪುಟ','Empty title.'=>'ಖಾಲಿ ಶೀರ್ಷಿಕೆ.','Or, enter a YouTube URL:'=>'ಅಥವಾ, ಯುಟ್ಯೂಬ್ URL ಅನ್ನು ನಮೂದಿಸಿ:','Please enter a valid YouTube URL.'=>'ದಯವಿಟ್ಟು ಮಾನ್ಯವಾದ YouTube URL ಅನ್ನು ನಮೂದಿಸಿ','+ %s'=>'+ %s','Header Media'=>'ಶಿರೋಲೇಖ ಮಾಧ್ಯಮ','RSS Error:'=>'RSS ದೋಷ:','You can navigate to other pages on your site while using the Customizer to view and edit the widgets displayed on those pages.'=>'ಆ ಪುಟಗಳಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲಾದ ವಿಜೆಟ್ ಗಳನ್ನು ವೀಕ್ಷಿಸಲು ಮತ್ತು ಸಂಪಾದಿಸಲು ಗ್ರಾಹಕೀಯವನ್ನು ಬಳಸುವಾಗ ನಿಮ್ಮ ಸೈಟ್ ನಲ್ಲಿರುವ ಇತರ ಪುಟಗಳಿಗೆ ನೀವು ನ್ಯಾವಿಗೇಟ್ ಮಾಡಬಹುದು.','Your theme has %s widget area, but this particular page does not display it.'=>'ನಿಮ್ಮ ಥೀಮ್ %s ವಿಜೆಟ್ ಪ್ರದೇಶವನ್ನು ಹೊಂದಿದೆ, ಆದರೆ ಈ ನಿರ್ದಿಷ್ಟ ಪುಟವು ಅದನ್ನು ಪ್ರದರ್ಶಿಸುವುದಿಲ್ಲ.' . "\0" . 'ನಿಮ್ಮ ಥೀಮ್ %s ವಿಜೆಟ್ ಪ್ರದೇಶಗಳನ್ನು ಹೊಂದಿದೆ, ಆದರೆ ಈ ನಿರ್ದಿಷ್ಟ ಪುಟವು ಅವುಗಳನ್ನು ಪ್ರದರ್ಶಿಸುವುದಿಲ್ಲ.','Id should start with a letter, followed only by letters, numbers, dashes, dots, colons or underscores.'=>'Id ಅಕ್ಷರದಿಂದ ಆರಂಭವಾಗಬೇಕು, ನಂತರ ಅಕ್ಷರಗಳು, ಸಂಖ್ಯೆಗಳು, ಡ್ಯಾಶ್‌ಗಳು, ಚುಕ್ಕೆಗಳು, ಕೊಲೊನ್‌ಗಳು ಅಥವಾ ಅಂಡರ್‌ಸ್ಕೋರ್‌ಗಳು ಮಾತ್ರ ಇರಬೇಕು.','Id for link anchor (TinyMCE)Id'=>'Id','%s item'=>'%s ಐಟಂ' . "\0" . '%s ಐಟಂಗಳು','View User'=>'ಬಳಕೆದಾರರನ್ನು ವೀಕ್ಷಿಸಿ','Edit User'=>'ಬಳಕೆದಾರರನ್ನು ಸಂಪಾದಿಸಿ','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'ಬದಲಾವಣೆಗಳ ಹಿಂದಿನ ಸೆಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಪ್ರಕಟಿಸಲಾಗಿದೆ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಪ್ರಸ್ತುತ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸಲು ಪ್ರಯತ್ನಿಸಿ.','You must supply a future date to schedule.'=>'ನೀವು ವೇಳಾಪಟ್ಟಿಗಾಗಿ ಭವಿಷ್ಯದ ದಿನಾಂಕವನ್ನು ಪೂರೈಸಬೇಕು.','Unable to save due to %s invalid setting.'=>'%s ಅಮಾನ್ಯ ಸೆಟ್ಟಿಂಗ್‌ನಿಂದಾಗಿ ಉಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.' . "\0" . '%s ಅಮಾನ್ಯ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಂದಾಗಿ ಉಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','There was an authentication problem. Please reload and try again.'=>'ದೃಢೀಕರಣ ಸಮಸ್ಯೆ ಕಂಡುಬಂದಿದೆ. ದಯವಿಟ್ಟು ಮರುಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ.','No changes saved yet, so there is nothing to trash.'=>'ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ಇನ್ನೂ ಉಳಿಸಲಾಗಿಲ್ಲ, ಆದ್ದರಿಂದ ಟ್ರಾಶ್ ಮಾಡಲು ಏನೂ ಇಲ್ಲ.','Unable to trash changes.'=>'ಬದಲಾವಣೆಗಳನ್ನು ಟ್ರ್ಯಾಶ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ.','Changes have already been trashed.'=>'ಬದಲಾವಣೆಗಳನ್ನು ಈಗಾಗಲೇ ಟ್ರ್ಯಾಶ್ ಮಾಡಲಾಗಿದೆ.','Changes trashed successfully.'=>'ಬದಲಾವಣೆಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಟ್ರ್ಯಾಶ್ ಮಾಡಲಾಗಿದೆ.','Share Preview Link'=>'ಪೂರ್ವವೀಕ್ಷಣೆ ಲಿಂಕ್ ಹಂಚಿಕೊಳ್ಳಿ','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ಬದಲಾವಣೆಗಳು ಹೇಗೆ ಲೈವ್ ಆಗಿ ಕಾಣುತ್ತವೆ ಎಂಬುದನ್ನು ನೋಡಿ ಮತ್ತು ಕಸ್ಟಮೈಜರ್ ಅನ್ನು ಪ್ರವೇಶಿಸಲು ಸಾಧ್ಯವಾಗದ ಜನರೊಂದಿಗೆ ಪೂರ್ವವೀಕ್ಷಣೆಯನ್ನು ಹಂಚಿಕೊಳ್ಳಿ.','Preview Link'=>'ಪೂರ್ವವೀಕ್ಷಣೆ ಲಿಂಕ್','Copied'=>'ನಕಲಿಸಲಾಗಿದೆ','Installed themes'=>'ಸ್ಥಾಪಿಸಲಾದ ಥೀಮ್‌ಗಳು','WordPress.org themes'=>'WordPress.org ಥೀಮ್‌ಗಳು','Site Icons are what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. Upload one here!'=>'ಬ್ರೌಸರ್ ಟ್ಯಾಬ್‌ಗಳು, ಬುಕ್‌ಮಾರ್ಕ್ ಬಾರ್‌ಗಳು ಮತ್ತು ವರ್ಡ್‌ಪ್ರೆಸ್ ಮೊಬೈಲ್ ಅಪ್ಲಿಕೇಶನ್‌ಗಳಲ್ಲಿ ನೀವು ಸೈಟ್ ಐಕಾನ್‌ಗಳನ್ನು ನೋಡುತ್ತೀರಿ. ಒಂದನ್ನು ಇಲ್ಲಿ ಅಪ್‌ಲೋಡ್ ಮಾಡಿ!','Site Icons should be square and at least %s pixels.'=>'ಸೈಟ್ ಐಕಾನ್‌ಗಳು ಚೌಕಾಕಾರವಾಗಿರಬೇಕು ಮತ್ತು ಕನಿಷ್ಠ %s ಪಿಕ್ಸೆಲ್‌ಗಳಾಗಿರಬೇಕು.','Homepage Settings'=>'ಮುಖಪುಟ ಸೆಟ್ಟಿಂಗ್ಗಳು','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'ನಿಮ್ಮ ಸೈಟ್ ನ ಮುಖಪುಟದಲ್ಲಿ ಏನನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗಿದೆ ಎಂಬುದನ್ನು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು. ಇದು ಹಿಮ್ಮುಖ ಕಾಲಾನುಕ್ರಮದ (ಕ್ಲಾಸಿಕ್ ಬ್ಲಾಗ್), ಅಥವಾ ಸ್ಥಿರ/ಸ್ಥಿರ ಪುಟದಲ್ಲಿ ಪೋಸ್ಟ್ ಗಳಾಗಿರಬಹುದು. ಸ್ಥಿರ ಮುಖಪುಟವನ್ನು ಹೊಂದಿಸಲು, ನೀವು ಮೊದಲು ಎರಡು ಪುಟಗಳನ್ನು ರಚಿಸಬೇಕು. ಒಂದು ಮುಖಪುಟವಾಗುತ್ತದೆ, ಮತ್ತು ಇನ್ನೊಂದು ನಿಮ್ಮ ಪೋಸ್ಟ್ ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುವ ಸ್ಥಳವಾಗಿರುತ್ತದೆ.','Your homepage displays'=>'ನಿಮ್ಮ ಮುಖಪುಟ ಪ್ರದರ್ಶನಗಳು','Add your own CSS code here to customize the appearance and layout of your site.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ ನೋಟ ಮತ್ತು ವಿನ್ಯಾಸವನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಲು ನಿಮ್ಮ ಸ್ವಂತ CSS ಕೋಡ್ ಅನ್ನು ಇಲ್ಲಿ ಸೇರಿಸಿ.','When using a keyboard to navigate:'=>'ನ್ಯಾವಿಗೇಟ್ ಮಾಡಲು ಕೀಬೋರ್ಡ್ ಬಳಸುವಾಗ:','In the editing area, the Tab key enters a tab character.'=>'ಸಂಪಾದನೆ ಪ್ರದೇಶದಲ್ಲಿ, ಟ್ಯಾಬ್ ಕೀ ಟ್ಯಾಬ್ ಅಕ್ಷರವನ್ನು ಪ್ರವೇಶಿಸುತ್ತದೆ.','To move away from this area, press the Esc key followed by the Tab key.'=>'ಈ ಪ್ರದೇಶದಿಂದ ದೂರವಿರಲು, Tab ಕೀ ನಂತರ Esc ಕೀಲಿಯನ್ನು ಒತ್ತಿರಿ.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'ಸ್ಕ್ರೀನ್ ರೀಡರ್ ಬಳಕೆದಾರರು: ಫಾರ್ಮ್ ಮೋಡ್‌ನಲ್ಲಿರುವಾಗ, ನೀವು Esc ಕೀಲಿಯನ್ನು ಎರಡು ಬಾರಿ ಒತ್ತಬೇಕಾಗುತ್ತದೆ.','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'ಸಂಪಾದನೆ ಕ್ಷೇತ್ರವು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಕೋಡ್ ಸಿಂಟ್ಯಾಕ್ಸ್ ಅನ್ನು ಎತ್ತಿ ತೋರಿಸುತ್ತದೆ. ಸರಳ ಪಠ್ಯ ಕ್ರಮದಲ್ಲಿ ಕೆಲಸ ಮಾಡಲು ನೀವು ಇದನ್ನು ನಿಮ್ಮ <a href="%1$s" %2$s>ಬಳಕೆದಾರರ ಪ್ರೊಫೈಲ್‌%3$s</a>ನಲ್ಲಿ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಬಹುದು.','CSS code'=>'CSS ಸಂಕೇತ','Your theme can display menus in one location.'=>'ನಿಮ್ಮ ಥೀಮ್ ಒಂದೇ ಸ್ಥಳದಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು.','Your theme can display menus in %s location.'=>'ನಿಮ್ಮ ಥೀಮ್ %s ಸ್ಥಳದಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು.' . "\0" . 'ನಿಮ್ಮ ಥೀಮ್ %s ಸ್ಥಳಗಳಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'ನಿಮ್ಮ ಥೀಮ್ ಬಹು ಮೆನುಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ಅವುಗಳಿಗೆ ಸ್ಪಷ್ಟವಾದ ಹೆಸರುಗಳನ್ನು ನೀಡುವ ಮೂಲಕ ಅವುಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡುತ್ತದೆ.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'ನಿಮ್ಮ ಥೀಮ್ ವಿಜೆಟ್ ಪ್ರದೇಶಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ನೀವು ಅಲ್ಲಿ ಮೆನುಗಳನ್ನು ಕೂಡ ಸೇರಿಸಬಹುದು. <a href="%s">ವಿಜೆಟ್‌ಗಳ ಫಲಕ</a>ಕ್ಕೆ ಭೇಟಿ ನೀಡಿ ಮತ್ತು ಸೈಡ್‌ಬಾರ್ ಅಥವಾ ಅಡಿಟಿಪ್ಪಣಿಯಲ್ಲಿ ಮೆನುವನ್ನು ಪ್ರದರ್ಶಿಸಲು &#8220;ನ್ಯಾವಿಗೇಷನ್ ಮೆನು ವಿಜೆಟ್&#8221; ಅನ್ನು ಸೇರಿಸಿ.','New Menu'=>'ಹೊಸ ಮೆನು','Create New Menu'=>'ಹೊಸ ಮೆನು ರಚಿಸಿ‍','Name for the Visual editor tabVisual'=>'ದೃಶ್ಯ','Your theme can display menus in one location. Select which menu you would like to use.'=>'ನಿಮ್ಮ ಥೀಮ್ ಒಂದೇ ಸ್ಥಳದಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು. ನೀವು ಯಾವ ಮೆನುವನ್ನು ಬಳಸಲು ಬಯಸುತ್ತೀರಿ ಎಂಬುದನ್ನು ಆಯ್ಕೆ ಮಾಡಿ.','menu locationsView Location'=>'ಸ್ಥಳವನ್ನು ವೀಕ್ಷಿಸಿ','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'ಥೀಮ್‌ಗಾಗಿ ನೋಡುತ್ತಿರುವಿರಾ? ನೀವು WordPress.org ಥೀಮ್ ಕೋಶವನ್ನು ಹುಡುಕಬಹುದು ಅಥವಾ ಬ್ರೌಸ್ ಮಾಡಬಹುದು, ಥೀಮ್‌ಗಳನ್ನು ಇನ್‌ಸ್ಟಾಲ್ ಮಾಡಿ ಮತ್ತು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಿ, ನಂತರ ಅವುಗಳನ್ನು ಇಲ್ಲಿಯೇ ಸಕ್ರಿಯಗೊಳಿಸಿ.','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'ಹೊಸ ಥೀಮ್ ಅನ್ನು ಪೂರ್ವವೀಕ್ಷಿಸುವಾಗ, ನೀವು ವಿಜೆಟ್ಗಳು ಮತ್ತು ಮೆನುಗಳಂತಹ ವಿಷಯಗಳಿಗೆ ತಕ್ಕಂತೆ ಮುಂದುವರಿಸಬಹುದು ಮತ್ತು ಥೀಮ್ ನಿರ್ದಿಷ್ಟ ಆಯ್ಕೆಗಳನ್ನು ಅನ್ವೇಷಿಸಬಹುದು.','menu locationsView All Locations'=>'ಎಲ್ಲಾ ಸ್ಥಳಗಳನ್ನು ವೀಕ್ಷಿಸಿ','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'ನಿಮ್ಮ ಸೈಟ್ ಇನ್ನೂ ಯಾವುದೇ ಮೆನುಗಳನ್ನು ಹೊಂದಿರುವಂತೆ ಕಾಣುತ್ತಿಲ್ಲ. ಒಂದನ್ನು ನಿರ್ಮಿಸಲು ಬಯಸುವಿರಾ? ಪ್ರಾರಂಭಿಸಲು ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ.','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'ನೀವು ಮೆನು ರಚಿಸುತ್ತೀರಿ, ಸ್ಥಳವನ್ನು ನಿಯೋಜಿಸಿ ಮತ್ತು ಪುಟಗಳು ಮತ್ತು ವರ್ಗಗಳಿಗೆ ಲಿಂಕ್ಗಳಂತಹ ಮೆನು ಐಟಂಗಳನ್ನು ಸೇರಿಸಿ. ನಿಮ್ಮ ಥೀಮ್ ಬಹು ಮೆನು ಪ್ರದೇಶಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ನೀವು ಒಂದಕ್ಕಿಂತ ಹೆಚ್ಚು ರಚಿಸಬೇಕಾಗಬಹುದು.','Changeset is being edited by other user.'=>'ಬದಲಾವಣೆ ಬಳಕೆದಾರರನ್ನು ಇತರ ಬಳಕೆದಾರರಿಂದ ಸಂಪಾದಿಸಲಾಗುತ್ತಿದೆ.','Security check failed.'=>'ಭದ್ರತಾ ಪರಿಶೀಲನೆ ವಿಫಲವಾಗಿದೆ.','No changeset found to take over'=>'ಸ್ವಾಧೀನಪಡಿಸಿಕೊಳ್ಳಲು ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ಕಂಡುಬಂದಿಲ್ಲ','Sorry, you are not allowed to take over.'=>'ಕ್ಷಮಿಸಿ, ನಿಮಗೆ ವಹಿಸಿಕೊಳ್ಳಲು ಅನುಮತಿ ಇಲ್ಲ.','%s is already customizing this site. Do you want to take over?'=>'%s ಈಗಾಗಲೇ ಈ ಸೈಟ್ ಅನ್ನು ಗ್ರಾಹಕೀಯಗೊಳಿಸುತಿದ್ದಾರೆ. ನೀವು ವಹಿಸಿಕೊಳ್ಳಲು ಬಯಸುವಿರಾ?','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s ಈಗಾಗಲೇ ಈ ಸೈಟ್ ಅನ್ನು ಗ್ರಾಹಕೀಯಗೊಳಿಸುತ್ತಿದೆ. ಕಸ್ಟಮೈಜ್ ಮಾಡಲು ಪ್ರಯತ್ನಿಸುವುದಕ್ಕಾಗಿ ದಯವಿಟ್ಟು ನಿರೀಕ್ಷಿಸಿ. ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಬದಲಾವಣೆಗಳನ್ನು ಸ್ವಯಂ ಉಳಿಸಲಾಗಿದೆ.','Go back'=>'ಹಿಂದೆ ಹೋಗು','Take over'=>'ತೆಗೆದುಕೊಳ್ಳಿ','customizer changeset action/button labelSchedule'=>'ವೇಳಾಪಟ್ಟಿ','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'ನಿಮ್ಮ ಹೊಸ ಮೆನುಗೆ ಕೊಂಡಿಗಳನ್ನು ಸೇರಿಸಲು ಪ್ರಾರಂಭಿಸಲು &#8220;ಮುಂದೆ&#8221; ಕ್ಲಿಕ್ ಮಾಡಿ.','Update anyway, even though it might break your site?'=>'ಹೇಗಾದರೂ ನವೀಕರಿಸುವುದೇ, ಅದು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಮುರಿಯಬಹುದಾದರೂ?','%s is already customizing this changeset. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s ಈಗಾಗಲೇ ಈ ಬದಲಾವಣೆ ಸೆಟ್ ಅನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡುತ್ತಿದ್ದಾರೆ. ಅವರು ಕಸ್ಟಮೈಸ್ ಮಾಡಲು ಪ್ರಯತ್ನಿಸುವವರೆಗೆ ದಯವಿಟ್ಟು ಕಾಯಿರಿ. ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಬದಲಾವಣೆಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಉಳಿಸಲಾಗಿದೆ.','%s is already customizing this changeset. Do you want to take over?'=>'%s ಈಗಾಗಲೇ ಈ ಬದಲಾವಣೆಗಳನ್ನು ಗ್ರಾಹಕೀಯಗೊಳಿಸುತ್ತದೆ. ನೀವು ತೆಗೆದುಕೊಳ್ಳಲು ಬಯಸುವಿರಾ?','Something went wrong.'=>'ಏನೋ ತಪ್ಪಾಗಿದೆ.','You need a higher level of permission.'=>'ನಿಮಗೆ ಹೆಚ್ಚಿನ ಮಟ್ಟದ ಅನುಮತಿ ಬೇಕು.','Privacy Policy'=>'ಗೌಪ್ಯತಾ ನೀತಿ','No archives to show.'=>'ತೋರಿಸಲು ಯಾವುದೇ ಆರ್ಕೈವ್‌ಗಳಿಲ್ಲ.','%1$s on %2$s'=>'%1$s ರಲ್ಲಿ %2$s','No comments to show.'=>'ತೋರಿಸಲು ಕಾಮೆಂಟ್ಗಳಿಲ್ಲ.','Block type names must be strings.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರ ಹೆಸರುಗಳು ತಂತಿಗಳಾಗಿರಬೇಕು.','Block type names must not contain uppercase characters.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ಹೆಸರುಗಳು ದೊಡ್ಡ ಅಕ್ಷರಗಳನ್ನು ಹೊಂದಿರಬಾರದು.','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರ ಹೆಸರುಗಳು ಒಂದು ನೇಮ್ಸ್ಪೇಸ್ ಪೂರ್ವಪ್ರತ್ಯಯವನ್ನು ಹೊಂದಿರಬೇಕು. ಉದಾಹರಣೆ: ನನ್ನ-ಪ್ಲಗಿನ್ / ನನ್ನ-ಕಸ್ಟಮ್ ಬ್ಲಾಕ್-ಪ್ರಕಾರ','Block type "%s" is already registered.'=>'ಬ್ಲಾಕ್ ರೀತಿಯ  " %s " ಈಗಾಗಲೇ ನೋಂದಾಯಿಸಲಾಗಿದೆ.','Block type "%s" is not registered.'=>'ಬ್ಲಾಕ್ ರೀತಿಯ  " %s " ನೋಂದಣಿಯಾಗಿಲ್ಲ.','(opens in a new tab)'=>'(ಹೊಸ ಟ್ಯಾಬ್‌ನಲ್ಲಿ ತೆರೆಯುತ್ತದೆ)','A key value mismatch has been detected. Please follow the link provided in your activation email.'=>'ಒಂದು ಕೀ-ಮೌಲ್ಯ ಹೊಂದಾಣಿಕೆ ಪತ್ತೆಯಾಗಿಲ್ಲ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸಕ್ರಿಯಗೊಳಿಸುವ ಇಮೇಲ್‌ನಲ್ಲಿ ನೀಡಿರುವ ಲಿಂಕ್ ಅನ್ನು ಅನುಸರಿಸಿ.','Your comment is awaiting moderation. This is a preview; your comment will be visible after it has been approved.'=>'ನಿಮ್ಮ ಕಾಮೆಂಟ್ ಮಾಡರೇಶನ್ಗಾಗಿ ಕಾಯುತ್ತಿದೆ. ಇದು ಪೂರ್ವವೀಕ್ಷಣೆ; ಅನುಮೋದಿಸಿದ ನಂತರ ನಿಮ್ಮ ಕಾಮೆಂಟ್ ಗೋಚರಿಸುತ್ತದೆ.','Quote from Hello Dolly song, by Jerry Herman:'=>'ಹಲೋ ಡಾಲಿ ಹಾಡಿನ ಉಲ್ಲೇಖ, ಜೆರ್ರಿ ಹರ್ಮನ್ ಅವರಿಂದ:','%s Comment in moderation'=>'%s ಪ್ರತಿಕ್ರಿಯೆ ಪರಿಶೀಲನೆಯಲ್ಲಿದೆ' . "\0" . '‍%s ಪ್ರತಿಕ್ರಿಯೆಗಳು ಪರಿಶೀಲನೆಯಲ್ಲಿದೆ','Exit Recovery Mode'=>'ಮರುಪಡೆಯುವಿಕೆ ಮೋಡ್‌ನಿಂದ ನಿರ್ಗಮಿಸಿ','Keep widget settings and move it to the inactive widgets'=>'ವಿಜೆಟ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ಇರಿಸಿ ಮತ್ತು ಅದನ್ನು ನಿಷ್ಕ್ರಿಯ ವಿಜೆಟ್‌ಗಳಿಗೆ ಸರಿಸಿ','User roleAdministrator'=>'ನಿರ್ವಾಹಕ','User roleEditor'=>'ಸಂಪಾದಕ','User roleAuthor'=>'ಲೇಖಕ','User roleContributor'=>'ಕೊಡುಗೆದಾರ','User roleSubscriber'=>'ಚಂದಾದಾರ','Support'=>'ಬೆಂಬಲ','https://wordpress.org/support/forums/'=>'https://wordpress.org/support/forums/','Original SizeOriginal'=>'ಮೂಲ','Your site doesn&#8217;t have any %s, so there&#8217;s nothing to display here at the moment.'=>'ನಿಮ್ಮ ಸೈಟ್ ಯಾವುದೇ %s ಅನ್ನು ಹೊಂದಿಲ್ಲ, ಆದ್ದರಿಂದ ಈ ಸಮಯದಲ್ಲಿ ಇಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲು ಏನೂ ಇಲ್ಲ.','Block name must be a string.'=>'ಬ್ಲಾಕ್ ಹೆಸರು ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Block style name must be a string.'=>'ಬ್ಲಾಕ್ ಶೈಲಿಯ ಹೆಸರು ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Block "%1$s" does not contain a style named "%2$s".'=>'"%1$s" ಬ್ಲಾಕ್ "%2$s" ಹೆಸರಿನ ಶೈಲಿಯನ್ನು ಹೊಂದಿಲ್ಲ.','https://wordpress.org/support/article/css/'=>'https://wordpress.org/support/article/css/','Edit Profile'=>'ಪ್ರೊಫೈಲ್ ಬದಲಿಸು','%1$s (%2$s)'=>'%1$s (%2$s)','Pattern name must be a string.'=>'ಪ್ಯಾಟರ್ನ್ ಹೆಸರು ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Pattern title must be a string.'=>'ಪ್ಯಾಟರ್ನ್ ಶೀರ್ಷಿಕೆಯು ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Pattern content must be a string.'=>'ಪ್ಯಾಟರ್ನ್ ವಿಷಯವು ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Pattern "%s" not found.'=>'ಪ್ಯಾಟರ್ನ್ "%s" ಕಂಡುಬಂದಿಲ್ಲ.','The asset file for the "%1$s" defined in "%2$s" block definition is missing.'=>'"%2$s" ಬ್ಲಾಕ್ ವ್ಯಾಖ್ಯಾನದಲ್ಲಿ ವ್ಯಾಖ್ಯಾನಿಸಲಾದ "%1$s" ಗಾಗಿ ಆಸ್ತಿ ಫೈಲ್ ಕಾಣೆಯಾಗಿದೆ.','Block pattern categoryButtons'=>'ಗುಂಡಿಗಳು','Block pattern categoryColumns'=>'ಅಂಕಣಗಳು','Block pattern categoryGallery'=>'ಗ್ಯಾಲರಿ','Block pattern categoryHeaders'=>'ಶಿರೋನಾಮೆಗಳು','Block pattern categoryText'=>'ಪಠ್ಯ','Block pattern category name must be a string.'=>'ಬ್ಲಾಕ್ ಪ್ಯಾಟರ್ನ್ ವರ್ಗದ ಹೆಸರು ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Block pattern category "%s" not found.'=>'ಬ್ಲಾಕ್ ಮಾದರಿ ಪ್ಯಾಟರ್ನ್ "%s" ಕಂಡುಬಂದಿಲ್ಲ.','by %s'=>'%s ನಿಂದ','Unauthorized. You may remove the %s param to preview as frontend.'=>'ಅನಧಿಕೃತ. ಮುಂಭಾಗವಾಗಿ ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಲು ನೀವು %s ಪ್ಯಾರಮ್ ಅನ್ನು ತೆಗೆದುಹಾಕಬಹುದು.','An application name is required to create an application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ರಚಿಸಲು ಅಪ್ಲಿಕೇಶನ್ ಹೆಸರು ಅಗತ್ಯವಿದೆ.','Could not save application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಉಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not find an application password with that id.'=>'ಆ ಗುರುತಿನೊಂದಿಗೆ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಹುಡುಕಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not delete application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಅಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not delete application passwords.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಗಳನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','[block rendering halted]'=>'[ಬ್ಲಾಕ್ ರೆಂಡರಿಂಗ್ ನಿಲ್ಲಿಸಲಾಗಿದೆ]','Each application name should be unique.'=>'ಪ್ರತಿ ಅಪ್ಲಿಕೇಶನ್ ಹೆಸರು ಅನನ್ಯವಾಗಿರಬೇಕು.','This content is password protected.'=>'ಈ ವಿಷಯವನ್ನು ಪಾಸ್‌ವರ್ಡ್‌ನಿಂದ ರಕ್ಷಿಸಲಾಗಿದೆ.','%s update available'=>'%s ಅಪ್‌ಡೇಟ್ ಲಭ್ಯವಿದೆ' . "\0" . '%s ಅಪ್‌ಡೇಟ್ ಗಳು ಲಭ್ಯವಿದೆ','block categoryText'=>'ಪಠ್ಯ','block categoryMedia'=>'ಮಾಧ್ಯಮ','block categoryDesign'=>'ವಿನ್ಯಾಸ','block categoryWidgets'=>'ವಿಡ್ಗೆಟ್ಗಳು','block categoryTheme'=>'ಥೀಮ್','block categoryEmbeds'=>'ಎಂಬೆಡ್(ಹುದುಗಿಸುವಿಕೆ)ಗಳು','block categoryReusable Blocks'=>'ಮರುಬಳಕೆ ಮಾಡಬಹುದಾದ ಬ್ಲಾಕ್‌ಗಳು','Block pattern titleGrid'=>'ಗ್ರಿಡ್','Block pattern titleLarge title'=>'ದೊಡ್ಡ ಶೀರ್ಷಿಕೆ','Block pattern titleImage at left'=>'ಎಡಭಾಗದಲ್ಲಿ ಚಿತ್ರ','Block pattern titleOffset'=>'ಆಫ್ಸೆಟ್','Block pattern titleSmall image and title'=>'ಸಣ್ಣ ಚಿತ್ರ ಮತ್ತು ಶೀರ್ಷಿಕೆ','Block pattern titleStandard'=>'ಪ್ರಮಾಣಿತ','Block pattern titleSocial links with a shared background color'=>'ಹಂಚಿದ ಹಿನ್ನೆಲೆ ಬಣ್ಣದೊಂದಿಗೆ ಸಾಮಾಜಿಕ ಕೊಂಡಿಗಳು','No theme is defined for this template.'=>'ಈ ಟೆಂಪ್ಲೇಟ್‌ಗೆ ಯಾವುದೇ ಥೀಮ್ ಅನ್ನು ವ್ಯಾಖ್ಯಾನಿಸಲಾಗಿಲ್ಲ.','Empty template: %s'=>'ಖಾಲಿ ಟೆಂಪ್ಲೇಟ್: %s','No matching template found.'=>'ಯಾವುದೇ ಹೊಂದಾಣಿಕೆಯಾಗುವಂತಹ ಟೆಂಪ್ಲೇಟ್ ಕಂಡುಬಂದಿಲ್ಲ.','No matching template found'=>'ಯಾವುದೇ ಹೊಂದಾಣಿಕೆಯಾಗುವಂತಹ ಟೆಂಪ್ಲೇಟ್ ಕಂಡುಬಂದಿಲ್ಲ','Block "%1$s" is declaring %2$s support in %3$s file under %4$s. %2$s support is now declared under %5$s.'=>'" %1$s" ಅನ್ನು %4$s ಅಡಿಯಲ್ಲಿ %3$s ಕಡತದಲ್ಲಿ %2$s ಬೆಂಬಲವನ್ನು ಘೋಷಿಸುತ್ತಿದೆ. %2$s ಬೆಂಬಲವನ್ನು ಈಗ %5$s ಅಡಿಯಲ್ಲಿ ಘೋಷಿಸಲಾಗಿದೆ.','(Home link, opens in a new tab)'=>'(ಹೋಮ್ ಲಿಂಕ್, ಹೊಸ ಟ್ಯಾಬ್‌ನಲ್ಲಿ ತೆರೆಯುತ್ತದೆ)','Site logo.'=>'ಸೈಟ್ ಲೋಗೋ.','%1$s: %2$s'=>'%1$s: %2$s','Block pattern categoryQuery'=>'ಪ್ರಶ್ನೆ','PDF embed'=>'PDF ಎಂಬೆಡ್','Embed of %s.'=>'%s ಎಂಬೆಡ್ ಮಾಡಿ.','Next Page'=>'ಮುಂದಿನ ಪುಟ','Previous Page'=>'ಹಿಂದಿನ ಪುಟ','Edit site'=>'ಸೈಟ್ ಸಂಪಾದಿಸಿ','General templates often perform a specific role like displaying post content, and are not tied to any particular area.'=>'ಸಾಮಾನ್ಯ ಟೆಂಪ್ಲೇಟ್‌ಗಳು ಸಾಮಾನ್ಯವಾಗಿ ಪೋಸ್ಟ್ ವಿಷಯವನ್ನು ಪ್ರದರ್ಶಿಸುವಂತಹ ನಿರ್ದಿಷ್ಟ ಪಾತ್ರವನ್ನು ನಿರ್ವಹಿಸುತ್ತವೆ ಮತ್ತು ಯಾವುದೇ ನಿರ್ದಿಷ್ಟ ಪ್ರದೇಶಕ್ಕೆ ಸಂಬಂಧಿಸಿರುವುದಿಲ್ಲ.','The Header template defines a page area that typically contains a title, logo, and main navigation.'=>'ಶಿರೋಲೇಖ ಟೆಂಪ್ಲೇಟ್ ಸಾಮಾನ್ಯವಾಗಿ ಶೀರ್ಷಿಕೆ, ಲೋಗೋ ಮತ್ತು ಮುಖ್ಯ ನ್ಯಾವಿಗೇಶನ್ ಅನ್ನು ಒಳಗೊಂಡಿರುವ ಪುಟದ ಪ್ರದೇಶವನ್ನು ವ್ಯಾಖ್ಯಾನಿಸುತ್ತದೆ.','The Footer template defines a page area that typically contains site credits, social links, or any other combination of blocks.'=>'ಅಡಿಟಿಪ್ಪಣಿ ಟೆಂಪ್ಲೇಟ್ ಸಾಮಾನ್ಯವಾಗಿ ಸೈಟ್ ಕ್ರೆಡಿಟ್‌ಗಳು, ಸಾಮಾಜಿಕ ಲಿಂಕ್‌ಗಳು ಅಥವಾ ಬ್ಲಾಕ್‌ಗಳ ಯಾವುದೇ ಸಂಯೋಜನೆಯನ್ನು ಒಳಗೊಂಡಿರುವ ಪುಟ ಪ್ರದೇಶವನ್ನು ವ್ಯಾಖ್ಯಾನಿಸುತ್ತದೆ.','Template nameIndex'=>'ಸೂಚ್ಯಂಕ','Displays posts.'=>'ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameHome'=>'ಮುಖಪುಟ','Template nameFront Page'=>'ಮುಖಪುಟ','Template nameSingular'=>'ಏಕವಚನ','Displays a single post or page.'=>'ಒಂದೇ ಪೋಸ್ಟ್ ಅಥವಾ ಪುಟವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template namePage'=>'ಪುಟ','Displays a single page.'=>'ಒಂದೇ ಪುಟವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameArchive'=>'ಸಂಗ್ರಹಗಳು','Displays post categories, tags, and other archives.'=>'ಪೋಸ್ಟ್ ವಿಭಾಗಗಳು, ಟ್ಯಾಗ್‌ಗಳು ಮತ್ತು ಇತರ ಆರ್ಕೈವ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameAuthor'=>'ಲೇಖಕ','Displays latest posts written by a single author.'=>'ಒಬ್ಬ ಲೇಖಕ ಬರೆದ ಇತ್ತೀಚಿನ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameCategory'=>'ವರ್ಗ','Displays latest posts from a single post category.'=>'ಒಂದೇ ಪೋಸ್ಟ್ ವರ್ಗದಿಂದ ಇತ್ತೀಚಿನ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameTaxonomy'=>'ಟ್ಯಾಕ್ಸಾನಮಿ','Displays latest posts from a single post taxonomy.'=>'ಒಂದೇ ಪೋಸ್ಟ್ ಟ್ಯಾಕ್ಸಾನಮಿಯಿಂದ ಇತ್ತೀಚಿನ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameDate'=>'ದಿನಾಂಕ','Displays posts from a specific date.'=>'ನಿರ್ದಿಷ್ಟ ದಿನಾಂಕದಿಂದ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameTag'=>'ಟ್ಯಾಗ್ ','Displays latest posts with a single post tag.'=>'ಒಂದೇ ಪೋಸ್ಟ್ ಟ್ಯಾಗ್‌ನೊಂದಿಗೆ ಇತ್ತೀಚಿನ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Displays individual media items or attachments.'=>'ಪ್ರತ್ಯೇಕ ಮಾಧ್ಯಮ ಐಟಂಗಳು ಅಥವಾ ಲಗತ್ತುಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template nameSearch'=>'ಹುಡುಕು','Displays the privacy policy page.'=>'ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Template name404'=>'404','Displays when no content is found.'=>'ಯಾವುದೇ ವಿಷಯ ಕಂಡುಬರದಿದ್ದಾಗ ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','"%1$s" is not a supported wp_template_part area value and has been added as "%2$s".'=>'"%1$s" ಬೆಂಬಲಿತ wp_template_part ಪ್ರದೇಶದ ಮೌಲ್ಯವಲ್ಲ ಮತ್ತು ಇದನ್ನು "%2$s" ಎಂದು ಸೇರಿಸಲಾಗಿದೆ.','Zip Export not supported.'=>'ಜಿಪ್ ರಫ್ತು ಬೆಂಬಲಿತವಾಗಿಲ್ಲ.','Unable to open export file (archive) for writing.'=>'ಬರೆಯಲು ರಫ್ತು ಫೈಲ್ (ಆರ್ಕೈವ್) ತೆರೆಯಲು ಸಾಧ್ಯವಿಲ್ಲ.','The calendar block is hidden because there are no published posts.'=>'ಯಾವುದೇ ಪ್ರಕಟಿತ ಪೋಸ್ಟ್‌ಗಳಿಲ್ಲದ ಕಾರಣ ಕ್ಯಾಲೆಂಡರ್ ಬ್ಲಾಕ್ ಅನ್ನು ಮರೆಮಾಡಲಾಗಿದೆ.','Post Format Link'=>'ಪೋಸ್ಟ್ ಫಾರ್ಮ್ಯಾಟ್ ಲಿಂಕ್','A link to a post format'=>'ಪೋಸ್ಟ್ ಫಾರ್ಮ್ಯಾಟ್‌ಗೆ ಲಿಂಕ್','%s submenu'=>'%s ಉಪಮೆನು','Open menu'=>'ಮೆನು ತೆರೆಯಿರಿ','Close menu'=>'ಮೆನುವನ್ನು ಮುಚ್ಚಿ','label for next post linkNext'=>'ಮುಂದೆ','label for previous post linkPrevious'=>'ಹಿಂದಿನ','label before the title of the next postNext:'=>'ಮುಂದೆ:','label before the title of the previou